workload:
select p_brand, p_type, sum(p_retailprice) as total_retail_price, avg(p_retailprice) as avg_retail_price, count(*) as count_part  from part  where p_size >= 10 and p_size <= 20 and p_container = 'sm case'  group by p_brand, p_type  order by p_brand, p_type  limit 1;
select c_name, o_orderdate, sum(o_totalprice) as sum_price  from customer, orders  where c_custkey = o_custkey  and c_name like '%张%'  group by c_name, o_orderdate  order by o_orderdate desc  limit 1;
select c_name, o_orderstatus, o_totalprice, l_extendedprice, l_discount, l_tax from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and l_discount > 0.05 and l_tax < 0.05 order by c_name, o_orderstatus, o_totalprice desc, l_extendedprice desc limit 100;
select s_name, count(*) as supplier_count from supplier  where s_suppkey >= 100 and s_suppkey <= 200  and exists (select * from partsupp where ps_suppkey = s_suppkey and ps_availqty > 0)  group by s_name  order by s_name limit 1;
select sum(ps_supplycost * l_quantity) as cost from partsupp inner join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey inner join orders on lineitem.l_orderkey = orders.o_orderkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey where orders.o_orderdate >= date '1995-01-01' and orders.o_orderdate < date '1995-01-01' + interval '1' year and supplier.s_name = 'abc supplier' and supplier.s_address = '123 main st' and orders.o_orderstatus = 'shipped' and orders.o_totalprice > 1000 and partsupp.ps_availqty > 10 and partsupp.ps_supplycost < 50 limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume from supplier, lineitem, orders, customer, nation n1, nation n2 where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey and ( (n1.n_name = 'italy' and n2.n_name = 'spain') or (n1.n_name = 'spain' and n2.n_name = 'italy') ) and l_shipdate between date '1997-01-01' and date '1998-12-31' ) as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year limit 1;

select s_name, s_phone, sum(ps_availqty) as sum_qty, sum(ps_supplycost) as sum_cost, sum(ps_supplycost * ps_availqty) as total_cost, avg(ps_availqty) as avg_qty, avg(ps_supplycost) as avg_cost, count(*) as count_part  from partsupp  inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey  where ps_supplycost <= 10 and s_address = 'shanghai'  group by s_name, s_phone  order by s_name  limit 1;
select c_name, o_orderdate, sum(o_totalprice) as sum_revenue from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderdate >= '2020-01-01' and o_orderdate <= '2020-12-31' group by c_name, o_orderdate order by sum_revenue desc limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier  where c_mktsegment = 'building'    and c_custkey = o_custkey    and l_orderkey = o_orderkey    and o_orderdate < date '1995-03-15'    and l_shipdate > date '1995-03-15'    and l_partkey = ps_partkey    and l_suppkey = ps_suppkey    and ps_availqty > 100    and s_suppkey = ps_suppkey    and s_acctbal > 5000  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select c_name, o_orderkey, l_linenumber, l_extendedprice, l_discount, l_tax from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and l_returnflag = 'n' and l_shipdate >= '1995-01-01' and l_shipdate < '1996-01-01' and l_discount > 0.05 and l_discount < 0.1 and l_quantity < 25 and l_extendedprice > 1000 and l_tax < 0.05 order by c_name, o_orderkey, l_linenumber  limit 100;
select s_name, count(*) as supplier_count from supplier where s_acctbal <= 1000 and s_suppkey in ( select ps_suppkey from partsupp where ps_availqty >= 100 ) group by s_name order by s_name desc  limit 1;
select c_name, sum(l_extendedprice * (1 - l_discount)) as total_price from customer, orders, lineitem, partsupp, supplier, nation, region where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and o_orderdate >= date '1995-01-01' and o_orderdate < date '1995-01-01' + interval '1' year group by c_name order by total_price desc limit 1;
select c_name, c_mktsegment, sum(o_totalprice) as sum_price, avg(o_totalprice) as avg_price, count(*) as count_order  from customer  join orders on customer.c_custkey = orders.o_custkey  where c_mktsegment = 'automobile' and o_orderdate >= date '1998-01-01' and o_orderdate <= date '1998-12-31'  group by c_name, c_mktsegment  order by sum_price desc  limit 1;
select c_mktsegment, o_year, sum(amount) as sum_profit  from (      select c_mktsegment, extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity as amount      from customer, orders, lineitem, partsupp, supplier      where c_custkey = o_custkey and o_orderkey = l_orderkey and l_suppkey = ps_suppkey and l_partkey = ps_partkey and ps_suppkey = s_suppkey          and c_mktsegment = 'furniture'          and l_shipdate between '1994-01-01' and '1994-12-31'          and s_name = 'supplier 1'  ) as profit  group by c_mktsegment, o_year  order by c_mktsegment, o_year desc  limit 1;

select s_name, s_phone, sum(ps_availqty) as sum_qty, sum(ps_supplycost) as sum_cost, sum(ps_supplycost * ps_availqty) as total_cost, avg(ps_availqty) as avg_qty, avg(ps_supplycost) as avg_cost, count(*) as count_part  from partsupp  inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey  where ps_supplycost <= 10 and s_address = 'shanghai'  group by s_name, s_phone  order by s_name  limit 1;
select c_name, o_orderdate, sum(o_totalprice) as sum_revenue from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderdate >= '2020-01-01' and o_orderdate <= '2020-12-31' group by c_name, o_orderdate order by sum_revenue desc limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier  where c_mktsegment = 'building'    and c_custkey = o_custkey    and l_orderkey = o_orderkey    and o_orderdate < date '1995-03-15'    and l_shipdate > date '1995-03-15'    and l_partkey = ps_partkey    and l_suppkey = ps_suppkey    and ps_availqty > 100    and s_suppkey = ps_suppkey    and s_acctbal > 5000  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select c_name, o_orderkey, l_linenumber, l_extendedprice, l_discount, l_tax from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and l_returnflag = 'n' and l_shipdate >= '1995-01-01' and l_shipdate < '1996-01-01' and l_discount > 0.05 and l_discount < 0.1 and l_quantity < 25 and l_extendedprice > 1000 and l_tax < 0.05 order by c_name, o_orderkey, l_linenumber  limit 100;
select s_name, count(*) as supplier_count from supplier where s_acctbal <= 1000 and s_suppkey in ( select ps_suppkey from partsupp where ps_availqty >= 100 ) group by s_name order by s_name desc  limit 1;
select c_name, sum(l_extendedprice * (1 - l_discount)) as total_price from customer, orders, lineitem, partsupp, supplier, nation, region where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and o_orderdate >= date '1995-01-01' and o_orderdate < date '1995-01-01' + interval '1' year group by c_name order by total_price desc limit 1;
select c_name, c_mktsegment, sum(o_totalprice) as sum_price, avg(o_totalprice) as avg_price, count(*) as count_order  from customer  join orders on customer.c_custkey = orders.o_custkey  where c_mktsegment = 'automobile' and o_orderdate >= date '1998-01-01' and o_orderdate <= date '1998-12-31'  group by c_name, c_mktsegment  order by sum_price desc  limit 1;
select c_mktsegment, o_year, sum(amount) as sum_profit  from (      select c_mktsegment, extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity as amount      from customer, orders, lineitem, partsupp, supplier      where c_custkey = o_custkey and o_orderkey = l_orderkey and l_suppkey = ps_suppkey and l_partkey = ps_partkey and ps_suppkey = s_suppkey          and c_mktsegment = 'furniture'          and l_shipdate between '1994-01-01' and '1994-12-31'          and s_name = 'supplier 1'  ) as profit  group by c_mktsegment, o_year  order by c_mktsegment, o_year desc  limit 1;

select n_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region where c_custkey = o_custkey and l_orderkey = o_orderkey and l_suppkey = s_suppkey and c_nationkey = s_nationkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'asia' and o_orderdate >= date '1994-01-01' and o_orderdate < date '1995-01-01' group by n_name order by revenue desc limit 1;
select s_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region where c_custkey = o_custkey and l_orderkey = o_orderkey and l_suppkey = s_suppkey and c_nationkey = s_nationkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'asia' and o_orderdate >= date '1994-01-01' and o_orderdate < date '1995-01-01' group by s_name order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue from lineitem, orders where lineitem.l_orderkey = orders.o_orderkey and l_shipdate > o_orderdate and l_shipdate >= date '1994-01-01' and l_shipdate < date '1995-01-01' and l_discount between .05 and .07 and l_quantity < 30;
select sum(l_extendedprice * l_discount) as revenue from lineitem, partsupp, supplier, nation where lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey and partsupp.ps_suppkey = supplier.s_suppkey and supplier.s_nationkey = nation.n_nationkey and nation.n_name = 'china';
select count(*) as order_count from orders, customer, nation where orders.o_custkey = customer.c_custkey and customer.c_nationkey = nation.n_nationkey and nation.n_name = 'united states' and o_totalprice > 10000;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume  from supplier, lineitem, orders, customer, nation n1, nation n2  where s_suppkey = l_suppkey  and o_orderkey = l_orderkey  and c_custkey = o_custkey  and s_nationkey = n1.n_nationkey  and c_nationkey = n2.n_nationkey  and ((n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france')) and l_shipdate between date '1995-01-01' and date '1996-12-31'  ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume  from supplier, lineitem, orders, customer, nation n1, nation n2  where s_suppkey = l_suppkey  and o_orderkey = l_orderkey  and c_custkey = o_custkey  and s_nationkey = n1.n_nationkey  and c_nationkey = n2.n_nationkey  and ((n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france')) and l_shipdate between date '1997-01-01' and date '1998-12-31'  ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select o_year, sum(case when nation = 'canada' then volume else 0 end) / sum(volume) as mkt_share from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation from part, supplier, lineitem, orders, customer, nation n1, nation n2, region where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'asia' and s_nationkey = n2.n_nationkey and o_orderdate between date '1995-01-01' and date '1996-12-31' and p_type = 'stainless steel' ) as all_nations group by o_year order by o_year limit 1;
select o_year, sum(case when nation = 'germany' then volume else 0 end) / sum(volume) as mkt_share from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation from part, supplier, lineitem, orders, customer, nation n1, nation n2, region where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'europe' and s_nationkey = n2.n_nationkey and o_orderdate between date '1995-01-01' and date '1996-12-31' and p_type = 'wood' ) as all_nations group by o_year order by o_year limit 1;
select o_year, sum(case when nation = 'japan' then volume else 0 end) / sum(volume) as mkt_share from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation from part, supplier, lineitem, orders, customer, nation n1, nation n2, region where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'asia' and s_nationkey = n2.n_nationkey and o_orderdate between date '1995-01-01' and date '1996-12-31' and p_type = 'brass' ) as all_nations group by o_year order by o_year limit 1;

select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, partsupp, orders, supplier, customer  where (l_partkey = ps_partkey and l_suppkey = ps_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = 2  and ps_availqty > 100 and ps_supplycost < 1000 and o_orderstatus = 'f'  and s_suppkey = ps_suppkey and s_nationkey = 2 and s_acctbal > 10000)  or (l_partkey = ps_partkey and l_suppkey = ps_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = 3  and ps_availqty > 100 and ps_supplycost < 1000 and o_orderstatus = 'f'  and s_suppkey = ps_suppkey and s_nationkey = 3 and s_acctbal > 10000)  or (l_partkey = ps_partkey and l_suppkey = ps_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = 4  and ps_availqty > 100 and ps_supplycost < 1000 and o_orderstatus = 'f'  and s_suppkey = ps_suppkey and s_nationkey = 4 and s_acctbal > 10000)  limit 1;
select c_name, c_phone from customer, nation where c_custkey in ( select o_custkey from orders where o_orderkey in ( select l_orderkey from lineitem where l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year ) and o_orderstatus = 'f' ) and c_nationkey = n_nationkey and n_name = 'germany' order by c_name limit 1;
select s_name, s_address  from supplier, nation  where s_suppkey in (    select ps_suppkey    from partsupp    where ps_partkey in (      select p_partkey      from part      where p_name like 'forest%'    )    and ps_availqty > (      select 0.5 * sum(l_quantity)      from lineitem      where l_partkey = ps_partkey      and l_suppkey = ps_suppkey      and l_shipdate >= '1994-01-01'      and l_shipdate < '1995-01-01'    )  )  and s_nationkey = n_nationkey  and n_name = 'canada'  order by s_name  limit 1;
select s_name, count(*) as numwait  from supplier, lineitem l1, orders, nation  where s_suppkey = l1.l_suppkey  and o_orderkey = l1.l_orderkey  and o_orderstatus = 'f'  and l1.l_receiptdate > l1.l_commitdate  and exists (select * from lineitem l2 where l2.l_orderkey = l1.l_orderkey and l2.l_suppkey <> l1.l_suppkey)  and not exists (select * from lineitem l3 where l3.l_orderkey = l1.l_orderkey and l3.l_suppkey <> l1.l_suppkey and l3.l_receiptdate > l3.l_commitdate)  and s_nationkey = n_nationkey  and n_name = 'saudi arabia'  group by s_name  order by numwait desc, s_name  limit 100;
select s_name, count(*) as num_parts from ( select s_name from supplier where s_suppkey in ( select ps_suppkey from partsupp where ps_partkey in ( select p_partkey from part where p_type in ('a', 'b', 'c') and p_size >= 10 and p_size <= 20 ) ) and s_nationkey in ( select n_nationkey from nation where n_regionkey in ( select r_regionkey from region where r_name = 'asia' ) ) and s_acctbal > ( select avg(s_acctbal) from supplier where s_acctbal > 0.00 and s_nationkey in ( select n_nationkey from nation where n_regionkey in ( select r_regionkey from region where r_name = 'asia' ) ) ) and not exists ( select * from lineitem where l_suppkey = s_suppkey ) ) as partssupplier group by s_name order by num_parts desc limit 1;

select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment from customer, orders, lineitem, nation where c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate >= date '1995-01-01' and o_orderdate < date '1996-01-01' and l_returnflag = 'r' and c_nationkey = n_nationkey group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment order by revenue desc limit 10;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment from customer, orders, lineitem, nation where c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate >= date '1994-07-01' and o_orderdate < date '1994-10-01' and l_returnflag = 'a' and c_nationkey = n_nationkey group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment order by revenue desc limit 5;
select ps_partkey, sum(ps_supplycost * ps_availqty) as value from partsupp, supplier, nation where ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_name = 'germany' group by ps_partkey having sum(ps_supplycost * ps_availqty) > ( select sum(ps_supplycost * ps_availqty) * 0.0001000000 from partsupp, supplier, nation where ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_name = 'germany' ) order by value desc limit 1;
select ps_partkey, sum(ps_supplycost * ps_availqty) as value from partsupp, supplier, nation where ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_name = 'germany' group by ps_partkey having sum(ps_supplycost * ps_availqty) < ( select sum(ps_supplycost * ps_availqty) * 0.0001000000 from partsupp, supplier, nation where ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_name = 'germany' ) order by value asc limit 1;
select s_name, sum(l_extendedprice) as total_sales, avg(l_extendedprice) as average_sales from orders, lineitem, partsupp, supplier where o_orderkey = l_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and ps_suppkey = s_suppkey and s_name in ('supplier 1', 'supplier 2') group by s_name;
select c_name, sum(l_extendedprice - l_discount - ps_supplycost) as total_profit, avg(l_extendedprice - l_discount - ps_supplycost) as average_profit from orders, lineitem, partsupp, customer where o_orderkey = l_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and o_custkey = c_custkey and c_name in ('customer 1', 'customer 2') group by c_name;
select p_type, sum(l_quantity) as total_sales from lineitem join part on l_partkey = p_partkey join orders on l_orderkey = o_orderkey join customer on o_custkey = c_custkey where c_mktsegment = 'household' and p_type not like '%furniture%' group by p_type order by total_sales desc limit 1;
select s_name, sum(l_extendedprice) as total_revenue from lineitem join supplier on l_suppkey = s_suppkey join orders on l_orderkey = o_orderkey join customer on o_custkey = c_custkey where c_mktsegment = 'automobile' and l_shipdate >= '1994-01-01' and l_shipdate < '1995-01-01' group by s_name order by total_revenue desc limit 1;
select sum(l_extendedprice * (1 - l_discount)) as total_revenue from lineitem, orders, supplier where lineitem.l_orderkey = orders.o_orderkey and lineitem.l_suppkey = supplier.s_suppkey and supplier.s_name = 'supplier_name' and orders.o_orderdate >= date '1995-09-01' and orders.o_orderdate < date '1995-10-01';
select sum(l_quantity) as total_quantity from lineitem, orders, customer, part where lineitem.l_orderkey = orders.o_orderkey and orders.o_custkey = customer.c_custkey and lineitem.l_partkey = part.p_partkey and customer.c_name = 'customer_name' and part.p_type = 'product_type' and orders.o_orderdate >= date '1995-09-01' and orders.o_orderdate < date '1995-10-01';

select c_name, o_orderstatus, sum(l_quantity) as total_quantity, sum(l_extendedprice) as total_price, avg(l_extendedprice * (1 - l_discount)) as avg_discounted_price, sum(l_extendedprice * (1 - l_discount) * (1 + l_tax)) as total_charge, avg(l_quantity) as avg_quantity, avg(l_extendedprice) as avg_extended_price, avg(l_discount) as avg_discount, count(*) as total_orders  from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey  join supplier on ps_suppkey = s_suppkey  where c_mktsegment = 'automobile'  and o_orderstatus = 'f'  and s_address like '%beijing%'  and l_shipdate <= date '2021-07-31'  group by c_name, o_orderstatus  order by c_name, o_orderstatus  limit 1;
select c_custkey, o_orderkey, l_partkey, l_suppkey, p_name, s_name, n_name from customer, orders, lineitem, part, supplier, nation where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = p_partkey and l_suppkey = s_suppkey and s_nationkey = n_nationkey and p_name like '%red%' and s_name like '%china%' and n_name = 'asia' and o_orderdate >= '2021-01-01' and o_orderdate < '2022-01-01' limit 10;
select s_name, count(*) as supplier_count from supplier where s_acctbal > 5000 and exists ( select * from partsupp where ps_suppkey = s_suppkey and ps_availqty > 100 ) group by s_name order by s_name limit 1;
select s_name, sum(l_extendedprice * (1 - l_discount)) as revenue from supplier, partsupp, lineitem, orders, customer, nation, region where s_suppkey = ps_suppkey and ps_partkey = l_partkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and o_orderdate >= date '1995-01-01' and o_orderdate < date '1996-01-01' and s_acctbal > 1000 group by s_name order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= '1995-01-01'  and l_shipdate < '1996-01-01'  and l_discount between 0.04 and 0.08  and l_quantity < 30  and l_suppkey in (     select ps_suppkey      from partsupp      where ps_supplycost < 500      and ps_availqty > 100 )  and l_partkey in (     select ps_partkey      from partsupp      where ps_supplycost < 500      and ps_availqty > 100 )  and l_orderkey in (     select o_orderkey      from orders      where o_orderstatus = 'f'      and o_orderdate >= '1995-01-01'      and o_orderdate < '1996-01-01' )  and l_suppkey in (     select s_suppkey      from supplier      where s_phone like '%1234%' )  and l_orderkey in (     select o_orderkey      from orders      where o_custkey in (         select c_custkey          from customer          where c_mktsegment = 'automobile'     ) ) limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume from supplier, lineitem, orders, customer, nation n1, nation n2 where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey and ( (n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france') ) and l_shipdate between date '1995-01-01' and date '1996-12-31' ) as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year limit 1;
select o_year, sum(case when nation = 'germany' then volume else 0 end) / sum(volume) as mkt_share from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation from part, supplier, lineitem, orders, customer, nation n1, nation n2, region where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'europe' and s_nationkey = n2.n_nationkey and o_orderdate between date '1998-01-01' and date '1999-12-31' and p_type = 'large anodized aluminum' ) as all_nations group by o_year order by o_year limit 1;
select s_suppkey, s_name, sum(ps_supplycost * ps_availqty) as cost, s_acctbal, r_name, s_address, s_phone, s_comment  from supplier, partsupp, lineitem, region, nation where s_suppkey = ps_suppkey  and l_suppkey = ps_suppkey  and l_partkey = ps_partkey  and l_shipdate >= date '1994-01-01'  and l_shipdate < date '1994-01-01' + interval '3' month  and l_returnflag = 'r'  and s_nationkey = n_nationkey  group by s_suppkey, s_name, s_acctbal, s_phone, r_name, s_address, s_comment  order by cost desc  limit 20;

select c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity) from customer, orders, lineitem where o_orderkey in ( select l_orderkey from lineitem group by l_orderkey having sum(l_quantity) > 300 ) and c_custkey = o_custkey and o_orderkey = l_orderkey group by c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice order by o_totalprice desc, o_orderdate LIMIT 100;
select sum(l_extendedprice* (1 - l_discount)) as revenue from lineitem, part where ( p_partkey = l_partkey and p_brand = 'Brand#12' and p_container in ('SM CASE', 'SM BOX', 'SM PACK', 'SM PKG') and l_quantity >= 1 and l_quantity <= 1 + 10 and p_size between 1 and 5 and l_shipmode in ('AIR', 'AIR REG') and l_shipinstruct = 'DELIVER IN PERSON' ) or ( p_partkey = l_partkey and p_brand = 'Brand#23' and p_container in ('MED BAG', 'MED BOX', 'MED PKG', 'MED PACK') and l_quantity >= 10 and l_quantity <= 10 + 10 and p_size between 1 and 10 and l_shipmode in ('AIR', 'AIR REG') and l_shipinstruct = 'DELIVER IN PERSON' ) or ( p_partkey = l_partkey and p_brand = 'Brand#34' and p_container in ('LG CASE', 'LG BOX', 'LG PACK', 'LG PKG') and l_quantity >= 20 and l_quantity <= 20 + 10 and p_size between 1 and 15 and l_shipmode in ('AIR', 'AIR REG') and l_shipinstruct = 'DELIVER IN PERSON' ) LIMIT 1;
select sum(ps_supplycost * l_quantity) as cost from lineitem  inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey  inner join orders on lineitem.l_orderkey = orders.o_orderkey  inner join customer on orders.o_custkey = customer.c_custkey  where l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year  and l_discount between .06 - 0.01 and .06 + 0.01  and l_quantity < 24  and customer.c_mktsegment = 'segment1'  and partsupp.ps_availqty > 0  limit 1;
select cntrycode, count(*) as numcust, sum(c_acctbal) as totacctbal from ( select substring(c_phone from 1 for 2) as cntrycode, c_acctbal from customer where substring(c_phone from 1 for 2) in ('13', '31', '23', '29', '30', '18', '17') and c_acctbal > ( select avg(c_acctbal) from customer where c_acctbal > 0.00 and substring(c_phone from 1 for 2) in ('13', '31', '23', '29', '30', '18', '17') ) and not exists ( select * from orders where o_custkey = c_custkey ) ) as custsale group by cntrycode order by cntrycode LIMIT 1;

select p_brand, p_type, sum(p_retailprice) as total_retail_price, avg(p_retailprice) as avg_retail_price, count(*) as count_part  from part  where p_size >= 10 and p_size <= 20 and p_container = 'sm case'  group by p_brand, p_type  order by p_brand, p_type  limit 1;
select c_name, o_orderdate, sum(o_totalprice) as sum_price  from customer, orders  where c_custkey = o_custkey  and c_name like '%zhang%'  group by c_name, o_orderdate  order by o_orderdate desc  limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier, nation, region  where c_mktsegment = 'automobile'  and c_custkey = o_custkey  and l_orderkey = o_orderkey  and o_orderdate < date '1997-01-01'  and l_shipdate > date '1997-01-01'  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_supplycost < 100  and s_nationkey = n_nationkey  and n_regionkey = r_regionkey  and r_name = 'asia'  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select c_name, o_orderstatus, o_totalprice, l_extendedprice, l_discount, l_tax from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and l_discount > 0.05 and l_tax < 0.05 order by c_name, o_orderstatus, o_totalprice desc, l_extendedprice desc limit 100;
select s_name, count(*) as supplier_count from supplier  where s_suppkey >= 100 and s_suppkey <= 200  and exists (select * from partsupp where ps_suppkey = s_suppkey and ps_availqty > 0)  group by s_name  order by s_name limit 1;

select p_brand, p_type, s_name, sum(ps_availqty) as total_avail_qty, sum(ps_supplycost) as total_supply_cost from partsupp join part on partsupp.ps_partkey = part.p_partkey join supplier on partsupp.ps_suppkey = supplier.s_suppkey join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey where p_size >= 30 and s_acctbal > 1000 and l_shipdate <= date '1999-01-01' group by p_brand, p_type, s_name order by total_avail_qty desc limit 1;
select ps_partkey, sum(ps_supplycost * ps_availqty) as cost, p_brand, p_type from partsupp, part where ps_partkey = p_partkey and p_brand = 'brand1' and p_type = 'type1' group by ps_partkey, p_brand, p_type order by cost desc limit 10;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment  from part, supplier, partsupp, nation, region  where p_partkey = ps_partkey and s_suppkey = ps_suppkey  and p_size = 20 and p_type like '%steel'  and s_nationkey = n_nationkey and n_regionkey = r_regionkey  and r_name = 'asia' and ps_supplycost = ( select min(ps_supplycost) from partsupp, supplier, nation, region where p_partkey = ps_partkey and s_suppkey = ps_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'asia'  )  order by s_acctbal desc, n_name, s_name, p_partkey  limit 100;
select s_name, count(*) as supplier_count from supplier where s_acctbal > 1000 and s_nationkey = (select n_nationkey from nation where n_name = 'united states') and exists (select * from partsupp where ps_suppkey = s_suppkey and ps_supplycost < 100) group by s_name order by supplier_count limit 1;
select sum(ps_supplycost * ps_availqty) as cost from partsupp, supplier where partsupp.ps_suppkey = supplier.s_suppkey and supplier.s_acctbal > 10000 and partsupp.ps_availqty > 100 and partsupp.ps_supplycost < 100 and partsupp.ps_supplycost > 10 limit 1;
select s_address, c_address, extract(year from l_shipdate) as l_year, sum(ps_supplycost * l_quantity) as cost  from partsupp, lineitem, orders, customer, supplier where ps_partkey = l_partkey and ps_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and s_suppkey = ps_suppkey and ( (s_address like '%new york%' and c_address like '%los angeles%') or (s_address like '%los angeles%' and c_address like '%new york%') ) and l_shipdate between date '1995-01-01' and date '1996-12-31' group by s_address, c_address, l_year order by s_address, c_address, l_year limit 1;
select o_year, sum(case when nation = 'germany' then volume else 0 end) / sum(volume) as mkt_share  from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation from part, supplier, lineitem, orders, customer, nation n1, nation n2, region where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'europe' and s_nationkey = n2.n_nationkey and o_orderdate between date '1995-01-01' and date '1996-12-31' and p_type = 'standard anodized steel' ) as all_nations  group by o_year  order by o_year limit 1;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment  from customer, orders, lineitem, nation, partsupp, supplier  where c_custkey = o_custkey  and l_orderkey = o_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_availqty > 100  and ps_supplycost < 100  and o_orderdate >= date '1993-10-01'  and o_orderdate < date '1993-10-01' + interval '3' month  and l_returnflag = 'r'  and c_nationkey = n_nationkey  and s_suppkey = ps_suppkey  and s_acctbal > 10000  group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment  order by revenue desc  limit 20;

select s_name, s_address, sum(ps_availqty) as total_avail_qty, sum(ps_supplycost) as total_supply_cost, count(*) as count_supp from supplier join partsupp on supplier.s_suppkey = partsupp.ps_suppkey join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey where supplier.s_name = 'abc supplier' and partsupp.ps_availqty > 100 and lineitem.l_shipdate <= date '1998-12-01' group by s_name, s_address order by total_avail_qty desc limit 1;
select c_name, c_mktsegment, o_orderdate, sum(o_totalprice) as sum_revenue from customer, orders where c_custkey = o_custkey and c_mktsegment = 'building' and o_orderdate >= '2019-01-01' and o_orderdate <= '2019-12-31' group by c_name, c_mktsegment, o_orderdate order by sum_revenue desc limit 10;
select c_name, o_orderkey, o_orderstatus, o_totalprice, o_orderdate, o_orderpriority, o_clerk, o_shippriority, l_linenumber, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus, l_shipdate, l_commitdate, l_receiptdate, l_shipinstruct, l_shipmode, l_comment  from customer, orders, lineitem, partsupp, supplier  where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_supplycost = (select min(ps_supplycost)                       from partsupp, supplier                       where l_partkey = ps_partkey                       and l_suppkey = ps_suppkey)  and c_name like '%customer%'  and o_orderstatus = 'f'  and o_totalprice > 1000  and o_orderdate < '2020-01-01'  and o_orderpriority = 'high'  and o_clerk = 'sales'  and l_linenumber = 1  and l_discount < 0.1  and l_tax > 0.05  and l_returnflag = 'n'  and l_linestatus = 'shipped'  and l_shipdate >= '2020-01-01'  and l_commitdate <= '2020-12-31'  and l_receiptdate >= '2020-01-01'  and l_shipinstruct = 'air'  and l_shipmode = 'express'  and l_comment not like '%backorder%'  order by c_name, o_orderkey, l_linenumber  limit 100;
select p_brand, count(*) as part_count  from part  where p_size >= 10 and p_size <= 20  and p_container in ('wrap', 'box', 'bag')  and exists (     select *      from partsupp      where ps_partkey = p_partkey      and ps_supplycost < 100  ) group by p_brand  order by part_count desc  limit 1;
select p_name, sum(l_extendedprice * (1 - l_discount)) as revenue from part, partsupp, lineitem, supplier, nation, region where p_partkey = ps_partkey and ps_partkey = l_partkey and ps_suppkey = l_suppkey and s_suppkey = ps_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and l_shipdate >= date '1996-01-01' and l_shipdate < date '1996-01-01' + interval '1' year group by p_name order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join orders on lineitem.l_orderkey = orders.o_orderkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey inner join customer on orders.o_custkey = customer.c_custkey where l_shipdate >= date '1995-01-01' and l_shipdate < date '1995-01-01' + interval '1' year  and l_discount between .06 - 0.01 and .06 + 0.01  and l_quantity < 24  and supplier.s_name = 'supplier name'  and customer.c_name = 'customer name'  and orders.o_orderstatus = 'f'  and customer.c_mktsegment = 'segment'  and partsupp.ps_availqty > 10  limit 1;
select s.s_name as supp_name, c.c_name as cust_name, extract(year from l.l_shipdate) as ship_year, sum(l.l_extendedprice * (1 - l.l_discount)) as revenue  from supplier s, lineitem l, orders o, customer c, nation n1, nation n2  where s.s_suppkey = l.l_suppkey  and o.o_orderkey = l.l_orderkey  and c.c_custkey = o.o_custkey  and s.s_nationkey = n1.n_nationkey  and c.c_nationkey = n2.n_nationkey  and ((n1.n_name = 'canada' and n2.n_name = 'united states') or (n1.n_name = 'united states' and n2.n_name = 'canada'))  and l.l_shipdate between date '1997-01-01' and date '1997-12-31'  group by s.s_name, c.c_name, ship_year  order by s.s_name, c.c_name, ship_year  limit 1;

select sum(l_extendedprice* (1 - l_discount)) as revenue from lineitem, partsupp, orders, supplier where (lineitem.l_partkey = partsupp.ps_partkey and partsupp.ps_suppkey = supplier.s_suppkey and orders.o_orderkey = lineitem.l_orderkey and supplier.s_nationkey = 1 and orders.o_totalprice > 10000 and lineitem.l_discount <= 0.05 and partsupp.ps_supplycost < 100) or (lineitem.l_partkey = partsupp.ps_partkey and partsupp.ps_suppkey = supplier.s_suppkey and orders.o_orderkey = lineitem.l_orderkey and supplier.s_nationkey = 2 and orders.o_totalprice > 20000 and lineitem.l_discount <= 0.1 and partsupp.ps_supplycost < 200) or (lineitem.l_partkey = partsupp.ps_partkey and partsupp.ps_suppkey = supplier.s_suppkey and orders.o_orderkey = lineitem.l_orderkey and supplier.s_nationkey = 3 and orders.o_totalprice > 30000 and lineitem.l_discount <= 0.15 and partsupp.ps_supplycost < 300) limit 1;
select c_name, c_address from customer, nation where c_custkey in ( select o_custkey from orders where o_orderkey in ( select l_orderkey from lineitem where l_partkey in ( select ps_partkey from partsupp where ps_suppkey in ( select s_suppkey from supplier where s_name like 'a%' ) ) ) ) and c_nationkey = n_nationkey and n_name = 'germany' order by c_name limit 1;
select c_name, count(*) as numorders from customer, lineitem l1, orders, supplier, nation where c_custkey = o_custkey and o_orderkey = l1.l_orderkey and l1.l_suppkey = s_suppkey and o_orderstatus = 'f' and l1.l_receiptdate > l1.l_commitdate and exists ( select * from lineitem l2 where l2.l_orderkey = l1.l_orderkey and l2.l_suppkey <> l1.l_suppkey ) and not exists ( select * from lineitem l3 where l3.l_orderkey = l1.l_orderkey and l3.l_suppkey <> l1.l_suppkey and l3.l_receiptdate > l3.l_commitdate ) and s_nationkey = n_nationkey and n_name = 'germany' group by c_name order by numorders desc, c_name limit 100;
select p_type, p_brand, p_mfgr, sum(p_retailprice) as sum_retail_price, sum(ps_availqty) as sum_avail_qty, sum(ps_supplycost) as sum_supply_cost, avg(p_retailprice) as avg_retail_price, avg(ps_availqty) as avg_avail_qty, avg(ps_supplycost) as avg_supply_cost, count(*) as count_part from part inner join partsupp on part.p_partkey = partsupp.ps_partkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey inner join lineitem on part.p_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey where supplier.s_nationkey = 1 and lineitem.l_shipdate <= date '1998-12-01' group by p_type, p_brand, p_mfgr order by p_type, p_brand limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier  where c_mktsegment = 'building' and c_custkey = o_custkey and l_orderkey = o_orderkey  and l_partkey = ps_partkey and l_suppkey = ps_suppkey  and ps_supplycost < 100 and s_suppkey = ps_suppkey  and o_orderdate < date '1995-03-15' and l_shipdate > date '1995-03-15'  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select c_name, c_phone, c_mktsegment, o_orderkey, o_orderstatus, o_orderdate, o_totalprice, o_comment, l_partkey, l_suppkey, l_shipdate, l_shipinstruct, l_comment from customer, orders, lineitem, partsupp, supplier where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and l_shipdate >= '2020-01-01' and l_shipdate <= '2020-12-31' and ps_supplycost = ( select max(ps_supplycost) from partsupp, supplier where l_partkey = ps_partkey and l_suppkey = ps_suppkey ) order by c_name, o_orderdate desc, l_shipdate, o_totalprice desc, l_comment limit 100;
select s_name, count(*) as supplier_count from supplier where s_acctbal > 5000 and exists ( select * from partsupp where ps_suppkey = s_suppkey and ps_availqty > 100 ) group by s_name order by s_name limit 1;
select sum(ps_supplycost * l_quantity) as cost from lineitem  inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey  inner join orders on lineitem.l_orderkey = orders.o_orderkey  inner join customer on orders.o_custkey = customer.c_custkey  where l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year  and l_discount between .06 - 0.01 and .06 + 0.01  and l_quantity < 24  and customer.c_mktsegment = 'segment1'  and partsupp.ps_availqty > 0  limit 1;
select p_name, s_name, o_orderdate, sum(l_extendedprice) as revenue  from part, supplier, lineitem, orders  where p_partkey = l_partkey  and s_suppkey = l_suppkey  and o_orderkey = l_orderkey  and l_shipdate between date '1995-01-01' and date '1996-12-31'  group by p_name, s_name, o_orderdate  order by revenue desc  limit 1;
select o_year, sum(case when nation = 'germany' then volume else 0 end) / sum(volume) as mkt_share  from (      select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation      from part, supplier, lineitem, orders, customer, nation n1, nation n2, region      where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey      and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'europe' and s_nationkey = n2.n_nationkey      and o_orderdate between date '1997-01-01' and date '1998-12-31' and p_type = 'high-end steel' ) as all_nations  group by o_year  order by o_year limit 1;
select s_suppkey, s_name, sum(ps_supplycost * ps_availqty) as cost, s_acctbal, n_name, s_address, s_phone, s_comment  from supplier, partsupp, nation  where s_suppkey = ps_suppkey  and ps_partkey = 1  and ps_supplycost < 100  and s_nationkey = n_nationkey  group by s_suppkey, s_name, s_acctbal, s_phone, n_name, s_address, s_comment  order by cost desc  limit 10;

SELECT MIN(mi.info) AS movie_budget, MIN(mi_idx.info) AS movie_votes, MIN(n.name) AS male_writer, MIN(t.title) AS violent_movie_title FROM cast_info AS ci, info_type AS it1, info_type AS it2, keyword AS k, movie_info AS mi, movie_info_idx AS mi_idx, movie_keyword AS mk, name AS n, title AS t WHERE ci.note IN ('(writer)', '(head writer)', '(written by)', '(story)', '(story editor)') AND it1.info = 'genres' AND it2.info = 'votes' AND k.keyword IN ('murder', 'blood', 'gore', 'death', 'female-nudity') AND mi.info = 'Horror' AND n.gender = 'm' AND t.production_year > 2010 AND t.title LIKE 'Vampire%' AND t.id = mi.movie_id AND t.id = mi_idx.movie_id AND t.id = ci.movie_id AND t.id = mk.movie_id AND ci.movie_id = mi.movie_id AND ci.movie_id = mi_idx.movie_id AND ci.movie_id = mk.movie_id AND mi.movie_id = mi_idx.movie_id AND mi.movie_id = mk.movie_id AND mi_idx.movie_id = mk.movie_id AND n.id = ci.person_id AND it1.id = mi.info_type_id AND it2.id = mi_idx.info_type_id AND k.id = mk.keyword_id;
