SELECT MIN(mi_idx.info) AS rating, MIN(t.title) AS northern_dark_movie FROM info_type AS it1, info_type AS it2, keyword AS k, kind_type AS kt, movie_info AS mi, movie_info_idx AS mi_idx, movie_keyword AS mk, title AS t WHERE it1.info = 'countries' AND it2.info = 'rating' AND k.keyword IN ('murder', 'murder-in-title', 'blood', 'violence') AND kt.kind = 'movie' AND mi.info IN ('Sweden', 'Norway', 'Germany', 'Denmark', 'Swedish', 'Danish', 'Norwegian', 'German', 'USA', 'American') AND mi_idx.info < '8.5' AND t.production_year > 2010 AND kt.id = t.kind_id AND t.id = mi.movie_id AND t.id = mk.movie_id AND t.id = mi_idx.movie_id AND mk.movie_id = mi.movie_id AND mk.movie_id = mi_idx.movie_id AND mi.movie_id = mi_idx.movie_id AND k.id = mk.keyword_id AND it1.id = mi.info_type_id AND it2.id = mi_idx.info_type_id GROUP BY t.id ORDER BY rating ASC;
SELECT MIN(an.name) AS cool_actor_pseudonym, MIN(t.title) AS series_named_after_char FROM aka_name AS an, cast_info AS ci, company_name AS cn, keyword AS k, movie_companies AS mc, movie_keyword AS mk, name AS n, title AS t WHERE cn.country_code = '[us]' AND k.keyword = 'character-name-in-title' AND t.episode_nr >= 50 AND t.episode_nr < 100 AND an.person_id = n.id AND n.id = ci.person_id AND ci.movie_id = t.id AND t.id = mk.movie_id AND mk.keyword_id = k.id AND t.id = mc.movie_id AND mc.company_id = cn.id AND an.person_id = ci.person_id AND ci.movie_id = mc.movie_id AND ci.movie_id = mk.movie_id AND mc.movie_id = mk.movie_id;
SELECT MIN(t.title) AS movie_title FROM keyword AS k JOIN movie_keyword AS mk ON mk.keyword_id = k.id JOIN movie_info AS mi ON mi.movie_id = mk.movie_id JOIN title AS t ON t.id = mk.movie_id WHERE k.keyword LIKE '%sequel%' AND mi.info IN ('Bulgaria') AND t.production_year > 2010;
SELECT MIN(lt.link) AS link_type, MIN(t1.title) AS first_movie, MIN(t2.title) AS second_movie FROM keyword AS k INNER JOIN movie_keyword AS mk ON mk.keyword_id = k.id INNER JOIN title AS t1 ON t1.id = mk.movie_id INNER JOIN movie_link AS ml ON ml.movie_id = t1.id INNER JOIN title AS t2 ON ml.linked_movie_id = t2.id INNER JOIN link_type AS lt ON lt.id = ml.link_type_id WHERE k.keyword = 'character-name-in-title' GROUP BY mk.movie_id, ml.linked_movie_id;

SELECT MIN(n.name) AS of_person, MIN(t.title) AS biography_movie FROM aka_name AS an JOIN name AS n ON n.id = an.person_id JOIN person_info AS pi ON pi.person_id = an.person_id AND pi.person_id = n.id JOIN cast_info AS ci ON ci.person_id = n.id JOIN title AS t ON t.id = ci.movie_id JOIN movie_link AS ml ON ml.linked_movie_id = t.id JOIN link_type AS lt ON lt.id = ml.link_type_id JOIN info_type AS it ON it.id = pi.info_type_id WHERE an.name LIKE '%a%' AND it.info ='mini biography' AND lt.link ='features' AND n.name_pcode_cf BETWEEN 'A' AND 'F' AND (n.gender='m' OR (n.gender = 'f' AND n.name LIKE 'B%')) AND pi.note ='Volker Boehm' AND t.production_year BETWEEN 1980 AND 1995 GROUP BY an.person_id;
SELECT MIN(n.name) AS of_person, MIN(t.title) AS biography_movie FROM aka_name AS an JOIN name AS n ON n.id = an.person_id JOIN person_info AS pi ON pi.person_id = an.person_id JOIN info_type AS it ON it.id = pi.info_type_id JOIN cast_info AS ci ON ci.person_id = n.id JOIN movie_link AS ml ON ml.linked_movie_id = ci.movie_id JOIN link_type AS lt ON lt.id = ml.link_type_id JOIN title AS t ON t.id = ci.movie_id WHERE an.name LIKE '%a%' AND it.info ='mini biography' AND lt.link ='features' AND n.name_pcode_cf BETWEEN 'A' AND 'F' AND (n.gender='m' OR (n.gender = 'f' AND n.name LIKE 'B%')) AND pi.note ='Volker Boehm' AND t.production_year BETWEEN 1980 AND 1995;
SELECT MIN(cn.name) AS producing_company, MIN(mi.info) AS rating, MIN(t.title) AS movie_about_winning FROM company_name AS cn JOIN movie_companies AS mc ON cn.id = mc.company_id JOIN company_type AS ct ON ct.id = mc.company_type_id AND ct.kind = 'production companies' JOIN movie_info AS mi ON mc.movie_id = mi.movie_id JOIN info_type AS it ON it.id = mi.info_type_id AND it.info = 'rating' JOIN title AS t ON t.id = mc.movie_id JOIN kind_type AS kt ON kt.id = t.kind_id AND kt.kind = 'movie' JOIN movie_info_idx AS miidx ON miidx.movie_id = t.id JOIN info_type AS it2 ON it2.id = miidx.info_type_id AND it2.info = 'release dates' WHERE cn.country_code = '[us]' AND t.title != '' AND (t.title LIKE 'Champion%' OR t.title LIKE 'Loser%') GROUP BY mc.movie_id;
SELECT MIN(mi_idx.info) AS rating, MIN(t.title) AS northern_dark_movie FROM info_type AS it1, info_type AS it2, keyword AS k, kind_type AS kt, movie_info AS mi, movie_info_idx AS mi_idx, movie_keyword AS mk, title AS t WHERE it1.info = 'countries' AND it2.info = 'rating' AND k.keyword IN ('murder', 'murder-in-title', 'blood', 'violence') AND kt.kind = 'movie' AND mi.info IN ('Sweden', 'Norway', 'Germany', 'Denmark', 'Swedish', 'Denish', 'Norwegian', 'German', 'USA', 'American') AND mi_idx.info < '8.5' AND t.production_year > 2010 AND kt.id = t.kind_id AND t.id = mi.movie_id AND t.id = mk.movie_id AND t.id = mi_idx.movie_id AND mk.movie_id = mi.movie_id AND mk.movie_id = mi_idx.movie_id AND mi.movie_id = mi_idx.movie_id AND k.id = mk.keyword_id AND it1.id = mi.info_type_id AND it2.id = mi_idx.info_type_id;
