SELECT DISTINCT tn.title AS movie_title FROM title tn JOIN movie_companies mc ON mc.movie_id = tn.id JOIN company_name cn ON cn.id = mc.company_id JOIN movie_keyword mk ON mk.movie_id = tn.id JOIN keyword k ON k.id = mk.keyword_id WHERE cn.country_code = '[sm]' AND k.keyword = 'character-name-in-title' AND tn.title NOT IN ( SELECT tn2.title FROM title tn2 JOIN movie_companies mc2 ON mc2.movie_id = tn2.id JOIN company_name cn2 ON cn2.id = mc2.company_id JOIN movie_keyword mk2 ON mk2.movie_id = tn2.id JOIN keyword k2 ON k2.id = mk2.keyword_id WHERE cn2.country_code = '[sm]' AND k2.keyword = 'character-name-in-title' GROUP BY tn2.title HAVING COUNT(DISTINCT cn2.id) > 1 ) ORDER BY tn.title;
