select l_suppkey, sum(l_extendedprice * (1 - l_discount))  from lineitem where l_shipdate >= date '1996-01-01'  and l_shipdate < date '1996-01-01' + interval '3' month  group by l_suppkey;
select o_custkey, sum(o_totalprice)  from orders where o_orderdate >= date '1996-01-01'  and o_orderdate < date '1996-01-01' + interval '3' month  group by o_custkey;
select p_type, p_brand, sum(l_extendedprice) as total_sales from lineitem, part where l_partkey = p_partkey group by p_type, p_brand order by total_sales desc limit 1;
select s_name, max(ps_availqty) as max_avail_qty from partsupp, supplier where ps_suppkey = s_suppkey group by s_name order by max_avail_qty desc;
select sum(l_extendedprice) / 7.0 as avg_yearly from lineitem, part where p_partkey = l_partkey     and p_brand = 'brand#23'     and p_container = 'med box'     and l_quantity < (select 0.2 * avg(l_quantity) from lineitem where l_partkey = p_partkey)     and l_shipdate between '1995-01-01' and '1995-12-31' limit 1;
select c_name, c_custkey, o_orderkey, o_orderdate, sum(o_totalprice) as total_price from customer join orders on c_custkey = o_custkey group by c_name, c_custkey, o_orderkey, o_orderdate order by total_price desc limit 100;
select p_name, p_mfgr, p_brand, p_type, p_size, p_container, p_retailprice, s_name, s_suppkey, sum(l_quantity) as total_quantity from part join partsupp on p_partkey = ps_partkey join supplier on ps_suppkey = s_suppkey join lineitem on l_partkey = p_partkey and l_suppkey = ps_suppkey group by p_name, p_mfgr, p_brand, p_type, p_size, p_container, p_retailprice, s_name, s_suppkey order by total_quantity desc limit 100;

select s_name, 100.00 * sum(l_extendedprice * (1 - l_discount)) / (select sum(l_extendedprice * (1 - l_discount)) from lineitem, part where l_partkey = p_partkey and l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month) as sales_percentage from lineitem, part, partsupp, supplier where l_partkey = p_partkey and l_partkey = ps_partkey and ps_suppkey = s_suppkey and s_name = 'supplier a' and l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month group by s_name;
select c_name, count(distinct o_orderkey) as order_count, sum(o_totalprice) as total_price from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_name = 'customer a' and o_orderdate >= date '1995-09-01' and o_orderdate < date '1995-09-01' + interval '1' month group by c_name;
select l_suppkey, sum(l_extendedprice * (1 - l_discount)) from lineitem where l_shipdate >= date '1996-01-01'   and l_shipdate < date '1996-01-01' + interval '3' month group by l_suppkey;
select l_suppkey, sum(l_extendedprice * (1 - l_discount)) from lineitem where l_shipdate >= date '1996-01-01'   and l_shipdate < date '1996-01-01' + interval '3' month group by l_suppkey;
select p_brand, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt from partsupp join part on p_partkey = ps_partkey where p_brand <> 'brand#45'   and p_type not like 'medium polished%'   and p_size in (49, 14, 23, 45, 19, 3, 36, 9)   and ps_suppkey not in (     select s_suppkey from supplier where s_comment like '%customer complaints%'   ) group by p_brand, p_type, p_size order by supplier_cnt desc, p_brand, p_type, p_size limit 1;
select p_brand, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt from partsupp join part on p_partkey = ps_partkey join lineitem on l_partkey = p_partkey and l_suppkey = ps_suppkey join orders on o_orderkey = l_orderkey join supplier on s_suppkey = ps_suppkey where p_brand <> 'brand#45'   and p_type not like 'medium polished%'   and p_size in (49, 14, 23, 45, 19, 3, 36, 9)   and ps_suppkey not in (     select s_suppkey from supplier where s_comment like '%customer complaints%'   )   and o_orderdate >= '2019-01-01' group by p_brand, p_type, p_size order by supplier_cnt desc, p_brand, p_type, p_size limit 1;

select p_brand, sum(ps_supplycost) as totalcost, avg(ps_availqty) as avgqty from ( select p_brand, ps_supplycost, ps_availqty from part, partsupp where p_partkey = ps_partkey and p_size = 30 and p_container = 'lg case' and ps_supplycost > ( select avg(ps_supplycost) from partsupp where p_partkey = ps_partkey and p_size = 30 and p_container = 'lg case' ) and not exists ( select * from lineitem where l_partkey = p_partkey ) ) as productcost group by p_brand order by totalcost desc limit 1;
select c_name, o_orderstatus, sum(l_quantity) as total_quantity, sum(l_extendedprice) as total_price, avg(l_extendedprice * (1 - l_discount)) as avg_discounted_price, sum(l_extendedprice * (1 - l_discount) * (1 + l_tax)) as total_charge, avg(l_quantity) as avg_quantity, avg(l_extendedprice) as avg_extended_price, avg(l_discount) as avg_discount, count(*) as total_orders  from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey  join supplier on ps_suppkey = s_suppkey  where c_mktsegment = 'automobile'  and o_orderstatus = 'f'  and s_address like '%beijing%'  and l_shipdate <= date '2021-07-31'  group by c_name, o_orderstatus  order by c_name, o_orderstatus  limit 1;
select c_custkey, o_orderkey, l_partkey, l_suppkey, p_name, s_name, n_name from customer, orders, lineitem, part, supplier, nation where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = p_partkey and l_suppkey = s_suppkey and s_nationkey = n_nationkey and p_name like '%red%' and s_name like '%china%' and n_name = 'asia' and o_orderdate >= '2021-01-01' and o_orderdate < '2022-01-01' limit 10;
select s_name, count(*) as supplier_count from supplier where s_acctbal > 5000 and exists ( select * from partsupp where ps_suppkey = s_suppkey and ps_availqty > 100 ) group by s_name order by s_name limit 1;
select s_name, sum(l_extendedprice * (1 - l_discount)) as revenue from supplier, partsupp, lineitem, orders, customer, nation, region where s_suppkey = ps_suppkey and ps_partkey = l_partkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and o_orderdate >= date '1995-01-01' and o_orderdate < date '1996-01-01' and s_acctbal > 1000 group by s_name order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= '1995-01-01'  and l_shipdate < '1996-01-01'  and l_discount between 0.04 and 0.08  and l_quantity < 30  and l_suppkey in (     select ps_suppkey      from partsupp      where ps_supplycost < 500      and ps_availqty > 100 )  and l_partkey in (     select ps_partkey      from partsupp      where ps_supplycost < 500      and ps_availqty > 100 )  and l_orderkey in (     select o_orderkey      from orders      where o_orderstatus = 'f'      and o_orderdate >= '1995-01-01'      and o_orderdate < '1996-01-01' )  and l_suppkey in (     select s_suppkey      from supplier      where s_phone like '%1234%' )  and l_orderkey in (     select o_orderkey      from orders      where o_custkey in (         select c_custkey          from customer          where c_mktsegment = 'automobile'     ) ) limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume from supplier, lineitem, orders, customer, nation n1, nation n2 where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey and ( (n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france') ) and l_shipdate between date '1995-01-01' and date '1996-12-31' ) as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year limit 1;
select o_year, sum(case when nation = 'germany' then volume else 0 end) / sum(volume) as mkt_share from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation from part, supplier, lineitem, orders, customer, nation n1, nation n2, region where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'europe' and s_nationkey = n2.n_nationkey and o_orderdate between date '1998-01-01' and date '1999-12-31' and p_type = 'large anodized aluminum' ) as all_nations group by o_year order by o_year limit 1;

select n_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region where c_custkey = o_custkey and l_orderkey = o_orderkey and l_suppkey = s_suppkey and c_nationkey = s_nationkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'ASIA' and o_orderdate >= date '1994-01-01' and o_orderdate < date '1994-01-01' + interval '1' year group by n_name order by revenue desc  LIMIT 1;
select sum(l_extendedprice * l_discount) as revenue from lineitem where l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year and l_discount between .06 - 0.01 and .06 + 0.01 and l_quantity < 24  LIMIT 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume from supplier, lineitem, orders, customer, nation n1, nation n2 where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey and ( (n1.n_name = 'FRANCE' and n2.n_name = 'GERMANY') or (n1.n_name = 'GERMANY' and n2.n_name = 'FRANCE') ) and l_shipdate between date '1995-01-01' and date '1996-12-31' ) as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year LIMIT 1;
select o_year, sum(case when nation = 'BRAZIL' then volume else 0 end) / sum(volume) as mkt_share from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation from part, supplier, lineitem, orders, customer, nation n1, nation n2, region where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'AMERICA' and s_nationkey = n2.n_nationkey and o_orderdate between date '1995-01-01' and date '1996-12-31' and p_type = 'ECONOMY ANODIZED STEEL' ) as all_nations group by o_year order by o_year LIMIT 1;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment from customer, orders, lineitem, nation where c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate >= date '1993-10-01' and o_orderdate < date '1993-10-01' + interval '3' month and l_returnflag = 'R' and c_nationkey = n_nationkey group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment order by revenue desc LIMIT 20;
select ps_partkey, sum(ps_supplycost * ps_availqty) as value from partsupp, supplier, nation where ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_name = 'GERMANY' group by ps_partkey having sum(ps_supplycost * ps_availqty) > ( select sum(ps_supplycost * ps_availqty) * 0.0001000000 from partsupp, supplier, nation where ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_name = 'GERMANY' ) order by value desc LIMIT 1;
select l_shipmode, sum(case when o_orderpriority = '1-URGENT' or o_orderpriority = '2-HIGH' then 1 else 0 end) as high_line_count, sum(case when o_orderpriority <> '1-URGENT' and o_orderpriority <> '2-HIGH' then 1 else 0 end) as low_line_count from orders, lineitem where o_orderkey = l_orderkey and l_shipmode in ('MAIL', 'SHIP') and l_commitdate < l_receiptdate and l_shipdate < l_commitdate and l_receiptdate >= date '1994-01-01' and l_receiptdate < date '1994-01-01' + interval '1' year group by l_shipmode order by l_shipmode LIMIT 1;
select c_count, count(*) as custdist from ( select c_custkey, count(o_orderkey) from customer left outer join orders on c_custkey = o_custkey and o_comment not like '%special%requests%' group by c_custkey ) as c_orders (c_custkey, c_count) group by c_count order by custdist desc, c_count desc LIMIT 1;
select 100.00 * sum(case when p_type like 'PROMO%' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as promo_revenue from lineitem, part where l_partkey = p_partkey and l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month LIMIT 1;
create view revenue0 (supplier_no, total_revenue) as select l_suppkey, sum(l_extendedprice * (1 - l_discount)) from lineitem where l_shipdate >= date '1996-01-01' and l_shipdate < date '1996-01-01' + interval '3' month group by l_suppkey;   select s_suppkey, s_name, s_address, s_phone, total_revenue from supplier, revenue0 where s_suppkey = supplier_no and total_revenue = ( select max(total_revenue) from revenue0 ) order by s_suppkey;  drop view revenue0;
select p_brand, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt from partsupp, part where p_partkey = ps_partkey and p_brand <> 'Brand#45' and p_type not like 'MEDIUM POLISHED%' and p_size in (49, 14, 23, 45, 19, 3, 36, 9) and ps_suppkey not in ( select s_suppkey from supplier where s_comment like '%Customer%Complaints%' ) group by p_brand, p_type, p_size order by supplier_cnt desc, p_brand, p_type, p_size LIMIT 1;

select p_brand, p_type, sum(p_retailprice) as total_retail_price, avg(p_retailprice) as avg_retail_price, count(*) as count_part  from part  where p_size >= 10 and p_size <= 20 and p_container = 'sm case'  group by p_brand, p_type  order by p_brand, p_type  limit 1;
select c_name, o_orderdate, sum(o_totalprice) as sum_price  from customer, orders  where c_custkey = o_custkey  and c_name like '%zhang%'  group by c_name, o_orderdate  order by o_orderdate desc  limit 1;
select c_name, o_orderstatus, o_totalprice, l_extendedprice, l_discount, l_tax from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and l_discount > 0.05 and l_tax < 0.05 order by c_name, o_orderstatus, o_totalprice desc, l_extendedprice desc limit 100;
select s_name, count(*) as supplier_count from supplier  where s_suppkey >= 100 and s_suppkey <= 200  and exists (select * from partsupp where ps_suppkey = s_suppkey and ps_availqty > 0)  group by s_name  order by s_name limit 1;
select sum(ps_supplycost * l_quantity) as cost from partsupp inner join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey inner join orders on lineitem.l_orderkey = orders.o_orderkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey where orders.o_orderdate >= date '1995-01-01' and orders.o_orderdate < date '1995-01-01' + interval '1' year and supplier.s_name = 'abc supplier' and supplier.s_address = '123 main st' and orders.o_orderstatus = 'shipped' and orders.o_totalprice > 1000 and partsupp.ps_availqty > 10 and partsupp.ps_supplycost < 50 limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume from supplier, lineitem, orders, customer, nation n1, nation n2 where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey and ( (n1.n_name = 'italy' and n2.n_name = 'spain') or (n1.n_name = 'spain' and n2.n_name = 'italy') ) and l_shipdate between date '1997-01-01' and date '1998-12-31' ) as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year limit 1;

select o_orderpriority, count(*) as order_count from orders  inner join lineitem on orders.o_orderkey = lineitem.l_orderkey inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join part on partsupp.ps_partkey = part.p_partkey where part.p_type = 'type a' and orders.o_orderdate >= date '1993-01-01' and orders.o_orderdate < date '1993-02-01' group by o_orderpriority order by order_count desc limit 1;
select n_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region where c_custkey = o_custkey    and l_orderkey = o_orderkey    and l_suppkey = s_suppkey    and c_nationkey = s_nationkey    and s_nationkey = n_nationkey    and n_regionkey = r_regionkey  group by n_name  order by revenue desc;
select s_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region where c_custkey = o_custkey    and l_orderkey = o_orderkey    and l_suppkey = s_suppkey    and c_nationkey = s_nationkey    and s_nationkey = n_nationkey    and n_regionkey = r_regionkey  group by s_name  order by revenue desc;
select p_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region, part, partsupp where c_custkey = o_custkey    and l_orderkey = o_orderkey    and l_suppkey = s_suppkey    and c_nationkey = s_nationkey    and s_nationkey = n_nationkey    and n_regionkey = r_regionkey    and l_partkey = ps_partkey    and l_suppkey = ps_suppkey    and p_partkey = ps_partkey  group by p_name  order by revenue desc;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1994-01-01' and l_shipdate < date '1995-01-01'  and l_discount between .05 and .07  and l_quantity < 30  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-07-01'  and l_discount between .03 and .05  and l_quantity < 20  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1994-01-01' and l_shipdate < date '1995-01-01'  and l_discount between .07 and .09  and l_quantity < 40  limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from     (select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year,     l_extendedprice * (1 - l_discount) as volume     from supplier, lineitem, orders, customer, nation n1, nation n2     where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey     and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey     and n1.n_name = 'france' and n2.n_name = 'germany'     and l_shipdate between date '1996-01-01' and date '1996-12-31') as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from     (select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year,     l_extendedprice * (1 - l_discount) as volume     from supplier, lineitem, orders, customer, nation n1, nation n2     where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey     and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey     and n1.n_name = 'germany' and n2.n_name = 'france'     and l_shipdate between date '1995-01-01' and date '1995-12-31') as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year;

select s_name, s_address from supplier, nation where s_suppkey in ( select ps_suppkey from partsupp where ps_partkey in ( select p_partkey from part where p_name like 'forest%' ) and ps_availqty > ( select 0.5 * sum(l_quantity) from lineitem where l_partkey = ps_partkey and l_suppkey = ps_suppkey and l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year ) ) and s_nationkey = n_nationkey and n_name = 'canada' order by s_name limit 1;
select p_name, p_brand, p_retailprice from part, partsupp, lineitem where p_partkey = ps_partkey and ps_partkey = l_partkey and ps_suppkey = l_suppkey and l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year and p_type = 'electronic' and p_size >= 20 order by p_retailprice desc limit 10;
select c_name, c_phone, o_orderpriority, l_shipdate from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year and c_mktsegment = 'automobile' and o_orderstatus = 'f' order by l_shipdate limit 10;
select s_name, count(*) as numwait  from supplier, lineitem l1, orders, nation  where s_suppkey = l1.l_suppkey      and o_orderkey = l1.l_orderkey      and o_orderstatus = 'f'      and l1.l_receiptdate > l1.l_commitdate      and exists (         select *          from lineitem l2          where l2.l_orderkey = l1.l_orderkey              and l2.l_suppkey <> l1.l_suppkey      )      and not exists (         select *          from lineitem l3          where l3.l_orderkey = l1.l_orderkey              and l3.l_suppkey <> l1.l_suppkey              and l3.l_receiptdate > l3.l_commitdate      )      and s_nationkey = n_nationkey      and n_name = 'united states'  group by s_name  order by numwait desc, s_name  limit 100;
select s_name, count(*) as numorders  from supplier, lineitem l1, orders, nation  where s_suppkey = l1.l_suppkey      and o_orderkey = l1.l_orderkey      and o_orderstatus = 'f'      and l1.l_receiptdate > l1.l_commitdate      and exists (         select *          from lineitem l2          where l2.l_orderkey = l1.l_orderkey              and l2.l_suppkey <> l1.l_suppkey      )      and not exists (         select *          from lineitem l3          where l3.l_orderkey = l1.l_orderkey              and l3.l_suppkey <> l1.l_suppkey              and l3.l_receiptdate > l3.l_commitdate      )      and s_nationkey = n_nationkey      and n_name = 'germany'  group by s_name  order by numorders desc, s_name  limit 100;
select s_name, count(*) as numreturns  from supplier, lineitem l1, orders, nation  where s_suppkey = l1.l_suppkey      and o_orderkey = l1.l_orderkey      and o_orderstatus = 'f'      and l1.l_receiptdate > l1.l_commitdate      and exists (         select *          from lineitem l2          where l2.l_orderkey = l1.l_orderkey              and l2.l_suppkey <> l1.l_suppkey      )      and not exists (         select *          from lineitem l3          where l3.l_orderkey = l1.l_orderkey              and l3.l_suppkey <> l1.l_suppkey              and l3.l_receiptdate > l3.l_commitdate      )      and s_nationkey = n_nationkey      and n_name = 'china'  group by s_name  order by numreturns desc, s_name  limit 100;
select n_name as country, count(o_orderkey) as numorders, sum(o_totalprice) as totalprice from nation join customer on n_nationkey = c_nationkey join orders on c_custkey = o_custkey group by n_name order by totalprice desc;
select p_type as product_type, avg(ps_supplycost) as avg_supplycost from part join partsupp on p_partkey = ps_partkey join supplier on ps_suppkey = s_suppkey where p_type = 'typex' group by p_type;

select c_custkey, c_name, o_orderkey, o_orderstatus, sum(l_quantity) as sum_qty, sum(l_extendedprice) as sum_base_price, sum(l_extendedprice * (1 - l_discount)) as sum_disc_price, sum(l_extendedprice * (1 - l_discount) * (1 + l_tax)) as sum_charge, avg(l_quantity) as avg_qty, avg(l_extendedprice) as avg_price, avg(l_discount) as avg_disc, count(*) as count_order  from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  where o_orderdate <= date '1998-12-01'  group by c_custkey, c_name, o_orderkey, o_orderstatus  order by c_custkey, c_name, o_orderkey, o_orderstatus  limit 1;
select c_name as customer, extract(year from o_orderdate) as o_year, sum(l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as sum_profit from customer, orders, lineitem, partsupp, supplier, part, nation where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and ps_suppkey = s_suppkey and ps_partkey = p_partkey and s_nationkey = n_nationkey and p_name not like '%green%' group by customer, o_year order by customer, o_year desc limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier, nation, region  where c_mktsegment = 'furniture'  and c_custkey = o_custkey  and l_orderkey = o_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey  and s_nationkey = n_nationkey  and n_regionkey = r_regionkey  and o_orderdate < date '1996-01-01'  and l_shipdate > date '1996-01-01'  and r_name = 'asia'  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select c_custkey, c_name, c_address, c_phone, o_orderkey, o_orderdate, o_totalprice, l_partkey, l_suppkey, l_quantity, l_extendedprice, l_discount, l_tax, s_name, s_address, s_phone from customer, orders, lineitem, supplier where c_custkey = o_custkey and o_orderkey = l_orderkey and l_suppkey = s_suppkey and c_mktsegment = 'automobile' and o_orderdate >= '1994-01-01' and o_orderdate < '1995-01-01' and l_extendedprice > 1000 and l_discount < 0.05 and s_phone like '%123%' order by c_custkey, o_orderkey, l_partkey limit 100;
select c_mktsegment, count(*) as customer_count from customer where c_acctbal > 1000 and c_mktsegment = 'automobile' and exists ( select * from orders where o_custkey = c_custkey and o_orderdate >= date '1993-07-01' and o_orderdate < date '1993-07-01' + interval '3' month ) group by c_mktsegment order by customer_count desc limit 1;
select c_name, sum(l_extendedprice * (1 - l_discount)) as revenue  from customer, orders, lineitem, supplier, nation, region  where c_custkey = o_custkey  and l_orderkey = o_orderkey  and l_suppkey = s_suppkey  and c_nationkey = s_nationkey  and s_nationkey = n_nationkey  and n_regionkey = r_regionkey  and r_name = 'europe'  and o_orderdate >= date '1995-01-01'  and o_orderdate < date '1996-01-01'  and s_acctbal > 10000  group by c_name  order by revenue desc  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1995-01-01'  and l_shipdate < date '1995-01-01' + interval '1' year  and l_discount between .05 - 0.01 and .05 + 0.01  and l_quantity < 20  and l_orderkey in ( select distinct o_orderkey from orders where o_orderdate >= date '1995-01-01' and o_orderdate < date '1995-01-01' + interval '1' year and o_orderpriority = '1-urgent' and o_custkey in ( select distinct c_custkey from customer where c_mktsegment = 'automobile' and c_acctbal > 10000 and c_custkey in ( select distinct ps_suppkey from partsupp where ps_supplycost > 1000 and ps_suppkey in ( select distinct s_suppkey from supplier where s_address like '%beijing%' ) ) ) ) limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume from supplier, lineitem, orders, customer, nation n1, nation n2 where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey and ( (n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france') ) and l_shipdate between date '1995-01-01' and date '1996-12-31'  ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select o_year, sum(case when nation = 'france' then volume else 0 end) / sum(volume) as mkt_share from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation  from part, supplier, lineitem, orders, customer, nation n1, nation n2, region  where p_partkey = l_partkey  and s_suppkey = l_suppkey  and l_orderkey = o_orderkey  and o_custkey = c_custkey  and c_nationkey = n1.n_nationkey  and n1.n_regionkey = r_regionkey  and r_name = 'europe'  and s_nationkey = n2.n_nationkey  and o_orderdate between date '1998-01-01' and date '1998-12-31'  and p_type = 'economy anodized steel'  ) as all_nations  group by o_year  order by o_year  limit 1;
select c_custkey, sum(o_totalprice) as total_price  from customer, orders  where c_custkey = o_custkey and c_mktsegment = 'automobile'  group by c_custkey  having sum(o_totalprice) > (select sum(o_totalprice) * 0.0001000000 from customer, orders where c_custkey = o_custkey and c_mktsegment = 'automobile')  order by total_price desc  limit 1;
select c_custkey, sum(case when o_orderstatus = 'f' then 1 else 0 end) as completed_order_count, sum(case when o_orderstatus = 'o' then 1 else 0 end) as open_order_count from customer, orders where c_custkey = o_custkey and o_orderdate >= date '1995-01-01' and o_orderdate < date '1995-01-01' + interval '1' year and o_totalprice > 1000 and o_totalprice < 5000 and o_orderpriority in ('1-urgent', '2-high') group by c_custkey order by c_custkey limit 1;
select c_name, count(*) as ordercount from customer left join orders on customer.c_custkey = orders.o_custkey left join lineitem on orders.o_orderkey = lineitem.l_orderkey left join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey left join supplier on partsupp.ps_suppkey = supplier.s_suppkey where customer.c_mktsegment = '家用' and orders.o_orderstatus = '已发货' and partsupp.ps_availqty > 100 and supplier.s_name <> '供货商a' group by c_name order by ordercount desc limit 1;
select 100.00 * sum(case when c_mktsegment like 'automobile' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as auto_revenue  from lineitem, customer, orders  where l_orderkey = o_orderkey  and o_custkey = c_custkey  and o_orderdate >= date '1995-09-01'  and o_orderdate < date '1995-09-01' + interval '1' month  and c_mktsegment = 'automobile'  limit 1;
select c_custkey, c_name, c_address, c_phone, o_orderdate, o_totalprice from customer join orders on c_custkey = o_custkey where c_mktsegment = 'automobile' and o_orderdate >= date '1996-01-01' and o_orderdate < date '1996-01-01' + interval '3' month and o_totalprice > 10000 order by c_custkey;
select c_custkey, o_orderkey, o_orderstatus, o_totalprice, o_orderdate, o_orderpriority, o_clerk, o_shippriority, o_comment from customer, orders where c_custkey = o_custkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and o_totalprice > 10000 and o_orderdate between '2019-01-01' and '2019-12-31' and o_orderpriority in ('1-urgent', '2-high') and o_shippriority <= 3 and c_custkey not in ( select c_custkey from customer where c_comment like '%vip%' ) order by o_totalprice desc, o_orderdate, o_orderkey limit 1;
select sum(l_extendedprice) / 7.0 as avg_yearly  from lineitem, partsupp, orders, supplier, customer  where lineitem.l_partkey = partsupp.ps_partkey  and lineitem.l_suppkey = partsupp.ps_suppkey  and lineitem.l_orderkey = orders.o_orderkey  and orders.o_custkey = customer.c_custkey  and supplier.s_suppkey = partsupp.ps_suppkey  and supplier.s_nationkey = customer.c_nationkey  and customer.c_mktsegment = 'automobile'  and orders.o_shippriority > 1  and supplier.s_address = '123 main st'  and partsupp.ps_availqty > 100  and partsupp.ps_supplycost < 50  and lineitem.l_extendedprice > 1000  and lineitem.l_returnflag = 'n'  limit 1;
select c_name, c_address, o_orderstatus from customer, orders where c_custkey in ( select o_custkey from orders where o_totalprice > ( select 0.8 * sum(l_extendedprice) from lineitem where l_orderkey = o_orderkey and l_shipdate >= date '1995-01-01' and l_shipdate < date '1995-01-01' + interval '1' year ) ) and c_mktsegment = 'automobile' and c_nationkey in ( select n_nationkey from nation where n_regionkey in ( select r_regionkey from region where r_name = 'asia' ) ) and c_custkey > ( select max(o_custkey) from orders ) order by c_name limit 1;

select c_name as customer_name, extract(year from o_orderdate) as order_year, sum(l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as total_profit from customer, orders, lineitem, partsupp, supplier where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey and c_name like '%smith%' group by c_name, order_year order by c_name, order_year desc limit 1;
select c_custkey, count(o_orderkey) as order_count, l_linenumber, l_quantity, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus, l_shipdate, l_commitdate, l_receiptdate, l_shipinstruct, l_shipmode, l_comment from customer, orders, lineitem where c_mktsegment = 'electronics'  and c_custkey = o_custkey  and l_orderkey = o_orderkey  and o_orderdate > date '1998-01-01'  and l_shipdate < date '1998-02-01'  group by c_custkey, l_linenumber, l_quantity, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus, l_shipdate, l_commitdate, l_receiptdate, l_shipinstruct, l_shipmode, l_comment order by order_count desc, l_shipdate limit 10;
select c_custkey, count(*) as order_count from customer where c_mktsegment = 'building' and c_acctbal < 10000 and exists (     select *     from orders     where o_custkey = c_custkey     and o_orderdate >= date '1995-01-01'     and o_orderdate < date '1995-01-01' + interval '3' month     and exists (         select *         from lineitem         where l_orderkey = o_orderkey         and l_commitdate < l_receiptdate     ) ) group by c_custkey order by order_count desc limit 1;
select c_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, partsupp, nation, region where c_custkey = o_custkey and l_orderkey = o_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and c_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and o_orderdate >= date '1995-01-01' and o_orderdate < date '1995-01-01' + interval '1' year group by c_name order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1995-01-01' and l_shipdate < date '1995-01-01' + interval '1' year  and l_discount between .05 - 0.01 and .05 + 0.01  and l_quantity < 20  and l_partkey in (select p_partkey from part where p_brand = 'brandx')  and l_suppkey in (select s_suppkey from supplier where s_nationkey = (select n_nationkey from nation where n_name = 'china'))  and l_orderkey in (select o_orderkey from orders where o_orderdate >= date '1995-01-01' and o_orderdate < date '1995-01-01' + interval '1' year and o_orderstatus = 'f')  limit 1;
select s.s_name as supp_name, c.c_name as cust_name, extract(year from l.l_shipdate) as l_year,      sum(l.l_extendedprice * (1 - l.l_discount)) as revenue  from supplier s, lineitem l, orders o, customer c, nation n1, nation n2  where s.s_suppkey = l.l_suppkey      and o.o_orderkey = l.l_orderkey      and c.c_custkey = o.o_custkey      and s.s_nationkey = n1.n_nationkey      and c.c_nationkey = n2.n_nationkey      and ( (n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france') )      and l.l_shipdate between date '1995-01-01' and date '1996-12-31'  group by supp_name, cust_name, l_year  order by supp_name, cust_name, l_year  limit 1;
select o_year, sum(case when nation = 'china' then volume else 0 end) / sum(volume) as mkt_share from (  select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation  from part, supplier, lineitem, orders, customer, nation n1, nation n2, region  where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey  and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey  and r_name = 'asia' and s_nationkey = n2.n_nationkey  and o_orderdate between date '1997-01-01' and date '1998-12-31'  and p_type = 'large burnished copper' ) as all_nations  group by o_year order by o_year limit 1;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment  from customer, orders, lineitem, nation, supplier, partsupp  where c_custkey = o_custkey  and l_orderkey = o_orderkey  and o_orderdate >= date '1993-10-01'  and o_orderdate < date '1993-10-01' + interval '3' month  and l_returnflag = 'r'  and c_nationkey = n_nationkey  and l_suppkey = ps_suppkey  and l_partkey = ps_partkey  and s_suppkey = ps_suppkey  and l_shipdate >= date '1993-10-01'  and l_shipdate < date '1993-10-01' + interval '3' month  and l_shipmode = 'air'  and s_acctbal > 5000  group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment  order by revenue desc limit 20;
select c_custkey, c_name, c_mktsegment, sum(o_totalprice) as total_sales from customer, orders where c_custkey = o_custkey and c_mktsegment = 'automobile' and o_orderdate >= '2020-01-01' and o_orderdate <= '2020-12-31' and c_custkey in (     select o_custkey     from orders     where o_orderdate >= '2020-01-01'     and o_orderdate <= '2020-12-31'     group by o_custkey     having sum(o_totalprice) > (         select avg(total_sales)         from (             select c_custkey, sum(o_totalprice) as total_sales             from customer, orders             where c_custkey = o_custkey             and o_orderdate >= '2020-01-01'             and o_orderdate <= '2020-12-31'             group by c_custkey         ) as subquery     ) ) group by c_custkey, c_name, c_mktsegment order by total_sales desc limit 1;
select c_name, sum(case when l_shipmode = 'mail' or l_shipmode = 'ship' then 1 else 0 end) as ship_line_count, sum(case when l_shipmode <> 'mail' and l_shipmode <> 'ship' then 1 else 0 end) as other_line_count from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and l_commitdate < l_receiptdate and l_shipdate < l_commitdate and l_receiptdate >= date '1994-01-01' and l_receiptdate < date '1994-01-01' + interval '1' year group by c_name order by c_name limit 1;
select 100.00 * sum(case when c_mktsegment = 'automobile' and o_orderstatus = 'f' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as automobile_promo_revenue from lineitem, part, orders, customer where l_partkey = p_partkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = 1 and o_orderdate >= date '1995-09-01' and o_orderdate < date '1995-09-01' + interval '1' month limit 1;
select o_custkey, sum(l_extendedprice * (1 - l_discount))  from lineitem, orders  where l_orderkey = o_orderkey  and l_shipdate >= date '1996-01-01'  and l_shipdate < date '1996-01-01' + interval '3' month  group by o_custkey;
select c_custkey, c_name, c_address, c_nationkey, c_phone, c_acctbal, c_mktsegment, count(distinct o_orderkey) as order_cnt  from customer, orders  where c_custkey = o_custkey  and c_mktsegment = 'automobile'  and c_nationkey not in (      select n_nationkey      from nation      where n_name = 'russia'  )  and o_orderdate between '1992-01-01' and '1992-04-01'  and o_totalprice > 10000  and o_orderstatus <> 'f'  and o_orderpriority <> '2-high'  and o_clerk = 'clerk#000020'  group by c_custkey, c_name, c_address, c_nationkey, c_phone, c_acctbal, c_mktsegment  order by order_cnt desc, c_custkey, c_name, c_address, c_nationkey, c_phone, c_acctbal, c_mktsegment  limit 1;

select c_name, extract(year from o_orderdate) as o_year, sum(l_extendedprice * (1 - l_discount)) as total_sales  from customer, orders, lineitem, part  where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = p_partkey  and p_name like '%green%'  and extract(year from o_orderdate) = 2019  group by c_name, o_year;
select s_name, extract(year from o_orderdate) as o_year, sum(ps_supplycost * l_quantity) as total_cost  from supplier, partsupp, lineitem, part, orders  where s_suppkey = ps_suppkey  and ps_partkey = l_partkey  and l_partkey = p_partkey  and l_orderkey = o_orderkey  and p_name like '%green%'  and extract(year from o_orderdate) = 2019  group by s_name, o_year;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier where c_mktsegment = 'furniture'  and c_custkey = o_custkey  and l_orderkey = o_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, part where c_mktsegment = 'automobile'  and c_custkey = o_custkey  and l_orderkey = o_orderkey  and l_partkey = p_partkey  and p_type = 'engine'  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select o_orderkey, o_orderstatus from orders, lineitem, partsupp where o_orderkey = l_orderkey   and l_partkey = ps_partkey   and l_suppkey = ps_suppkey   and ps_availqty > 1000 order by o_orderkey;
select p_brand, p_type, count(*) as part_count  from part  join partsupp on part.p_partkey = partsupp.ps_partkey  join lineitem on partsupp.ps_partkey = lineitem.l_partkey  join orders on lineitem.l_orderkey = orders.o_orderkey  where orders.o_orderdate >= date '1993-07-01'  and orders.o_orderdate < date '1993-07-01' + interval '3' month  and exists (select * from supplier where partsupp.ps_suppkey = supplier.s_suppkey and supplier.s_acctbal > 10000)  group by p_brand, p_type  order by part_count desc  limit 5;
select c_mktsegment, count(*) as customer_count from customer  join orders on customer.c_custkey = orders.o_custkey  join lineitem on orders.o_orderkey = lineitem.l_orderkey  join partsupp on lineitem.l_partkey = partsupp.ps_partkey  where orders.o_orderstatus = 'f'  and partsupp.ps_availqty > 100  and lineitem.l_discount > 0.05  group by c_mktsegment  order by customer_count desc  limit 3;
select s_name, sum(l_extendedprice) as total_revenue from supplier  join partsupp on supplier.s_suppkey = partsupp.ps_suppkey  join lineitem on partsupp.ps_partkey = lineitem.l_partkey  join orders on lineitem.l_orderkey = orders.o_orderkey  where orders.o_orderdate >= date '1994-01-01'  and orders.o_orderdate < date '1994-01-01' + interval '1' year  and lineitem.l_returnflag = 'r'  group by s_name  order by total_revenue desc  limit 10;

select sum(l_extendedprice) / 7.0 as avg_yearly from lineitem, part where p_partkey = l_partkey   and p_brand = 'brand#23'   and p_container = 'med box'   and l_quantity < (select 0.2 * avg(l_quantity) from lineitem where l_partkey = p_partkey) limit 1;
select sum(o_totalprice) as total_amount from orders, customer, nation, region where o_custkey = c_custkey   and c_nationkey = n_nationkey   and n_regionkey = r_regionkey   and n_name = 'china'   and r_name = 'asia' limit 1;
select sum(ps_supplycost) as total_cost from partsupp, supplier, part where ps_suppkey = s_suppkey   and ps_partkey = p_partkey   and s_name = 'supplier a'   and p_name = 'product b' limit 1;
select c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity) from customer, orders, lineitem where o_orderkey in ( select l_orderkey from lineitem group by l_orderkey having sum(l_quantity) > 300 ) and c_custkey = o_custkey and o_orderkey = l_orderkey and o_totalprice > 1000 group by c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice order by o_totalprice desc, o_orderdate limit 100;
select s_name, s_suppkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity) from supplier, partsupp, lineitem, orders, nation, region where s_suppkey = ps_suppkey and ps_partkey = l_partkey and l_orderkey = o_orderkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' group by s_name, s_suppkey, o_orderkey, o_orderdate, o_totalprice order by o_orderdate limit 100;
select c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity) from customer, orders, lineitem, nation, region where c_custkey = o_custkey and o_orderkey = l_orderkey and c_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'asia' and o_totalprice > 500 group by c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice order by o_orderdate limit 100;
select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, part, partsupp, supplier, customer, orders, nation, region  where ( p_partkey = l_partkey and p_brand = 'brand#12' and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg') and l_quantity >= 1 and l_quantity <= 1 + 10 and p_size between 1 and 5 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person'  and l_suppkey = ps_suppkey and ps_partkey = p_partkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and o_orderkey = l_orderkey and o_custkey = c_custkey)  or ( p_partkey = l_partkey and p_brand = 'brand#23' and p_container in ('med bag', 'med box', 'med pkg', 'med pack') and l_quantity >= 10 and l_quantity <= 10 + 10 and p_size between 1 and 10 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person'  and l_suppkey = ps_suppkey and ps_partkey = p_partkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and o_orderkey = l_orderkey and o_custkey = c_custkey)  or ( p_partkey = l_partkey and p_brand = 'brand#34' and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg') and l_quantity >= 20 and l_quantity <= 20 + 10 and p_size between 1 and 15 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person'  and l_suppkey = ps_suppkey and ps_partkey = p_partkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and o_orderkey = l_orderkey and o_custkey = c_custkey)  limit 1;
select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, part, partsupp, supplier, customer, orders, nation, region  where ( p_partkey = l_partkey and p_brand = 'brand#12' and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg') and l_quantity >= 1 and l_quantity <= 1 + 10 and p_size between 1 and 5 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person'  and l_suppkey = ps_suppkey and ps_partkey = p_partkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and o_orderkey = l_orderkey and o_custkey = c_custkey)  or ( p_partkey = l_partkey and p_brand = 'brand#23' and p_container in ('med bag', 'med box', 'med pkg', 'med pack') and l_quantity >= 10 and l_quantity <= 10 + 10 and p_size between 1 and 10 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person'  and l_suppkey = ps_suppkey and ps_partkey = p_partkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and o_orderkey = l_orderkey and o_custkey = c_custkey)  or ( p_partkey = l_partkey and p_brand = 'brand#34' and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg') and l_quantity >= 20 and l_quantity <= 20 + 10 and p_size between 1 and 15 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person'  and l_suppkey = ps_suppkey and ps_partkey = p_partkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and o_orderkey = l_orderkey and o_custkey = c_custkey)  limit 2;
