select o_orderkey, o_custkey, o_orderstatus, o_totalprice, o_orderdate, o_orderpriority, o_clerk, o_shippriority, o_comment from customer, orders, lineitem, nation, region where c_custkey = o_custkey     and o_orderkey = l_orderkey     and c_nationkey = n_nationkey     and n_regionkey = r_regionkey     and r_name = 'asia'     and l_discount > 0.05 order by o_orderdate asc;
select o_orderpriority, count(*) as order_count  from orders  inner join lineitem on orders.o_orderkey = lineitem.l_orderkey  where o_orderdate >= date '1993-07-01'      and o_orderdate < date '1993-07-01' + interval '3' month      and l_shipdate is not null      and o_totalprice > 1000  group by o_orderpriority  order by o_orderpriority  limit 1;
