select c_address, count(*) as order_count  from orders  inner join lineitem on orders.o_orderkey = lineitem.l_orderkey  inner join customer on orders.o_custkey = customer.c_custkey  where o_orderdate >= date '1993-07-01'      and o_orderdate < date '1993-07-01' + interval '3' month      and l_shipdate is not null      and o_totalprice > 1000  group by c_address  limit 1;
select r_name, n_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region where c_custkey = o_custkey     and l_orderkey = o_orderkey     and l_suppkey = s_suppkey     and c_nationkey = s_nationkey     and s_nationkey = n_nationkey     and n_regionkey = r_regionkey group by r_name, n_name order by revenue desc limit 1;
