select nation, s_name, sum(amount) as sum_profit  from (     select n_name as nation, s_name, l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity as amount      from part, supplier, lineitem, partsupp, orders, nation      where s_suppkey = l_suppkey        and ps_suppkey = l_suppkey        and ps_partkey = l_partkey        and p_partkey = l_partkey        and o_orderkey = l_orderkey        and s_nationkey = n_nationkey        and extract(year from o_orderdate) = 2018  ) as profit  group by nation, s_name  order by sum_profit desc  limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem  where c_custkey = o_custkey    and l_orderkey = o_orderkey  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc  limit 1;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment from part join partsupp on p_partkey = ps_partkey join supplier on s_suppkey = ps_suppkey join nation on s_nationkey = n_nationkey join region on n_regionkey = r_regionkey join customer on c_nationkey = n_nationkey where r_name = 'europe' order by c_acctbal desc limit 100;
select o_orderpriority, count(*) as order_count from orders where o_orderdate >= date '1993-07-01' and o_orderdate <= date '1993-09-30'   and exists (     select *     from lineitem     where l_orderkey = o_orderkey       and l_commitdate < l_receiptdate   ) group by o_orderpriority order by order_count desc limit 1;
select s_name, count(*) as order_count from supplier join partsupp on supplier.s_suppkey = partsupp.ps_suppkey join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey join orders on lineitem.l_orderkey = orders.o_orderkey join customer on orders.o_custkey = customer.c_custkey join nation on supplier.s_nationkey = nation.n_nationkey where nation.n_name = 'china'   and orders.o_orderdate >= date '1993-07-01' and orders.o_orderdate <= date '1993-09-30' group by s_name order by order_count desc limit 1;

select p_brand, p_type, sum(p_retailprice) as sum_retail_price, avg(p_retailprice) as avg_retail_price, count(*) as count_part  from part  where p_size >= 20 and p_container = 'wrap box'  group by p_brand, p_type  order by p_brand, p_type  limit 1;
select p_name, p_mfgr, p_brand, p_type, p_size, p_container, p_retailprice, p_comment from part where p_name like '%blue%' and p_mfgr = 'abc' and p_brand = 'xyz' and p_type = 'type1' and p_size >= 10 and p_size <= 20 and p_container in ('container1', 'container2') and p_retailprice >= 100 and p_retailprice <= 200 and p_comment not like '%obsolete%';
select p_name, p_mfgr, p_brand, p_type, p_size, p_container, p_retailprice  from part  where p_type = 'building'  and p_size > 10  and p_retailprice < 100  and p_mfgr = 'abc'  and p_brand = 'xyz'  and p_container = 'some_container'  and p_partkey in (     select ps_partkey      from partsupp      where ps_suppkey in (         select s_suppkey          from supplier          where s_name = 'some_supplier'          and s_address = 'some_address'          and s_phone = 'some_phone'     ) )  and p_partkey in (     select l_partkey      from lineitem      where l_orderkey in (         select o_orderkey          from orders          where o_orderstatus = 'some_status'          and o_orderdate < '1995-03-15'          and o_shippriority > 1          and o_custkey in (             select c_custkey              from customer              where c_mktsegment = 'building'              and c_name = 'some_customer'              and c_address = 'some_address'              and c_phone = 'some_phone'         )     ) )  group by p_name, p_mfgr, p_brand, p_type, p_size, p_container, p_retailprice  order by p_retailprice desc  limit 10;
select c_name, o_orderkey, l_linenumber, p_name, p_type, c_address, c_phone, c_comment from customer, orders, lineitem, part where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = p_partkey and c_mktsegment = 'household' and o_orderstatus = 'f' and p_size < 30 and p_type like '%wood' and c_acctbal > 1000 and l_quantity > 10 and l_discount < 0.05 order by c_name, o_orderkey, l_linenumber  limit 100;
select p_type, count(*) as part_count  from part  where p_retailprice >= 1000 and p_retailprice < 2000    and exists (      select *      from partsupp      where ps_partkey = p_partkey and ps_supplycost < 500    )  group by p_type  order by p_type  limit 1;
select sum(p_retailprice * p_size) as total_price  from part  where p_type = 'cpu'  and p_brand = 'intel'  and p_container in ('box', 'carton')  and p_retailprice >= 100  and p_retailprice <= 500  and p_size >= 10  and p_size <= 20  limit 1;
select p_partkey, p_name, p_mfgr, p_brand, p_type, p_size, p_container, p_retailprice, p_comment from part where p_size >= 10 and p_size <= 20 and p_brand = 'abc' and p_type = 'xyz'  and p_retailprice >= 100 and p_retailprice <= 200;

select s_suppkey, count(ps_partkey) as suppdist  from supplier  left outer join partsupp on s_suppkey = ps_suppkey  left outer join lineitem on ps_partkey = l_partkey and ps_suppkey = l_suppkey  where s_comment not like '%special%requests%'  group by s_suppkey  order by suppdist desc, s_suppkey desc  limit 1;
select p.p_partkey, p.p_name, p.p_mfgr, p.p_brand, p.p_type, p.p_size, p.p_container, p.p_retailprice, p.p_comment from part p inner join partsupp ps on p.p_partkey = ps.ps_partkey inner join lineitem l on l.l_partkey = ps.ps_partkey and l.l_suppkey = ps.ps_suppkey inner join orders o on o.o_orderkey = l.l_orderkey inner join customer c on c.c_custkey = o.o_custkey inner join supplier s on s.s_suppkey = ps.ps_suppkey inner join nation n on n.n_nationkey = s.s_nationkey and n.n_nationkey = c.c_nationkey inner join region r on r.r_regionkey = n.n_regionkey where l.l_shipdate >= date '1996-01-01' and l.l_shipdate < date '1996-01-01' + interval '3' month and p.p_type = 'type1' and p.p_size > 10 and c.c_mktsegment = 'segment1' and s.s_name like 'supplier%' and r.r_name = 'region1' order by p.p_partkey;
select p_brand, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt  from partsupp, part  where p_partkey = ps_partkey        and p_brand <> 'brand#45'        and p_type not like 'medium polished%'        and p_size in (49, 14, 23, 45, 19, 3, 36, 9)        and ps_suppkey not in (            select s_suppkey            from supplier            where s_comment like '%customer%compliments%'        )  group by p_brand, p_type, p_size  order by supplier_cnt desc, p_brand, p_type, p_size  limit 1;
select sum(ps_supplycost) / 10.0 as avg_yearly  from partsupp, supplier, lineitem, orders where ps_partkey = l_partkey  and ps_suppkey = l_suppkey  and s_suppkey = ps_suppkey  and l_orderkey = o_orderkey  and s_name = 'supplier x'  and o_orderstatus = 'f'  and o_shippriority > 2  and o_totalprice > (select 1.5 * avg(o_totalprice) from orders where o_orderstatus = 'f') limit 1;
select c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity)  from customer, orders, lineitem, partsupp, supplier where o_orderkey in (     select l_orderkey      from lineitem      group by l_orderkey      having sum(l_quantity) > 300 )  and c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey  and ps_partkey in (     select p_partkey      from part      where p_retailprice > 100      and p_brand = 'brand a' )  group by c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice  order by o_totalprice desc, o_orderdate  limit 100;
select p_name, p_mfgr, p_brand, p_type, p_size, p_container, p_retailprice, p_comment  from part, partsupp, supplier, lineitem, orders, customer, nation, region  where part.p_partkey = partsupp.ps_partkey  and partsupp.ps_suppkey = supplier.s_suppkey  and lineitem.l_partkey = part.p_partkey  and lineitem.l_suppkey = supplier.s_suppkey  and orders.o_orderkey = lineitem.l_orderkey  and customer.c_custkey = orders.o_custkey  and supplier.s_nationkey = nation.n_nationkey  and nation.n_regionkey = region.r_regionkey  and customer.c_mktsegment = 'automobile'  and orders.o_orderstatus = 'f'  and partsupp.ps_availqty > 50  and partsupp.ps_supplycost < 100  and supplier.s_name like 's%'  and region.r_name = 'america'  and customer.c_acctbal > 1000  and part.p_retailprice > 500  order by supplier.s_name asc, part.p_name desc;

select n_name, sum(l_extendedprice * (1 - l_discount)) as revenue  from customer, orders, lineitem, supplier, nation, region  where c_custkey = o_custkey and l_orderkey = o_orderkey and l_suppkey = s_suppkey  and c_nationkey = s_nationkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey  and r_name = 'europe' and o_orderdate >= date '1994-01-01' and o_orderdate < date '1995-01-01'  group by n_name order by revenue desc limit 1;
select n_name, sum(l_extendedprice * (1 - l_discount)) as revenue  from customer, orders, lineitem, supplier, nation, region  where c_custkey = o_custkey and l_orderkey = o_orderkey and l_suppkey = s_suppkey  and c_nationkey = s_nationkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey  and s_name = 'supplier x' and o_orderdate >= date '1994-01-01' and o_orderdate < date '1995-01-01'  group by n_name order by revenue desc limit 1;
select c_name, sum(l_extendedprice * (1 - l_discount)) as revenue  from customer, orders, lineitem, supplier, nation, region  where c_custkey = o_custkey and l_orderkey = o_orderkey and l_suppkey = s_suppkey  and c_nationkey = s_nationkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey  and c_name = 'customer y' and o_orderdate >= date '1994-01-01' and o_orderdate < date '1995-01-01'  group by c_name order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  join orders on lineitem.l_orderkey = orders.o_orderkey  join part on lineitem.l_partkey = part.p_partkey  join supplier on lineitem.l_suppkey = supplier.s_suppkey  where orders.o_orderdate >= date '1994-01-01'      and orders.o_orderdate < date '1994-01-01' + interval '1' year      and lineitem.l_discount between .06 - 0.01 and .06 + 0.01      and lineitem.l_quantity < 24      and supplier.s_name = 'abc supplier'     and part.p_type = 'type a'     and orders.o_orderstatus = 'shipped'     and part.p_size = 10  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  join orders on lineitem.l_orderkey = orders.o_orderkey  join part on lineitem.l_partkey = part.p_partkey  join supplier on lineitem.l_suppkey = supplier.s_suppkey  where orders.o_orderdate >= date '1994-01-01'      and orders.o_orderdate < date '1994-01-01' + interval '1' year      and lineitem.l_discount between .06 - 0.01 and .06 + 0.01      and lineitem.l_quantity < 24      and supplier.s_name = 'xyz supplier'     and part.p_type = 'type b'     and orders.o_orderstatus = 'cancelled'     and part.p_size = 20  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  join orders on lineitem.l_orderkey = orders.o_orderkey  join part on lineitem.l_partkey = part.p_partkey  join supplier on lineitem.l_suppkey = supplier.s_suppkey  where orders.o_orderdate >= date '1994-01-01'      and orders.o_orderdate < date '1994-01-01' + interval '1' year      and lineitem.l_discount between .06 - 0.01 and .06 + 0.01      and lineitem.l_quantity < 24      and supplier.s_name = 'def supplier'     and part.p_type = 'type c'     and orders.o_orderstatus = 'pending'     and part.p_size = 30  limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from (     select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume      from supplier, lineitem, orders, customer, nation n1, nation n2      where s_suppkey = l_suppkey          and o_orderkey = l_orderkey          and c_custkey = o_custkey          and s_nationkey = n1.n_nationkey          and c_nationkey = n2.n_nationkey          and ((n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france'))          and l_shipdate between date '1995-01-01' and date '1996-12-31'      ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from (     select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume      from supplier, lineitem, orders, customer, nation n1, nation n2      where s_suppkey = l_suppkey          and o_orderkey = l_orderkey          and c_custkey = o_custkey          and s_nationkey = n1.n_nationkey          and c_nationkey = n2.n_nationkey          and ((n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france'))          and l_shipdate between date '1997-01-01' and date '1998-12-31'      ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select o_year, sum(case when nation = 'brazil' then volume else 0 end) / sum(volume) as mkt_share  from (      select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation      from part, supplier, lineitem, orders, customer, nation n1, nation n2, region      where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey      and o_custkey = c_custkey and c_nationkey = n1.n_nationkey      and n1.n_regionkey = r_regionkey and r_name = 'america'      and s_nationkey = n2.n_nationkey      and o_orderdate between date '1995-01-01' and date '1996-12-31'      and p_type = 'economy anodized steel'  ) as all_nations  group by o_year  order by o_year limit 1;
select o_year, sum(case when nation = 'france' then volume else 0 end) / sum(volume) as mkt_share  from (      select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation      from part, supplier, lineitem, orders, customer, nation n1, nation n2, region      where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey      and o_custkey = c_custkey and c_nationkey = n1.n_nationkey      and n1.n_regionkey = r_regionkey and r_name = 'america'      and s_nationkey = n2.n_nationkey      and o_orderdate between date '1995-01-01' and date '1996-12-31'      and p_type = 'economy anodized steel'  ) as all_nations  group by o_year  order by o_year limit 1;
select o_year, sum(case when nation = 'germany' then volume else 0 end) / sum(volume) as mkt_share  from (      select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation      from part, supplier, lineitem, orders, customer, nation n1, nation n2, region      where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey      and o_custkey = c_custkey and c_nationkey = n1.n_nationkey      and n1.n_regionkey = r_regionkey and r_name = 'america'      and s_nationkey = n2.n_nationkey      and o_orderdate between date '1995-01-01' and date '1996-12-31'      and p_type = 'economy anodized steel'  ) as all_nations  group by o_year  order by o_year limit 1;

select n_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region where c_custkey = o_custkey    and l_orderkey = o_orderkey    and l_suppkey = s_suppkey    and c_nationkey = s_nationkey    and s_nationkey = n_nationkey    and n_regionkey = r_regionkey  group by n_name  order by revenue desc;
select s_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region where c_custkey = o_custkey    and l_orderkey = o_orderkey    and l_suppkey = s_suppkey    and c_nationkey = s_nationkey    and s_nationkey = n_nationkey    and n_regionkey = r_regionkey  group by s_name  order by revenue desc;
select p_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, supplier, nation, region, part, partsupp where c_custkey = o_custkey    and l_orderkey = o_orderkey    and l_suppkey = s_suppkey    and c_nationkey = s_nationkey    and s_nationkey = n_nationkey    and n_regionkey = r_regionkey    and l_partkey = ps_partkey    and l_suppkey = ps_suppkey    and p_partkey = ps_partkey  group by p_name  order by revenue desc;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1994-01-01' and l_shipdate < date '1995-01-01'  and l_discount between .05 and .07  and l_quantity < 30  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-07-01'  and l_discount between .03 and .05  and l_quantity < 20  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1994-01-01' and l_shipdate < date '1995-01-01'  and l_discount between .07 and .09  and l_quantity < 40  limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from     (select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year,     l_extendedprice * (1 - l_discount) as volume     from supplier, lineitem, orders, customer, nation n1, nation n2     where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey     and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey     and n1.n_name = 'france' and n2.n_name = 'germany'     and l_shipdate between date '1996-01-01' and date '1996-12-31') as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from     (select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year,     l_extendedprice * (1 - l_discount) as volume     from supplier, lineitem, orders, customer, nation n1, nation n2     where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey     and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey     and n1.n_name = 'germany' and n2.n_name = 'france'     and l_shipdate between date '1995-01-01' and date '1995-12-31') as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year;

select s_name, s_address, sum(ps_availqty) as sum_avail_qty, sum(ps_supplycost) as sum_supply_cost, count(*) as count_supp from supplier, partsupp where s_suppkey = ps_suppkey and ps_supplycost <= 100 group by s_name, s_address order by s_name, s_address  limit 1;
select c_name, o_year, sum(amount) as sum_profit  from (      select c_name, extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity as amount      from customer, orders, lineitem, partsupp, supplier, nation      where c_custkey = o_custkey      and o_orderkey = l_orderkey      and l_suppkey = ps_suppkey      and l_partkey = ps_partkey      and s_suppkey = ps_suppkey      and s_nationkey = n_nationkey      and s_name like '%supplier_name%'  ) as profit  group by c_name, o_year  order by c_name, o_year desc  limit 1;
select s_suppkey, sum(ps_availqty) as total_qty, s_name, s_address, s_phone from supplier, partsupp, lineitem, orders where s_suppkey = ps_suppkey and l_suppkey = ps_suppkey and l_orderkey = o_orderkey and o_orderdate < date '1995-03-15' and l_shipdate > date '1995-03-15' group by s_suppkey, s_name, s_address, s_phone order by total_qty desc, s_suppkey limit 10;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment  from part, supplier, partsupp, nation, region  where p_partkey = ps_partkey  and s_suppkey = ps_suppkey  and p_size = 15  and p_type like '%brass'  and s_nationkey = n_nationkey  and n_regionkey = r_regionkey  and r_name = 'europe'  and ps_supplycost = (      select min(ps_supplycost)      from partsupp, supplier, nation, region      where p_partkey = ps_partkey      and s_suppkey = ps_suppkey      and s_nationkey = n_nationkey      and n_regionkey = r_regionkey      and r_name = 'europe'  )  order by s_acctbal desc, n_name, s_name, p_partkey  limit 100;
select s_suppkey, s_name, s_address, s_phone  from supplier  where s_address like '%new york%'  and s_phone like '212%'  and exists (     select *      from partsupp      where ps_suppkey = s_suppkey      and ps_availqty > 100      and ps_supplycost < 50 )  and exists (     select *      from orders      where o_custkey in (         select c_custkey          from customer          where c_mktsegment = 'automobile'     )      and o_orderkey in (         select l_orderkey          from lineitem          where l_suppkey = s_suppkey          and l_quantity > 10          and l_discount < 0.1     ) )  order by s_suppkey  limit 1;
select s_name, sum(l_extendedprice * (1 - l_discount)) as revenue  from customer, orders, lineitem, supplier, nation, region, partsupp, part where c_custkey = o_custkey  and l_orderkey = o_orderkey  and l_suppkey = s_suppkey  and c_nationkey = s_nationkey  and s_nationkey = n_nationkey  and n_regionkey = r_regionkey  and s_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brandx'  and p_size = 10  and r_name = 'europe'  and o_orderdate >= date '1994-01-01'  and o_orderdate < date '1995-01-01'  group by s_name  order by revenue desc  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join orders on lineitem.l_orderkey = orders.o_orderkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey inner join customer on orders.o_custkey = customer.c_custkey where lineitem.l_shipdate >= date '1994-01-01'  and lineitem.l_shipdate < date '1995-01-01'  and lineitem.l_discount between .05 and .07  and lineitem.l_quantity < 20  and supplier.s_name = 'abc supplier'  and customer.c_mktsegment = 'segment a'  group by supplier.s_suppkey  limit 1;
select s_name as supplier_name, c_name as customer_name, extract(year from l_shipdate) as order_year, sum(l_extendedprice * (1 - l_discount)) as revenue  from supplier  join partsupp on supplier.s_suppkey = partsupp.ps_suppkey join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey join orders on lineitem.l_orderkey = orders.o_orderkey join customer on orders.o_custkey = customer.c_custkey join nation n1 on supplier.s_nationkey = n1.n_nationkey join nation n2 on customer.c_nationkey = n2.n_nationkey where (n1.n_name = 'usa' and n2.n_name = 'canada') or (n1.n_name = 'canada' and n2.n_name = 'usa') and l_shipdate between date '2000-01-01' and date '2022-12-31' group by s_name, c_name, order_year order by s_name, c_name, order_year limit 1;
select o_year, sum(case when nation = 'canada' then volume else 0 end) / sum(volume) as mkt_share from ( select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation from part, supplier, lineitem, orders, customer, nation n1, nation n2, region where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'asia' and s_nationkey = n2.n_nationkey and o_orderdate between date '1997-01-01' and date '1998-12-31' and p_type = 'stainless steel' ) as all_nations group by o_year order by o_year limit 1;
select s_suppkey, s_name, sum(ps_supplycost * (1 - l_discount)) as cost, s_acctbal, n_name, s_address, s_phone, s_comment from supplier, partsupp, lineitem, nation where s_suppkey = ps_suppkey and ps_partkey = l_partkey and ps_suppkey >= 100 and ps_suppkey <= 200 and l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '3' month and l_returnflag = 'a' and s_nationkey = n_nationkey group by s_suppkey, s_name, s_acctbal, s_phone, n_name, s_address, s_comment order by cost desc limit 20;
select ps_partkey, sum(ps_supplycost * ps_availqty) as value  from partsupp, supplier, nation, customer, orders, lineitem  where ps_suppkey = s_suppkey  and s_nationkey = n_nationkey  and n_name = 'france'  and c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_linenumber = 1  and l_shipdate >= '2020-01-01'  and l_shipdate <= '2020-12-31'  and l_returnflag = 'n'  and l_linestatus = 'f'  and l_quantity >= 10  and l_quantity <= 100  group by ps_partkey  having sum(ps_supplycost * ps_availqty) > (      select sum(ps_supplycost * ps_availqty) * 0.0001000000      from partsupp, supplier, nation, customer, orders, lineitem      where ps_suppkey = s_suppkey      and s_nationkey = n_nationkey      and n_name = 'france'      and c_custkey = o_custkey      and o_orderkey = l_orderkey      and l_linenumber = 1      and l_shipdate >= '2020-01-01'      and l_shipdate <= '2020-12-31'      and l_returnflag = 'n'      and l_linestatus = 'f'      and l_quantity >= 10      and l_quantity <= 100  )  order by value desc  limit 1;
select s_name, sum(case when o_orderpriority = '1-urgent' or o_orderpriority = '2-high' then 1 else 0 end) as high_order_count, sum(case when o_orderpriority <> '1-urgent' and o_orderpriority <> '2-high' then 1 else 0 end) as low_order_count  from supplier, orders, lineitem  where supplier.s_suppkey = lineitem.l_suppkey  and orders.o_orderkey = lineitem.l_orderkey  and s_name like '%a%'  and o_orderdate >= date '1994-01-01'  and o_orderdate < date '1995-01-01'  group by s_name  order by s_name  limit 1;
select 100.00 * sum(case when s_phone like '%123%' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as promo_revenue  from lineitem, partsupp, supplier  where l_partkey = ps_partkey and l_suppkey = ps_suppkey and ps_supplycost < 100  and l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month  and s_address like '%beijing%'  limit 1;
select s_name, s_address, s_phone, count(distinct ps_partkey) as part_cnt  from supplier, partsupp  where s_suppkey = ps_suppkey  and s_name <> 'supplier#5'  and s_address like '%shanghai%'  and ps_partkey in (1, 2, 3, 4, 5)  and ps_partkey not in (    select l_partkey    from lineitem    where l_quantity > 100  )  group by s_name, s_address, s_phone  order by part_cnt desc, s_name, s_address, s_phone  limit 1;
select sum(ps_supplycost) / 7.0 as avg_yearly  from partsupp, supplier  where ps_suppkey = s_suppkey  and s_name = 'supplier a'  and s_address = 'address a'  and ps_availqty > (select 0.5 * avg(ps_availqty) from partsupp where ps_suppkey = s_suppkey)  limit 1;
select s_name, s_suppkey, ps_partkey, ps_supplycost, sum(l_quantity) from supplier, partsupp, lineitem where ps_suppkey in ( select l_suppkey from lineitem group by l_suppkey having sum(l_quantity) > 300 ) and s_suppkey = ps_suppkey and ps_partkey = l_partkey group by s_name, s_suppkey, ps_partkey, ps_supplycost order by ps_supplycost desc, s_name limit 100;
select sum(l_extendedprice * (1 - l_discount)) as revenue  from lineitem, partsupp, orders, supplier  where (lineitem.l_partkey = partsupp.ps_partkey    and lineitem.l_suppkey = partsupp.ps_suppkey    and partsupp.ps_suppkey = supplier.s_suppkey    and lineitem.l_orderkey = orders.o_orderkey    and supplier.s_name = 'supplier1'    and orders.o_orderstatus = 'f'    and orders.o_orderdate >= '2021-01-01'    and orders.o_orderdate <= '2021-12-31'    and lineitem.l_shipdate >= '2021-01-01'    and lineitem.l_shipdate <= '2021-12-31')  or (lineitem.l_partkey = partsupp.ps_partkey    and lineitem.l_suppkey = partsupp.ps_suppkey    and partsupp.ps_suppkey = supplier.s_suppkey    and lineitem.l_orderkey = orders.o_orderkey    and supplier.s_name = 'supplier2'    and orders.o_orderstatus = 'f'    and orders.o_orderdate >= '2021-01-01'    and orders.o_orderdate <= '2021-12-31'    and lineitem.l_shipdate >= '2021-01-01'    and lineitem.l_shipdate <= '2021-12-31')  or (lineitem.l_partkey = partsupp.ps_partkey    and lineitem.l_suppkey = partsupp.ps_suppkey    and partsupp.ps_suppkey = supplier.s_suppkey    and lineitem.l_orderkey = orders.o_orderkey    and supplier.s_name = 'supplier3'    and orders.o_orderstatus = 'f'    and orders.o_orderdate >= '2021-01-01'    and orders.o_orderdate <= '2021-12-31'    and lineitem.l_shipdate >= '2021-01-01'    and lineitem.l_shipdate <= '2021-12-31')  limit 1;

select o_year, sum(case when nation = 'brazil' then volume else 0 end) / sum(volume) as mkt_share  from (      select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation      from part, supplier, lineitem, orders, customer, nation n1, nation n2, region      where p_partkey = l_partkey          and s_suppkey = l_suppkey          and l_orderkey = o_orderkey          and o_custkey = c_custkey          and c_nationkey = n1.n_nationkey          and n1.n_regionkey = r_regionkey          and r_name = 'america'          and s_nationkey = n2.n_nationkey          and o_orderdate between date '1995-01-01' and date '1996-12-31'          and p_type = 'economy anodized steel'         and l_linenumber > 5 ) as all_nations  group by o_year  order by o_year  limit 1;
select o_year, sum(case when nation = 'brazil' then volume else 0 end) / sum(volume) as mkt_share  from (      select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation      from part, supplier, lineitem, orders, customer, nation n1, nation n2, region      where p_partkey = l_partkey          and s_suppkey = l_suppkey          and l_orderkey = o_orderkey          and o_custkey = c_custkey          and c_nationkey = n1.n_nationkey          and n1.n_regionkey = r_regionkey          and r_name = 'america'          and s_nationkey = n2.n_nationkey          and o_orderdate between date '1995-01-01' and date '1996-12-31'          and p_type = 'economy anodized steel'         and s_acctbal > 1000 ) as all_nations  group by o_year  order by o_year  limit 1;
select p_name, p_mfgr, p_brand, s_name, ps_supplycost, ps_availqty from part p, supplier s, partsupp ps, nation n where p.p_partkey = ps.ps_partkey   and s.s_suppkey = ps.ps_suppkey   and s.s_nationkey = n.n_nationkey   and n.n_name = 'germany' order by ps_supplycost desc limit 1;
select c_name, sum(o_totalprice) as total_price from customer c, orders o, nation n where c.c_custkey = o.o_custkey   and c.c_nationkey = n.n_nationkey   and n.n_name = 'germany'   and o.o_orderdate between '2021-01-01' and '2021-12-31' group by c_name order by total_price desc;
select p.p_name, sum(l.l_quantity) as total_quantity, o.o_orderdate, c.c_name from part p, lineitem l, orders o, customer c where p.p_partkey = l.l_partkey   and l.l_orderkey = o.o_orderkey   and o.o_custkey = c.c_custkey group by p.p_name, o.o_orderdate, c.c_name order by total_quantity desc limit 1;
select s_name, count(*) as order_count from supplier, partsupp, lineitem, orders where supplier.s_suppkey = partsupp.ps_suppkey and partsupp.ps_partkey = lineitem.l_partkey and lineitem.l_orderkey = orders.o_orderkey and orders.o_orderstatus = 'f' and lineitem.l_shipdate < '1994-01-01' and supplier.s_name = 'supplier1' group by s_name;
select p_name, sum(ps_supplycost) as total_cost from part, partsupp, lineitem, supplier where part.p_partkey = partsupp.ps_partkey and partsupp.ps_suppkey = lineitem.l_suppkey and lineitem.l_shipdate >= '1994-01-01' and lineitem.l_shipdate < '1995-01-01' and supplier.s_name = 'supplier2' and supplier.s_suppkey = partsupp.ps_suppkey group by p_name;

select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, partsupp, supplier, part  where (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#12'  and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg')  and l_quantity >= 1  and l_quantity <= 1 + 10  and p_size between 1 and 5  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'deliver in person')  or (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#23'  and p_container in ('med bag', 'med box', 'med pkg', 'med pack')  and l_quantity >= 10  and l_quantity <= 10 + 10  and p_size between 1 and 10  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'deliver in person')  or (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#34'  and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg')  and l_quantity >= 20  and l_quantity <= 20 + 10  and p_size between 1 and 15  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'deliver in person')  limit 1;
select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, partsupp, supplier, part  where (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#12'  and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg')  and l_quantity >= 2  and l_quantity <= 2 + 10  and p_size between 2 and 6  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'collect cod')  or (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#23'  and p_container in ('med bag', 'med box', 'med pkg', 'med pack')  and l_quantity >= 11  and l_quantity <= 11 + 10  and p_size between 2 and 11  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'collect cod')  or (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#34'  and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg')  and l_quantity >= 21  and l_quantity <= 21 + 10  and p_size between 2 and 16  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'collect cod')  limit 1;
select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, partsupp, supplier, part  where (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#12'  and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg')  and l_quantity >= 3  and l_quantity <= 3 + 10  and p_size between 3 and 7  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'take back return')  or (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#23'  and p_container in ('med bag', 'med box', 'med pkg', 'med pack')  and l_quantity >= 12  and l_quantity <= 12 + 10  and p_size between 3 and 12  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'take back return')  or (p_partkey = l_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and p_brand = 'brand#34'  and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg')  and l_quantity >= 22  and l_quantity <= 22 + 10  and p_size between 3 and 17  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'take back return')  limit 1;
select s_name, count(*) as numwait from supplier, lineitem l1, orders, nation where s_suppkey = l1.l_suppkey     and o_orderkey = l1.l_orderkey     and o_orderstatus = 'f'     and l1.l_receiptdate > l1.l_commitdate     and exists (         select *         from lineitem l2         where l2.l_orderkey = l1.l_orderkey             and l2.l_suppkey <> l1.l_suppkey     )     and not exists (         select *         from lineitem l3         where l3.l_orderkey = l1.l_orderkey             and l3.l_suppkey <> l1.l_suppkey             and l3.l_receiptdate > l3.l_commitdate     )     and s_nationkey = n_nationkey     and n_name = 'saudi arabia' group by s_name order by numwait desc, s_name limit 100;
select s_name, count(*) as numwait from supplier, lineitem l1, orders, nation where s_suppkey = l1.l_suppkey     and o_orderkey = l1.l_orderkey     and o_orderstatus = 'f'     and l1.l_receiptdate > l1.l_commitdate     and exists (         select *         from lineitem l2         where l2.l_orderkey = l1.l_orderkey             and l2.l_suppkey <> l1.l_suppkey     )     and not exists (         select *         from lineitem l3         where l3.l_orderkey = l1.l_orderkey             and l3.l_suppkey <> l1.l_suppkey             and l3.l_receiptdate > l3.l_commitdate     )     and s_nationkey = n_nationkey     and n_name = 'saudi arabia' group by s_name order by numwait asc, s_name limit 100;
select n_name, count(o_orderkey) as numorders, sum(o_totalprice) as totalamount    from customer c     join nation n on c.c_nationkey = n.n_nationkey    join orders o on c.c_custkey = o.o_custkey    group by n_name    order by totalamount desc;
select n_name, count(p_partkey) as numparts, count(distinct s_suppkey) as numsuppliers    from supplier s    join nation n on s.s_nationkey = n.n_nationkey    join partsupp ps on s.s_suppkey = ps.ps_suppkey    join part p on ps.ps_partkey = p.p_partkey    group by n_name    order by numparts asc;
select n_name, o.o_custkey, c.c_name, sum(o.o_totalprice) as totalamount    from customer c     join nation n on c.c_nationkey = n.n_nationkey    join orders o on c.c_custkey = o.o_custkey    group by n_name, o.o_custkey, c.c_name    having sum(o.o_totalprice) = (select max(totalamount) from (select n_name, o.o_custkey, sum(o.o_totalprice) as totalamount from customer c join nation n on c.c_nationkey = n.n_nationkey join orders o on c.c_custkey = o.o_custkey group by n_name, o.o_custkey) as subquery)    order by totalamount desc    limit 1;

select c_name, c_mktsegment, sum(o_totalprice) as sum_price, avg(o_totalprice) as avg_price, count(*) as count_order  from customer  join orders on customer.c_custkey = orders.o_custkey  join lineitem on orders.o_orderkey = lineitem.l_orderkey  join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey  join supplier on partsupp.ps_suppkey = supplier.s_suppkey  join nation on customer.c_nationkey = nation.n_nationkey  join region on nation.n_regionkey = region.r_regionkey  where region.r_name = 'asia' and supplier.s_name = 'abc supplier' and customer.c_mktsegment = 'automobile' and orders.o_orderstatus = 'f'  group by c_name, c_mktsegment  order by sum_price desc  limit 1;
select c_name as customer, n_name as nation, extract(year from o_orderdate) as o_year, sum(l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as sum_profit  from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  join partsupp on l_suppkey = ps_suppkey and l_partkey = ps_partkey  join part on p_partkey = l_partkey  join supplier on ps_suppkey = s_suppkey  join nation on s_nationkey = n_nationkey  join region on n_regionkey = r_regionkey  where c_name like '%customer_name%' and n_name like '%nation_name%' and r_name like '%region_name%'  group by c_name, n_name, extract(year from o_orderdate)  order by sum_profit desc  limit 1;
select c_custkey, count(*) as order_count  from customer c  join orders o on c.c_custkey = o.o_custkey  join lineitem l on o.o_orderkey = l.l_orderkey  join partsupp ps on l.l_partkey = ps.ps_partkey and l.l_suppkey = ps.ps_suppkey  join supplier s on ps.ps_suppkey = s.s_suppkey  join nation n on s.s_nationkey = n.n_nationkey  join region r on n.n_regionkey = r.r_regionkey  where c.c_mktsegment = 'automobile'  and n.n_name = 'germany'  and r.r_name = 'europe'  and o.o_orderdate >= date '1994-01-01'  and o.o_orderdate < date '1994-01-01' + interval '3' month  and l.l_commitdate < l.l_receiptdate  group by c_custkey  order by order_count desc  limit 1;
select c_name, sum(l_extendedprice * (1 - l_discount)) as revenue  from customer  join orders on c_custkey = o_custkey  join lineitem on l_orderkey = o_orderkey  join partsupp on l_suppkey = ps_suppkey  join supplier on ps_suppkey = s_suppkey  join nation on c_nationkey = s_nationkey  join region on n_regionkey = r_regionkey  where r_name = 'europe'  and o_orderdate >= date '1996-01-01'  and o_orderdate < date '1997-01-01'  group by c_name  order by revenue desc  limit 1;
select s.s_name, sum(l.l_extendedprice * (1 - l.l_discount)) as sales_amount, sum(l.l_quantity) as sales_quantity from supplier s inner join partsupp ps on s.s_suppkey = ps.ps_suppkey inner join lineitem l on ps.ps_partkey = l.l_partkey and ps.ps_suppkey = l.l_suppkey where s.s_name = 'supplier name' group by s.s_name;
select c.c_name, count(o.o_orderkey) as order_count, sum(o.o_totalprice) as total_amount from customer c inner join orders o on c.c_custkey = o.o_custkey where o.o_orderdate <= date '2021-01-01' group by c.c_name;
select n_name as nation, extract(year from o_orderdate) as o_year, sum(l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as sum_profit from part, supplier, lineitem, partsupp, orders, nation where s_suppkey = l_suppkey and ps_suppkey = l_suppkey and ps_partkey = l_partkey and p_partkey = l_partkey and o_orderkey = l_orderkey and s_nationkey = n_nationkey and p_name like '%green%' and extract(year from o_orderdate) = 2019 group by nation, o_year order by nation, o_year desc limit 1;
select n_name as nation, extract(year from o_orderdate) as o_year, sum(l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as sum_profit from part, supplier, lineitem, partsupp, orders, nation where s_suppkey = l_suppkey and ps_suppkey = l_suppkey and ps_partkey = l_partkey and p_partkey = l_partkey and o_orderkey = l_orderkey and s_nationkey = n_nationkey and p_name like '%red%' and extract(year from o_orderdate) = 2018 group by nation, o_year order by nation, o_year desc limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem  where c_custkey = o_custkey      and l_orderkey = o_orderkey      and o_orderdate < date '1995-03-15'      and l_shipdate > date '1995-03-15'  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier  where c_custkey = o_custkey      and l_orderkey = o_orderkey      and l_partkey = ps_partkey      and l_suppkey = ps_suppkey      and ps_suppkey = s_suppkey      and s_name = 'supplier a'  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment from part, supplier, partsupp, nation, region where p_partkey = ps_partkey  and s_suppkey = ps_suppkey  and p_partkey = 100  and p_mfgr = 'a'  and s_nationkey = n_nationkey  and n_name = 'usa'  and s_acctbal > 1000 order by s_acctbal desc, n_name, s_name, p_partkey limit 100;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment from part, supplier, partsupp, nation, region where p_partkey = ps_partkey  and s_suppkey = ps_suppkey  and (p_mfgr = 'b' or p_mfgr = 'c')  and n_name = 'canada'  and s_acctbal < 500 order by s_acctbal desc, n_name, s_name, p_partkey limit 100;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment from part, supplier, partsupp, nation, region where p_partkey = ps_partkey  and s_suppkey = ps_suppkey  and (p_partkey = 200 or p_partkey = 300)  and p_mfgr = 'd'  and n_name = 'germany'  and s_acctbal > 2000 order by s_acctbal desc, n_name, s_name, p_partkey limit 100;
select o_orderpriority, count(*) as order_count from orders  inner join customer on orders.o_custkey = customer.c_custkey where customer.c_nationkey = 1 group by o_orderpriority order by order_count desc limit 1;
select o_orderpriority, count(*) as order_count from orders  inner join lineitem on orders.o_orderkey = lineitem.l_orderkey inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join part on partsupp.ps_partkey = part.p_partkey where part.p_type = 'type a' and orders.o_orderdate >= date '1993-01-01' and orders.o_orderdate < date '1993-02-01' group by o_orderpriority order by order_count desc limit 1;

select p_partkey, sum(p_retailprice * p_size) as value  from part, partsupp, supplier, nation  where p_partkey = ps_partkey  and ps_suppkey = s_suppkey  and s_nationkey = n_nationkey  and n_name = 'france'  group by p_partkey  having sum(p_retailprice * p_size) > (      select sum(p_retailprice * p_size) * 0.0001000000      from part, partsupp, supplier, nation      where p_partkey = ps_partkey      and ps_suppkey = s_suppkey      and s_nationkey = n_nationkey      and n_name = 'france'  )  order by value desc  limit 1;
select p_type, sum(case when c_mktsegment = 'building' or c_mktsegment = 'automobile' then 1 else 0 end) as building_auto_count, sum(case when c_mktsegment <> 'building' and c_mktsegment <> 'automobile' then 1 else 0 end) as other_count  from customer, orders, lineitem, partsupp, supplier, part  where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey  and ps_partkey = p_partkey  and p_type in ('type1', 'type2')  and s_name = 'supplier1'  and c_mktsegment = 'building'  and l_shipmode in ('mail', 'ship')  and l_commitdate < l_receiptdate  and l_shipdate < l_commitdate  and l_receiptdate >= date '1994-01-01'  and l_receiptdate < date '1994-01-01' + interval '1' year  group by p_type  order by p_type  limit 1;
select p_brand, p_type, count(*) as partdist  from part join partsupp on part.p_partkey = partsupp.ps_partkey join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey join supplier on partsupp.ps_suppkey = supplier.s_suppkey and supplier.s_name not like '%special%requests%' join orders on lineitem.l_orderkey = orders.o_orderkey join customer on orders.o_custkey = customer.c_custkey where p_retailprice > 1000 and p_size < 10 and c_mktsegment = 'building' group by p_brand, p_type order by partdist desc limit 1;
select      100.00 * sum(case when p_type like 'promo%' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as promo_revenue  from      lineitem, partsupp, orders, supplier, customer, nation, region, part  where      l_partkey = p_partkey      and l_suppkey = ps_suppkey      and l_orderkey = o_orderkey      and ps_partkey = p_partkey      and ps_suppkey = s_suppkey      and o_custkey = c_custkey      and c_nationkey = n_nationkey      and n_regionkey = r_regionkey      and l_shipdate >= date '1995-09-01'      and l_shipdate < date '1995-09-01' + interval '1' month      and p_name like '%product%'      and s_name like '%supplier%'      and c_name like '%customer%'      and r_name like '%region%'      and n_name like '%nation%'  limit 1;
select p_partkey, p_name, p_mfgr, p_brand, p_type, p_size, p_container, p_retailprice, p_comment  from part  where p_size > 20  and p_retailprice < 100  and p_type in ('small', 'medium')  and p_brand not like '%a'  and p_comment like '%good%';
select s_suppkey, s_name, s_address, s_phone, s_acctbal  from supplier  where s_suppkey in (select ps_suppkey from partsupp where ps_partkey = 123)  and s_nationkey = (select n_nationkey from nation where n_name = 'china');
select o_orderkey, o_custkey, o_orderstatus, o_totalprice, o_orderdate, o_orderpriority, o_clerk, o_shippriority  from orders  where o_orderdate between date '2020-01-01' and date '2020-12-31'  and o_totalprice > 1000  and o_orderpriority = 'high';
select l_orderkey, l_partkey, l_suppkey, l_linenumber, l_quantity, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus, l_shipdate, l_commitdate, l_receiptdate, l_shipinstruct, l_shipmode, l_comment  from lineitem  where l_orderkey in (select o_orderkey from orders where o_custkey = 456)  and l_partkey in (select p_partkey from part where p_type = 'typea')  and l_suppkey in (select s_suppkey from supplier where s_nationkey = (select n_nationkey from nation where n_name = 'usa'));
select c_custkey, c_name, c_address, c_phone, c_acctbal, c_mktsegment  from customer  where c_mktsegment = 'segmenta'  and c_custkey in (select o_custkey from orders where o_orderstatus = 'shipped')  and c_nationkey in (select n_nationkey from nation where n_regionkey = (select r_regionkey from region where r_name = 'asia'));
select p_name, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt  from partsupp, part  where p_partkey = ps_partkey  and p_name <> 'product#1234'  and p_type not like 'small polished%'  and p_size in (50, 15, 24, 46, 20, 4, 37, 10)  and ps_suppkey not in (      select s_suppkey      from supplier      where s_comment like '%customer%complaints%'  )  group by p_name, p_type, p_size  order by supplier_cnt desc, p_name, p_type, p_size  limit 1;

select c.c_custkey, c.c_name, c.c_address, c.c_nationkey, c.c_phone, c.c_acctbal, c.c_mktsegment, c.c_comment, count(o.o_orderkey) as order_count, sum(o.o_totalprice) as total_price from customer c join orders o on c.c_custkey = o.o_custkey where o.o_orderdate <= '1998-12-01' group by c.c_custkey, c.c_name, c.c_address, c.c_nationkey, c.c_phone, c.c_acctbal, c.c_mktsegment, c.c_comment;
select nation, o_year, p_name, max(profit) as max_profit from (     select n_name as nation, extract(year from o_orderdate) as o_year,             p_name, (l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as profit     from part, supplier, lineitem, partsupp, orders, nation     where s_suppkey = l_suppkey     and ps_suppkey = l_suppkey     and ps_partkey = l_partkey     and p_partkey = l_partkey     and o_orderkey = l_orderkey     and s_nationkey = n_nationkey ) as profit_table group by nation, o_year, p_name order by nation, o_year desc, max_profit desc limit 1;
select nation, o_year, p_name, min(profit) as min_profit from (     select n_name as nation, extract(year from o_orderdate) as o_year,             p_name, (l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as profit     from part, supplier, lineitem, partsupp, orders, nation     where s_suppkey = l_suppkey     and ps_suppkey = l_suppkey     and ps_partkey = l_partkey     and p_partkey = l_partkey     and o_orderkey = l_orderkey     and s_nationkey = n_nationkey ) as profit_table group by nation, o_year, p_name order by nation, o_year desc, min_profit asc limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority from customer, orders, lineitem where c_mktsegment = 'building' and c_custkey = o_custkey and l_orderkey = o_orderkey      and o_orderdate < date '1995-03-15' and l_shipdate > date '1995-03-15' group by l_orderkey, o_orderdate, o_shippriority order by revenue desc, o_orderdate limit 10;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority from customer, orders, lineitem where c_mktsegment = 'building' and c_custkey = o_custkey and l_orderkey = o_orderkey      and o_orderdate > date '1995-03-15' and l_shipdate < date '1995-03-15' group by l_orderkey, o_orderdate, o_shippriority order by revenue desc, o_orderdate limit 10;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment from part, supplier, partsupp, nation, region where p_partkey = ps_partkey   and s_suppkey = ps_suppkey   and s_nationkey = n_nationkey   and n_regionkey = r_regionkey   and r_name = 'europe'   and ps_supplycost = (     select min(ps_supplycost)     from partsupp, supplier, nation, region     where p_partkey = ps_partkey       and s_suppkey = ps_suppkey       and s_nationkey = n_nationkey       and n_regionkey = r_regionkey       and r_name = 'europe'     ) order by s_acctbal desc, n_name, s_name, p_partkey limit 100;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment from part, supplier, partsupp, nation, region where p_partkey = ps_partkey   and s_suppkey = ps_suppkey   and s_nationkey = n_nationkey   and n_regionkey = r_regionkey   and r_name = 'europe'   and ps_supplycost = (     select min(ps_supplycost)     from partsupp, supplier, nation, region     where p_partkey = ps_partkey       and s_suppkey = ps_suppkey       and s_nationkey = n_nationkey       and n_regionkey = r_regionkey       and r_name = 'europe'     ) order by s_acctbal desc, p_partkey desc limit 100;
select p_name, sum(l_quantity) as total_quantity  from lineitem  join part on lineitem.l_partkey = part.p_partkey  join orders on lineitem.l_orderkey = orders.o_orderkey  where orders.o_orderdate >= date '1993-07-01'      and orders.o_orderdate < date '1993-07-01' + interval '3' month  group by p_name  order by total_quantity desc  limit 1;

select s_name, s_address, sum(ps_supplycost) as total_supply_cost, avg(ps_supplycost) as avg_supply_cost, count(*) as count_parts from supplier join partsupp on supplier.s_suppkey = partsupp.ps_suppkey join part on partsupp.ps_partkey = part.p_partkey join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey where s_nationkey = 1 and l_orderkey in (select o_orderkey from orders where o_custkey = 1) and p_type = 'economy anodized steel' group by s_name, s_address order by total_supply_cost desc limit 1;
select s_name as supplier, extract(year from o_orderdate) as order_year, sum(l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as total_profit  from supplier, lineitem, partsupp, orders where s_suppkey = l_suppkey  and l_suppkey = ps_suppkey  and l_partkey = ps_partkey  and o_orderkey = l_orderkey  and s_name like '%supplier_name%' group by supplier, order_year order by supplier, order_year desc limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier  where c_mktsegment = 'automobile'  and c_custkey = o_custkey  and l_orderkey = o_orderkey  and l_shipdate > date '1995-01-01'  and l_shipdate < date '1996-01-01'  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_supplycost > 100  and s_nationkey = 1  and ps_availqty > 10  and o_orderstatus = 'f'  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select c_name, o_orderstatus, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and l_shipdate > '1994-01-01' and l_shipdate < '1995-01-01' and l_quantity > 10 and l_extendedprice < 5000 order by c_name, o_orderstatus, l_extendedprice desc, l_discount, l_tax, l_returnflag, l_linestatus limit 100;
select o_orderpriority, count(*) as order_count from orders where o_orderdate >= date '1994-01-01' and o_orderdate < date '1994-01-01' + interval '6' month and exists ( select * from lineitem where l_orderkey = o_orderkey and l_commitdate < l_receiptdate ) group by o_orderpriority order by o_orderpriority desc limit 1;
select p_name, sum(l_extendedprice * (1 - l_discount)) as total_price  from part, partsupp, lineitem, supplier, nation, region  where ps_partkey = p_partkey and ps_suppkey = l_suppkey and l_partkey = p_partkey  and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey  and r_name = 'europe' and l_shipdate >= date '1995-01-01'  and l_shipdate < date '1995-01-01' + interval '1' year  group by p_name  order by total_price desc  limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join orders on lineitem.l_orderkey = orders.o_orderkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey inner join customer on orders.o_custkey = customer.c_custkey where lineitem.l_shipdate >= date '1995-01-01' and lineitem.l_shipdate < date '1996-01-01' and lineitem.l_discount between .05 - 0.005 and .05 + 0.005 and lineitem.l_quantity < 30 and supplier.s_name = 'supplier a' and customer.c_name = 'customer b' and orders.o_orderstatus = 'shipped' and partsupp.ps_supplycost < 100 limit 1;
select s_name as supplier_name, c_name as customer_name, extract(year from o_orderdate) as order_year, sum(l_extendedprice * (1 - l_discount)) as revenue from supplier, lineitem, orders, customer where s_suppkey = l_suppkey  and o_orderkey = l_orderkey  and c_custkey = o_custkey  and (s_name = 'supplier a' or c_name = 'customer b') and o_orderdate between date '2020-01-01' and date '2020-12-31' group by s_name, c_name, extract(year from o_orderdate) order by s_name, c_name, extract(year from o_orderdate) limit 1;
select o_year, sum(case when nation = 'china' then volume else 0 end) / sum(volume) as mkt_share from (  select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation  from part, supplier, lineitem, orders, customer, nation n1, nation n2, region  where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey and o_custkey = c_custkey  and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey and r_name = 'asia'  and s_nationkey = n2.n_nationkey and o_orderdate between date '1995-01-01' and date '1996-12-31'  and p_type = 'stainless steel' ) as all_nations group by o_year order by o_year limit 1;
select s_suppkey, s_name, sum(ps_supplycost * ps_availqty) as cost, s_acctbal, n_name, s_address, s_phone, s_comment  from supplier, partsupp, nation  where s_suppkey = ps_suppkey  and ps_partkey in (select p_partkey from part where p_type = 'big box') and ps_availqty > 100  and s_nationkey = n_nationkey  group by s_suppkey, s_name, s_acctbal, s_phone, n_name, s_address, s_comment  order by cost desc  limit 10;
select p_partkey, sum(p_retailprice * p_size) as value  from part, partsupp, supplier, nation, customer, orders, lineitem  where part.p_partkey = partsupp.ps_partkey  and partsupp.ps_suppkey = supplier.s_suppkey  and supplier.s_nationkey = nation.n_nationkey  and customer.c_custkey = orders.o_custkey  and orders.o_orderkey = lineitem.l_orderkey  and part.p_type = 'economy anodized steel'  and supplier.s_name = 'supplier1'  and nation.n_name = 'united states'  and customer.c_mktsegment = 'automobile'  group by p_partkey  having sum(p_retailprice * p_size) > (select sum(p_retailprice * p_size) * 0.0001000000 from part, partsupp, supplier, nation, customer, orders, lineitem where part.p_partkey = partsupp.ps_partkey and partsupp.ps_suppkey = supplier.s_suppkey and supplier.s_nationkey = nation.n_nationkey and customer.c_custkey = orders.o_custkey and orders.o_orderkey = lineitem.l_orderkey and part.p_type = 'economy anodized steel' and supplier.s_name = 'supplier1' and nation.n_name = 'united states' and customer.c_mktsegment = 'automobile')  order by value desc  limit 1;
select s_name, sum(case when c_mktsegment = 'automobile' or c_mktsegment = 'building' then 1 else 0 end) as high_customer_count, sum(case when c_mktsegment <> 'automobile' and c_mktsegment <> 'building' then 1 else 0 end) as low_customer_count from customer, orders, lineitem, partsupp, supplier where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and ps_suppkey = s_suppkey and c_nationkey = s_nationkey and l_shipmode <> 'air' and l_shipmode <> 'sea' and l_commitdate > l_receiptdate and l_shipdate > l_commitdate and l_receiptdate >= date '1995-01-01' and l_receiptdate < date '1996-01-01' group by s_name order by s_name limit 1;
select 100.00 * sum(case when s_name like 'supplier%' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as supplier_revenue  from lineitem, partsupp, supplier  where l_partkey = ps_partkey and l_suppkey = s_suppkey  and l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month  and s_acctbal > 1000 and ps_availqty > 100  limit 1;
select o_custkey, sum(l_extendedprice * (1 - l_discount))  from lineitem, orders  where l_orderkey = o_orderkey    and l_suppkey in (select s_suppkey from supplier where s_nationkey = 4)    and o_orderdate >= date '1995-01-01'    and o_orderdate < date '1995-01-01' + interval '6' month  group by o_custkey;
select distinct p_brand, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt  from partsupp, part, supplier  where p_partkey = ps_partkey  and ps_suppkey = s_suppkey  and p_brand <> 'brand#45'  and p_type not like 'medium polished%'  and p_size in (49, 14, 23, 45, 19, 3, 36, 9)  and s_suppkey not in (select s_suppkey from supplier where s_comment like '%customer%complaints%')  and s_suppkey not in (select l_suppkey from lineitem where l_shipdate between '1994-01-01' and '1994-12-31')  and p_partkey not in (select l_partkey from lineitem where l_discount > 0.05)  group by p_brand, p_type, p_size  order by supplier_cnt desc, p_brand, p_type, p_size  limit 1;
select sum(ps_supplycost) / 10.0 as avg_yearly_cost from partsupp, supplier where s_suppkey = ps_suppkey and s_name = 'supplier#2' and ps_supplycost > ( select 1.5 * avg(ps_supplycost) from partsupp where ps_suppkey = s_suppkey );
select s_name, s_suppkey, ps_partkey, ps_supplycost, sum(l_quantity)  from supplier, partsupp, lineitem  where ps_suppkey in (select s_suppkey from supplier where s_name like 's%')  and ps_partkey in (select l_partkey from lineitem where l_quantity > 300)  and ps_suppkey = s_suppkey  and ps_partkey = l_partkey  group by s_name, s_suppkey, ps_partkey, ps_supplycost  order by sum(l_quantity) desc, s_suppkey  limit 100;

select c_name as customer, extract(year from o_orderdate) as order_year, sum(o_totalprice) as total_sales  from orders  join customer on o_custkey = c_custkey  where c_mktsegment = 'automobile' and o_orderstatus = 'f'  group by c_name, order_year  order by total_sales desc  limit 1;
select l_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority  from customer, orders, lineitem, partsupp, supplier  where c_mktsegment = 'automobile'  and c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_availqty > 100  and ps_supplycost < 50  and s_suppkey = ps_suppkey  and s_name = 'supplier x'  and o_orderdate < '1996-01-01'  and l_shipdate > '1996-01-01'  group by l_orderkey, o_orderdate, o_shippriority  order by revenue desc, o_orderdate  limit 10;
select c_custkey, c_name, o_orderkey, o_totalprice, o_orderdate, p_partkey, p_name, p_brand, p_type, s_suppkey, s_name from customer, orders, lineitem, part, supplier where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = p_partkey and l_suppkey = s_suppkey and c_mktsegment = 'building' and o_orderstatus = 'f' and p_size = 30 and p_type not like '%steel' and s_acctbal >= 1000 and p_retailprice between 10 and 100 order by c_custkey, o_orderkey, p_partkey limit 100;
select p_brand, sum(l_extendedprice * (1 - l_discount)) as revenue, c_custkey, c_name, c_acctbal, n_name, c_address, c_phone, c_comment from customer, orders, lineitem, part, partsupp, supplier, nation, region where c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = p_partkey and l_suppkey = ps_suppkey and ps_partkey = p_partkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and o_orderdate >= date '1994-01-01' and o_orderdate < date '1995-01-01' and p_type = 'economy anodized steel' and s_acctbal < 1000 and p_brand <> 'brand x' and c_nationkey = n_nationkey and r_name = 'asia' group by p_brand, c_custkey, c_name, c_acctbal, n_name, c_address, c_phone, c_comment order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  inner join orders on lineitem.l_orderkey = orders.o_orderkey inner join customer on orders.o_custkey = customer.c_custkey inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey inner join part on partsupp.ps_partkey = part.p_partkey where l_shipdate >= date '1994-01-01'  and l_shipdate < date '1994-01-01' + interval '1' year  and l_discount between .06 - 0.01 and .06 + 0.01  and l_quantity < 24  and customer.c_mktsegment = 'automobile' and part.p_brand = 'abc' and supplier.s_name = 'xyz' limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from (      select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume      from supplier, lineitem, orders, customer, nation n1, nation n2      where s_suppkey = l_suppkey      and o_orderkey = l_orderkey      and c_custkey = o_custkey      and s_nationkey = n1.n_nationkey      and c_nationkey = n2.n_nationkey      and (          (n1.n_name = 'france' and n2.n_name = 'germany')          or (n1.n_name = 'germany' and n2.n_name = 'france')      )      and l_shipdate between date '1995-01-01' and date '1996-12-31'  ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select o_year, sum(case when nation = 'china' then volume else 0 end) / sum(volume) as mkt_share  from (      select extract(year from o_orderdate) as o_year,      l_extendedprice * (1 - l_discount) as volume,      n2.n_name as nation      from part, supplier, lineitem, orders, customer, nation n1, nation n2, region      where p_partkey = l_partkey      and s_suppkey = l_suppkey      and l_orderkey = o_orderkey      and o_custkey = c_custkey      and c_nationkey = n1.n_nationkey      and n1.n_regionkey = r_regionkey      and r_name = 'asia'      and s_nationkey = n2.n_nationkey      and o_orderdate between date '2000-01-01' and date '2001-12-31'      and p_type = 'large anodized steel'  ) as all_nations  group by o_year  order by o_year  limit 1;

select p_brand, p_type, sum(p_retailprice) as sum_retailprice, sum(p_retailprice * (1 - ps_supplycost)) as sum_profit from part p join partsupp ps on p.p_partkey = ps.ps_partkey join supplier s on ps.ps_suppkey = s.s_suppkey join lineitem l on l.l_partkey = ps.ps_partkey and l.l_suppkey = ps.ps_suppkey join orders o on l.l_orderkey = o.o_orderkey join customer c on o.o_custkey = c.c_custkey where c.c_mktsegment = 'automobile' and p.p_container = 'wrap box' and s.s_address like '%california%' and o.o_orderdate between '1998-01-01' and '1998-12-01' group by p_brand, p_type order by sum_retailprice desc limit 1;
select s_name, o_year, sum(amount) as sum_profit  from      (select s_name, extract(year from o_orderdate) as o_year,              l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity as amount      from part, supplier, lineitem, partsupp, orders      where s_suppkey = l_suppkey          and ps_suppkey = l_suppkey          and ps_partkey = l_partkey          and p_partkey = l_partkey          and o_orderkey = l_orderkey          and p_brand = 'branda') as profit  group by s_name, o_year  order by s_name, o_year desc  limit 1;
select p.p_partkey, p.p_name, p.p_mfgr, p.p_brand, p.p_type, p.p_size, p.p_container, p.p_retailprice, p.p_comment from part p join partsupp ps on p.p_partkey = ps.ps_partkey join supplier s on ps.ps_suppkey = s.s_suppkey join lineitem l on l.l_partkey = p.p_partkey and l.l_suppkey = s.s_suppkey join orders o on o.o_orderkey = l.l_orderkey join customer c on c.c_custkey = o.o_custkey where c.c_mktsegment = 'building'  and o.o_orderdate < '1995-03-15'  and l.l_shipdate > '1995-03-15' order by (l.l_extendedprice * (1 - l.l_discount)) desc, o.o_orderdate limit 10;
select s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment  from part  join partsupp on part.p_partkey = partsupp.ps_partkey  join supplier on partsupp.ps_suppkey = supplier.s_suppkey  join nation on supplier.s_nationkey = nation.n_nationkey  join region on nation.n_regionkey = region.r_regionkey  where p_size = 15  and p_type like '%brass'  and r_name = 'asia'  and ps_supplycost = (  select min(ps_supplycost)  from partsupp  join supplier on partsupp.ps_suppkey = supplier.s_suppkey  join nation on supplier.s_nationkey = nation.n_nationkey  join region on nation.n_regionkey = region.r_regionkey  where p_partkey = partsupp.ps_partkey  and r_name = 'asia' )  order by s_acctbal desc, n_name, s_name, p_partkey limit 100;
select p_brand, count(*) as brand_count from part, supplier, partsupp  where part.p_partkey = partsupp.ps_partkey  and supplier.s_suppkey = partsupp.ps_suppkey  and supplier.s_nationkey = 2 and partsupp.ps_availqty > 100  group by p_brand order by brand_count desc limit 1;
select p_name, sum(ps_supplycost * ps_availqty) as cost from part, supplier, partsupp where part.p_partkey = partsupp.ps_partkey and supplier.s_suppkey = partsupp.ps_suppkey and p_type = 'economy anodized steel' and p_size = 20 and s_acctbal > 10000 group by p_name order by cost desc limit 1;
select sum(p_retailprice * ps_supplycost) as cost from part join partsupp on part.p_partkey = partsupp.ps_partkey join supplier on partsupp.ps_suppkey = supplier.s_suppkey where p_type = 'economy' and supplier.s_nationkey = 1 and partsupp.ps_availqty > 10 limit 1;
select s_name, c_name, extract(year from l_shipdate) as l_year, sum(l_extendedprice * (1 - l_discount)) as revenue from supplier, lineitem, orders, customer, nation n1, nation n2 where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey and ((n1.n_name = 'china' and n2.n_name = 'japan') or (n1.n_name = 'japan' and n2.n_name = 'china')) and l_shipdate between date '1997-01-01' and date '1998-12-31' group by s_name, c_name, l_year order by s_name, c_name, l_year limit 1;
select o_year, count(distinct p_partkey) as unique_parts, count(distinct s_suppkey) as unique_suppliers, count(distinct o_orderkey) as unique_orders  from (     select extract(year from o_orderdate) as o_year, p.p_partkey, s.s_suppkey, o.o_orderkey      from partsupp ps      inner join part p on ps.ps_partkey = p.p_partkey      inner join supplier s on ps.ps_suppkey = s.s_suppkey      inner join lineitem l on ps.ps_partkey = l.l_partkey and ps.ps_suppkey = l.l_suppkey      inner join orders o on l.l_orderkey = o.o_orderkey      inner join customer c on o.o_custkey = c.c_custkey      inner join nation n on c.c_nationkey = n.n_nationkey      inner join region r on n.n_regionkey = r.r_regionkey      where p.p_type = 'economy anodized steel'      and r.r_name = 'america'      and n.n_name = 'brazil'      and o.o_orderdate between date '1995-01-01' and date '1996-12-31'  ) as all_data  group by o_year  order by o_year  limit 1;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment  from customer, orders, lineitem, nation, partsupp, supplier, part  where c_custkey = o_custkey  and l_orderkey = o_orderkey  and o_orderdate >= '1993-10-01'  and o_orderdate < '1994-01-01'  and l_returnflag = 'r'  and c_nationkey = n_nationkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_partkey = p_partkey  and ps_suppkey = s_suppkey  and p_brand = 'abc'  and p_type = 'xyz'  and p_size = 10  and s_nationkey = 1  and s_acctbal > 10000  and n_regionkey = 1  group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment  order by revenue desc  limit 20;

select o_custkey, count(o_orderkey) as order_count  from orders, customer, lineitem  where o_custkey = c_custkey  and o_orderkey = l_orderkey  and c_mktsegment = 'automobile'  and l_shipdate >= '2021-01-01'  and l_shipdate <= '2021-12-31'  group by o_custkey  having count(o_orderkey) > 10  order by order_count desc  limit 1;
select c_custkey, sum(case when p_type = 'economy' then 1 else 0 end) as economy_part_count, sum(case when p_type <> 'economy' then 1 else 0 end) as premium_part_count  from customer, orders, lineitem, part, partsupp  where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = p_partkey  and p_partkey = ps_partkey  and ps_availqty > 100  and ps_supplycost < 500  and p_retailprice > 1000  and p_size > 20  and l_extendedprice > 10000  and l_discount < 0.1  and c_mktsegment = 'automobile'  group by c_custkey  order by c_custkey  limit 1;
select 100.00 * sum(case when p_type like 'non-promo%' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as non_promo_revenue  from lineitem, part, orders, customer  where l_partkey = p_partkey  and l_orderkey = o_orderkey  and o_custkey = c_custkey  and c_mktsegment = 'automobile'  and o_orderdate >= date '1995-01-01'  and o_orderdate < date '1995-01-01' + interval '1' month  and p_size >= 30  and p_size <= 40  and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg')  and p_brand = 'brand x'  and o_orderstatus = 'f'  and c_nationkey = 1  and o_orderpriority in ('1-urgent', '2-high', '3-medium')  limit 1;
select c_custkey, c_name, c_address, c_phone, o_orderkey, o_orderstatus, o_totalprice, o_orderdate, o_orderpriority, o_clerk, o_shippriority, l_partkey, l_suppkey, l_linenumber, l_quantity, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus, l_shipdate, l_commitdate, l_receiptdate, l_shipinstruct, l_shipmode from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey join supplier on ps_suppkey = s_suppkey join part on ps_partkey = p_partkey where c_custkey = 1 and o_orderstatus = 'f' and p_size = 20 and s_name = 'supplier a' order by o_orderdate desc, l_quantity asc;
select sum(l_extendedprice) / 7.0 as avg_yearly  from lineitem, part, orders, customer  where l_partkey = p_partkey  and l_orderkey = o_orderkey  and o_custkey = c_custkey  and p_brand = 'brand#23'  and p_container = 'med box'  and l_quantity < (      select 0.2 * avg(l_quantity)      from lineitem      where l_partkey = p_partkey  )  and o_orderstatus = 'f'  and c_mktsegment = 'automobile'  and c_acctbal > 5000  and l_shipdate > '1995-01-01'  group by c_custkey  order by avg_yearly desc  limit 1;
select c_name, c_address  from customer, orders, lineitem, part  where c_custkey = o_custkey    and o_orderkey = l_orderkey    and l_partkey = p_partkey    and p_name like 'forest%'    and o_orderdate >= date '1994-01-01'    and o_orderdate < date '1995-01-01'    and c_mktsegment = 'automobile'  order by c_name  limit 1;
select      p_type,      count(distinct l_orderkey) as numorders,     sum(l_extendedprice) as totprice  from      lineitem      join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey      join orders on l_orderkey = o_orderkey      join customer on o_custkey = c_custkey      join supplier on ps_suppkey = s_suppkey      join part on ps_partkey = p_partkey  where      p_type in ('type1', 'type2', 'type3')      and c_mktsegment in ('segment1', 'segment2', 'segment3')      and s_address like '%city1%'      and o_orderstatus = 'shipped'      and l_returnflag = 'n'  group by      p_type  order by      totprice desc  limit 1;

select 100.00 * sum(case when s_suppkey = 100 then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as custom_revenue  from lineitem, partsupp, supplier  where l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and l_shipdate >= date '1995-09-01'  and l_shipdate < date '1995-09-01' + interval '1' month  and s_name like '%abc%'  and s_address like '%xyz%'  and s_phone like '%123%'  and ps_availqty >= 10  and ps_supplycost <= 50  and s_acctbal > 1000  and l_quantity <= 100  and l_discount >= 0.1  and l_tax <= 0.05  and l_linestatus = 'f'  and l_returnflag = 'r'  limit 1;
select p.p_partkey, p.p_name, p.p_mfgr, p.p_brand, p.p_type, p.p_size, p.p_container, p.p_retailprice, p.p_comment from part p inner join partsupp ps on p.p_partkey = ps.ps_partkey inner join supplier s on ps.ps_suppkey = s.s_suppkey inner join lineitem l on ps.ps_partkey = l.l_partkey and ps.ps_suppkey = l.l_suppkey inner join orders o on l.l_orderkey = o.o_orderkey inner join customer c on o.o_custkey = c.c_custkey where c.c_mktsegment = '家具' and s.s_name = '供货商a' order by p.p_partkey;
select p_brand, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt  from partsupp, part, supplier  where p_partkey = ps_partkey  and ps_suppkey = s_suppkey  and p_brand <> 'brand#45'  and p_type not like 'medium polished%'  and p_size in (49, 14, 23, 45, 19, 3, 36, 9)  and ps_suppkey not in (select s_suppkey from supplier where s_comment like '%customer%complaints%')  and ps_suppkey in (select ps_suppkey from partsupp where ps_availqty > 0)  and ps_partkey in (select l_partkey from lineitem where l_orderkey in (select o_orderkey from orders where o_orderstatus = 'f'))  group by p_brand, p_type, p_size  order by supplier_cnt desc, p_brand, p_type, p_size  limit 1;
select p_name, p_partkey, ps_suppkey, ps_availqty, ps_supplycost from part, supplier, partsupp where p_partkey = ps_partkey and ps_suppkey = s_suppkey and p_name like '%a%' and s_name like '%b%' and ps_availqty > 100 order by ps_supplycost desc limit 100;
select p_name, p_brand, p_type, p_size, p_container, p_retailprice, s_name, s_address, s_phone, s_acctbal, o_orderstatus, o_totalprice, o_orderdate, o_orderpriority, o_shippriority from part, supplier, partsupp, customer, orders, lineitem, nation, region where p_partkey = ps_partkey and ps_suppkey = s_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and c_custkey = o_custkey and o_orderkey = l_orderkey and l_partkey = p_partkey and l_suppkey = ps_suppkey and o_orderstatus = 'f' and l_receiptdate > l_commitdate and exists (select * from lineitem l2 where l2.l_orderkey = l_orderkey and l2.l_suppkey <> l_suppkey) and not exists (select * from lineitem l3 where l3.l_orderkey = l_orderkey and l3.l_suppkey <> l_suppkey and l3.l_receiptdate > l3.l_commitdate) and r_name = 'asia' limit 100;
select s_name, count(*) as num_orders, sum(ps_supplycost) as total_cost  from supplier  join partsupp on supplier.s_suppkey = partsupp.ps_suppkey  join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey  join orders on lineitem.l_orderkey = orders.o_orderkey  where supplier.s_nationkey = (select n_nationkey from nation where n_name = 'china')  and lineitem.l_shipdate >= '2022-01-01' and lineitem.l_shipdate <= '2022-12-31'  and orders.o_orderstatus = 'f'  and orders.o_totalprice > 10000  group by s_name  order by total_cost desc  limit 1;

select p_name, count(*) as num from part, supplier, partsupp, lineitem, orders, customer where p_partkey = partsupp.ps_partkey and partsupp.ps_suppkey = supplier.s_suppkey and lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey and lineitem.l_orderkey = orders.o_orderkey and orders.o_custkey = customer.c_custkey and p_retailprice > 1000 and p_type = 'electronics' and s_name = 'abc supplier' and c_mktsegment = 'automobile' and l_shipdate > '2022-01-01' and l_commitdate < '2022-06-30' group by p_name order by num desc, p_name limit 100;
select s_name, count(*) as num_parts, sum(p_retailprice) as total_retail_price  from supplier  join partsupp on supplier.s_suppkey = partsupp.ps_suppkey join part on partsupp.ps_partkey = part.p_partkey where s_nationkey in (1, 2, 3, 4, 5, 6, 7, 8)  and p_type = 'type a'  and p_size > 50  and p_retailprice > (select avg(p_retailprice) from part where p_retailprice > 0.00 and p_type = 'type a' and p_size > 50)  and not exists (select * from lineitem where l_partkey = part.p_partkey) group by s_name order by num_parts desc limit 1;
select c_custkey, c_name, sum(o_totalprice) as sum_total_price, avg(o_totalprice) as avg_total_price, count(*) as count_order  from customer  join orders on customer.c_custkey = orders.o_custkey  where c_mktsegment = 'automobile' and o_orderdate <= date '2022-01-01'  group by c_custkey, c_name  order by sum_total_price desc  limit 1;
select c_custkey, c_name, c_address, c_phone, c_acctbal, n_name, r_name from customer, nation, region where c_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and c_custkey in (select o_custkey from orders where o_totalprice >= 1000) and c_custkey in (select l_orderkey from lineitem where l_quantity >= 10) and c_custkey in (select l_suppkey from lineitem where l_discount <= 0.05) and c_custkey in (select ps_suppkey from partsupp where ps_supplycost <= 50) order by c_acctbal desc, n_name, c_name limit 100;
select c_name, sum(o_totalprice) as total_sales from customer c join nation n on c.c_nationkey = n.n_nationkey join region r on n.n_regionkey = r.r_regionkey join orders o on c.c_custkey = o.o_custkey join lineitem l on o.o_orderkey = l.l_orderkey join partsupp ps on l.l_partkey = ps.ps_partkey and l.l_suppkey = ps.ps_suppkey join supplier s on ps.ps_suppkey = s.s_suppkey where r.r_name = 'asia' and c.c_mktsegment = 'automobile' and s.s_nationkey = 10 group by c_name order by total_sales desc limit 1;
select n_name, count(distinct s_suppkey) as supplier_count from customer c  join orders o on c.c_custkey = o.o_custkey join lineitem l on o.o_orderkey = l.l_orderkey join supplier s on l.l_suppkey = s.s_suppkey join nation n on c.c_nationkey = n.n_nationkey join region r on n.n_regionkey = r.r_regionkey where r.r_name = 'asia'  and o.o_orderdate >= date '1994-01-01'  and o.o_orderdate < date '1995-01-01' group by n_name order by supplier_count desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  inner join orders on lineitem.l_orderkey = orders.o_orderkey  inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey  inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey  inner join customer on orders.o_custkey = customer.c_custkey  inner join nation on customer.c_nationkey = nation.n_nationkey  inner join region on nation.n_regionkey = region.r_regionkey  where lineitem.l_shipdate >= date '1994-01-01'  and lineitem.l_shipdate < date '1994-01-01' + interval '1' year  and lineitem.l_discount between .06 - 0.01 and .06 + 0.01  and lineitem.l_quantity < 24  and customer.c_mktsegment = 'segment1'  and supplier.s_name = 'supplier1'  and region.r_name = 'region1'  limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from (     select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume      from supplier, lineitem, orders, customer, nation n1, nation n2      where s_suppkey = l_suppkey      and o_orderkey = l_orderkey      and c_custkey = o_custkey      and s_nationkey = n1.n_nationkey      and c_nationkey = n2.n_nationkey      and ((n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france'))      and l_shipdate between date '1995-01-01' and date '1996-12-31'  ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select o_year,         sum(case when nation = 'france' then volume else 0 end) / sum(volume) as mkt_share  from (select extract(year from o_orderdate) as o_year,               l_extendedprice * (1 - l_discount) as volume,               n2.n_name as nation        from part, supplier, lineitem, orders, customer, nation n1, nation n2, region        where p_partkey = l_partkey          and s_suppkey = l_suppkey          and l_orderkey = o_orderkey          and o_custkey = c_custkey          and c_nationkey = n1.n_nationkey          and n1.n_regionkey = r_regionkey          and r_name = 'europe'          and s_nationkey = n2.n_nationkey          and o_orderdate between date '1996-01-01' and date '1997-12-31'          and p_type = 'stainless steel' ) as all_nations  group by o_year  order by o_year  limit 1;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment  from customer  join orders on c_custkey = o_custkey join lineitem on l_orderkey = o_orderkey join partsupp on ps_partkey = l_partkey and ps_suppkey = l_suppkey join supplier on s_suppkey = ps_suppkey join nation on n_nationkey = c_nationkey join region on r_regionkey = n_regionkey where o_orderdate >= date '1994-01-01' and o_orderdate < date '1994-04-01' and l_returnflag = 'r' and s_nationkey = n_nationkey and r_regionkey = 1 group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment order by revenue desc limit 20;

select p.p_partkey, sum(p.p_retailprice * ps.ps_availqty) as value  from part p, partsupp ps, supplier s, nation n  where p.p_partkey = ps.ps_partkey  and ps.ps_suppkey = s.s_suppkey  and s.s_nationkey = n.n_nationkey  and n.n_name = 'france'  and p.p_type = 'electronic'  and p.p_size = 10  and s.s_acctbal > 10000  and ps.ps_supplycost < 100  group by p.p_partkey  having sum(p.p_retailprice * ps.ps_availqty) > (      select sum(p.p_retailprice * ps.ps_availqty) * 0.0001000000      from part p, partsupp ps, supplier s, nation n      where p.p_partkey = ps.ps_partkey      and ps.ps_suppkey = s.s_suppkey      and s.s_nationkey = n.n_nationkey      and n.n_name = 'france'      and p.p_type = 'electronic'      and p.p_size = 10      and s.s_acctbal > 10000      and ps.ps_supplycost < 100  )  order by value desc  limit 1;
select p_type, sum(case when p_retailprice > 100 then 1 else 0 end) as expensive_part_count, sum(case when p_retailprice <= 100 then 1 else 0 end) as cheap_part_count  from part, partsupp, supplier  where part.p_partkey = partsupp.ps_partkey  and partsupp.ps_suppkey = supplier.s_suppkey  and supplier.s_name = 'abc supplier'  and part.p_type in ('type a', 'type b')  and partsupp.ps_availqty > 10  and supplier.s_acctbal > 10000  group by p_type  order by p_type  limit 1;
select p_name, s_name, ps_availqty, l_extendedprice from part p join partsupp ps on p.p_partkey = ps.ps_partkey join supplier s on ps.ps_suppkey = s.s_suppkey join lineitem l on ps.ps_partkey = l.l_partkey and ps.ps_suppkey = l.l_suppkey where p.p_type = 'typea' and s.s_name = 'suppliera' order by l_extendedprice desc limit 10;
select 100.00 * sum(case when p_type like 'electronic%' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as electronic_revenue from lineitem, part, partsupp, supplier where l_partkey = p_partkey 	and l_suppkey = ps_suppkey 	and p_partkey = ps_partkey 	and ps_availqty > 0 	and s_acctbal > 10000 	and l_shipdate >= date '1995-09-01' 	and l_shipdate < date '1995-09-01' + interval '1' month limit 1;
select p.p_partkey, p.p_name, p.p_mfgr, p.p_brand, p.p_type, p.p_size, p.p_container, p.p_retailprice, p.p_comment from part p inner join partsupp ps on p.p_partkey = ps.ps_partkey inner join supplier s on ps.ps_suppkey = s.s_suppkey inner join lineitem l on ps.ps_partkey = l.l_partkey and ps.ps_suppkey = l.l_suppkey inner join orders o on l.l_orderkey = o.o_orderkey inner join customer c on o.o_custkey = c.c_custkey where c.c_custkey = 1 and o.o_orderstatus = 'f' and p.p_brand = 'brand1' and s.s_name = 'supplier1' and l.l_shipdate >= '1996-01-01'  and l.l_shipdate < '1996-04-01';
select p_brand, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt  from partsupp, part, supplier  where p_partkey = ps_partkey  and ps_suppkey = s_suppkey  and p_brand <> 'brand#45'  and p_type not like 'medium polished%'  and p_size in (49, 14, 23, 45, 19, 3, 36, 9)  and ps_suppkey not in (      select s_suppkey      from supplier      where s_comment like '%customer%complaints%'  )  group by p_brand, p_type, p_size  order by supplier_cnt desc, p_brand, p_type, p_size  limit 1;
select sum(ps_availqty) / 10.0 as avg_stock  from partsupp  join part on part.p_partkey = partsupp.ps_partkey  join supplier on supplier.s_suppkey = partsupp.ps_suppkey  where p_brand = 'brand#23'  and p_container = 'med box'  and ps_supplycost < (select 0.2 * avg(ps_supplycost)                       from partsupp                       where ps_partkey = part.p_partkey)  limit 1;
select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, partsupp, supplier, part  where (ps_partkey = l_partkey and ps_suppkey = l_suppkey and s_suppkey = ps_suppkey and p_partkey = ps_partkey  and p_brand = 'brand#12' and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg') and l_quantity >= 1 and l_quantity <= 1 + 10  and p_size between 1 and 5 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person')  or (ps_partkey = l_partkey and ps_suppkey = l_suppkey and s_suppkey = ps_suppkey and p_partkey = ps_partkey  and p_brand = 'brand#23' and p_container in ('med bag', 'med box', 'med pkg', 'med pack') and l_quantity >= 10 and l_quantity <= 10 + 10  and p_size between 1 and 10 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person')  or (ps_partkey = l_partkey and ps_suppkey = l_suppkey and s_suppkey = ps_suppkey and p_partkey = ps_partkey  and p_brand = 'brand#34' and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg') and l_quantity >= 20 and l_quantity <= 20 + 10  and p_size between 1 and 15 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person')  limit 1;

select c_custkey, sum(o_totalprice) as value  from customer, orders, lineitem, partsupp, supplier, nation  where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey  and s_nationkey = n_nationkey  and n_name = 'china'  group by c_custkey  having sum(o_totalprice) > (   select sum(o_totalprice) * 0.0001000000    from customer, orders, lineitem, partsupp, supplier, nation    where c_custkey = o_custkey    and o_orderkey = l_orderkey    and l_partkey = ps_partkey    and l_suppkey = ps_suppkey    and ps_suppkey = s_suppkey    and s_nationkey = n_nationkey    and n_name = 'china' )  order by value desc  limit 1;
select      l_shipmode,     count(case when o_orderpriority = '1-urgent' or o_orderpriority = '2-high' then 1 else null end) as high_line_count,     count(case when o_orderpriority <> '1-urgent' and o_orderpriority <> '2-high' then 1 else null end) as low_line_count from     orders inner join     lineitem on orders.o_orderkey = lineitem.l_orderkey inner join     partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join     supplier on partsupp.ps_suppkey = supplier.s_suppkey inner join     customer on orders.o_custkey = customer.c_custkey inner join     nation on customer.c_nationkey = nation.n_nationkey inner join     region on nation.n_regionkey = region.r_regionkey where     l_shipmode in ('mail', 'ship')     and l_commitdate < l_receiptdate     and l_shipdate < l_commitdate     and l_receiptdate >= '1994-01-01'     and l_receiptdate < '1995-01-01' group by     l_shipmode order by     l_shipmode limit 1;
select n_name, count(*) as custdist from nation join region on n_regionkey = r_regionkey join customer on c_nationkey = n_nationkey left join orders on c_custkey = o_custkey and o_comment not like '%special%requests%' where n_name <> 'china' group by n_name order by custdist desc limit 1;
select 100.00 * sum(case when c_mktsegment = 'automobile' and o_orderdate >= date '1995-07-01' and o_orderdate < date '1995-07-01' + interval '1' month then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as automobile_revenue  from lineitem  join orders on l_orderkey = o_orderkey  join customer on o_custkey = c_custkey  where l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month  and c_mktsegment = 'automobile'  limit 1;
select distinct c_custkey, c_name, c_address, c_phone, c_acctbal, c_mktsegment  from customer, nation, region, orders, partsupp, supplier, lineitem  where c_custkey = o_custkey  and c_nationkey = n_nationkey  and n_regionkey = r_regionkey  and l_orderkey = o_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey  and s_nationkey = n_nationkey  and l_shipdate >= date '1996-01-01'  and l_shipdate < date '1996-01-01' + interval '3' month  and c_mktsegment = 'automobile'  and r_name = 'asia' and l_returnflag = 'n' and l_linestatus = 'o' and l_discount < 0.05 and l_tax > 0.05 and l_shipmode in ('air', 'ship') and l_quantity > 100 and ps_supplycost < 100 order by c_custkey;
select c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity) from customer join orders on c_custkey = o_custkey join lineitem on o_orderkey = l_orderkey where o_orderkey in (     select l_orderkey     from lineitem     join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey     join supplier on ps_suppkey = s_suppkey     join nation on s_nationkey = n_nationkey     join region on n_regionkey = r_regionkey     where r_name = 'asia'     and c_custkey in (         select c_custkey         from customer         join nation on c_nationkey = n_nationkey         join region on n_regionkey = r_regionkey         where r_name = 'europe'     ) ) group by c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice order by o_totalprice desc, o_orderdate limit 100;
select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, part, partsupp, orders, supplier, customer, nation, region  where p_partkey = l_partkey  and ps_partkey = p_partkey  and ps_suppkey = l_suppkey  and l_orderkey = o_orderkey  and o_custkey = c_custkey  and c_nationkey = n_nationkey  and n_regionkey = r_regionkey  and p_brand = 'brand#12'  and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg')  and l_quantity >= 1  and l_quantity <= 11  and p_size between 1 and 5  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'deliver in person'  and (     (p_brand = 'brand#23' and p_container in ('med bag', 'med box', 'med pkg', 'med pack') and l_quantity >= 10 and l_quantity <= 20 and p_size between 1 and 10 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person')      or      (p_brand = 'brand#34' and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg') and l_quantity >= 20 and l_quantity <= 30 and p_size between 1 and 15 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person') )  limit 1;
select c_name, c_address from customer, nation, region where c_nationkey = n_nationkey and n_regionkey = r_regionkey and c_custkey in ( select o_custkey from orders where o_orderkey in ( select l_orderkey from lineitem where l_partkey in ( select ps_partkey from partsupp where ps_suppkey in ( select s_suppkey from supplier where s_nationkey = n_nationkey and s_address like '%street%' ) ) and l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year ) ) and r_name = 'asia' order by c_name limit 1;

select o_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderdate < date '1994-01-01' and l_shipdate > date '1994-01-01' group by o_orderkey, o_orderdate, o_shippriority order by revenue desc, o_orderdate limit 10;
select c_custkey, count(o_orderkey) as order_count, sum(o_totalprice) as total_price  from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey  join supplier on ps_suppkey = s_suppkey  where c_mktsegment = 'household'  and l_shipdate < l_commitdate  and l_receiptdate >= date '1995-01-01'  and l_receiptdate < date '1995-01-01' + interval '1' year  group by c_custkey  order by total_price desc  limit 1;
select n_name, count(*) as order_count from nation join region on n_regionkey = r_regionkey join customer on c_nationkey = n_nationkey join orders on c_custkey = o_custkey join lineitem on o_orderkey = l_orderkey join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey join supplier on ps_suppkey = s_suppkey where r_name = 'asia' and c_mktsegment = 'automobile' and s_name = 'supplier x' group by n_name order by order_count desc limit 1;
select 100.00 * sum(case when c_mktsegment = 'building' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as building_revenue  from lineitem  join orders on l_orderkey = o_orderkey join customer on o_custkey = c_custkey  join nation on c_nationkey = n_nationkey  join region on n_regionkey = r_regionkey  join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey  join supplier on ps_suppkey = s_suppkey  join part on p_partkey = ps_partkey  where l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month  group by c_mktsegment  order by sum(l_extendedprice * (1 - l_discount)) desc  limit 1;
select l_suppkey, sum(l_extendedprice * (1 - l_discount)) as total_revenue from lineitem where l_shipdate >= date '1996-01-01' and l_shipdate < date '1996-01-01' + interval '3' month group by l_suppkey;
select c_name, c_mktsegment, count(distinct o_orderkey) as order_cnt  from customer, orders  where c_custkey = o_custkey  and c_mktsegment <> 'automobile'  and o_orderdate >= '1996-01-01'  and o_orderdate < '1997-01-01'  and o_orderkey not in (      select l_orderkey from lineitem      where l_returnflag = 'r'      and l_shipmode = 'mail'  )  group by c_name, c_mktsegment  order by order_cnt desc, c_name, c_mktsegment  limit 1;
select c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity)  from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  where o_orderkey in (     select l_orderkey      from lineitem      group by l_orderkey      having sum(l_quantity) > 300 )  and c_nationkey in (     select n_nationkey      from nation      join region on n_regionkey = r_regionkey      where r_name = 'asia' )  and l_suppkey in (     select ps_suppkey      from partsupp      join supplier on ps_suppkey = s_suppkey      where s_name = 'supplier x' )  group by c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice  order by o_totalprice desc, o_orderdate  limit 100;

select p_name, count(*) as num from part, supplier, partsupp, lineitem, orders, customer where p_partkey = partsupp.ps_partkey and partsupp.ps_suppkey = supplier.s_suppkey and lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey and lineitem.l_orderkey = orders.o_orderkey and orders.o_custkey = customer.c_custkey and p_retailprice > 1000 and p_type = 'electronics' and s_name = 'abc supplier' and c_mktsegment = 'automobile' and l_shipdate > '2022-01-01' and l_commitdate < '2022-06-30' group by p_name order by num desc, p_name limit 100;
select s_name, count(*) as num_parts, sum(p_retailprice) as total_retail_price  from supplier  join partsupp on supplier.s_suppkey = partsupp.ps_suppkey join part on partsupp.ps_partkey = part.p_partkey where s_nationkey in (1, 2, 3, 4, 5, 6, 7, 8)  and p_type = 'type a'  and p_size > 50  and p_retailprice > (select avg(p_retailprice) from part where p_retailprice > 0.00 and p_type = 'type a' and p_size > 50)  and not exists (select * from lineitem where l_partkey = part.p_partkey) group by s_name order by num_parts desc limit 1;
select c_custkey, c_name, sum(o_totalprice) as sum_total_price, avg(o_totalprice) as avg_total_price, count(*) as count_order  from customer  join orders on customer.c_custkey = orders.o_custkey  where c_mktsegment = 'automobile' and o_orderdate <= date '2022-01-01'  group by c_custkey, c_name  order by sum_total_price desc  limit 1;
select c_custkey, c_name, c_address, c_phone, c_acctbal, n_name, r_name from customer, nation, region where c_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and c_custkey in (select o_custkey from orders where o_totalprice >= 1000) and c_custkey in (select l_orderkey from lineitem where l_quantity >= 10) and c_custkey in (select l_suppkey from lineitem where l_discount <= 0.05) and c_custkey in (select ps_suppkey from partsupp where ps_supplycost <= 50) order by c_acctbal desc, n_name, c_name limit 100;
select c_name, sum(o_totalprice) as total_sales from customer c join nation n on c.c_nationkey = n.n_nationkey join region r on n.n_regionkey = r.r_regionkey join orders o on c.c_custkey = o.o_custkey join lineitem l on o.o_orderkey = l.l_orderkey join partsupp ps on l.l_partkey = ps.ps_partkey and l.l_suppkey = ps.ps_suppkey join supplier s on ps.ps_suppkey = s.s_suppkey where r.r_name = 'asia' and c.c_mktsegment = 'automobile' and s.s_nationkey = 10 group by c_name order by total_sales desc limit 1;
select n_name, count(distinct s_suppkey) as supplier_count from customer c  join orders o on c.c_custkey = o.o_custkey join lineitem l on o.o_orderkey = l.l_orderkey join supplier s on l.l_suppkey = s.s_suppkey join nation n on c.c_nationkey = n.n_nationkey join region r on n.n_regionkey = r.r_regionkey where r.r_name = 'asia'  and o.o_orderdate >= date '1994-01-01'  and o.o_orderdate < date '1995-01-01' group by n_name order by supplier_count desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  inner join orders on lineitem.l_orderkey = orders.o_orderkey  inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey  inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey  inner join customer on orders.o_custkey = customer.c_custkey  inner join nation on customer.c_nationkey = nation.n_nationkey  inner join region on nation.n_regionkey = region.r_regionkey  where lineitem.l_shipdate >= date '1994-01-01'  and lineitem.l_shipdate < date '1994-01-01' + interval '1' year  and lineitem.l_discount between .06 - 0.01 and .06 + 0.01  and lineitem.l_quantity < 24  and customer.c_mktsegment = 'segment1'  and supplier.s_name = 'supplier1'  and region.r_name = 'region1'  limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from (     select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume      from supplier, lineitem, orders, customer, nation n1, nation n2      where s_suppkey = l_suppkey      and o_orderkey = l_orderkey      and c_custkey = o_custkey      and s_nationkey = n1.n_nationkey      and c_nationkey = n2.n_nationkey      and ((n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france'))      and l_shipdate between date '1995-01-01' and date '1996-12-31'  ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select o_year,         sum(case when nation = 'france' then volume else 0 end) / sum(volume) as mkt_share  from (select extract(year from o_orderdate) as o_year,               l_extendedprice * (1 - l_discount) as volume,               n2.n_name as nation        from part, supplier, lineitem, orders, customer, nation n1, nation n2, region        where p_partkey = l_partkey          and s_suppkey = l_suppkey          and l_orderkey = o_orderkey          and o_custkey = c_custkey          and c_nationkey = n1.n_nationkey          and n1.n_regionkey = r_regionkey          and r_name = 'europe'          and s_nationkey = n2.n_nationkey          and o_orderdate between date '1996-01-01' and date '1997-12-31'          and p_type = 'stainless steel' ) as all_nations  group by o_year  order by o_year  limit 1;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment  from customer  join orders on c_custkey = o_custkey join lineitem on l_orderkey = o_orderkey join partsupp on ps_partkey = l_partkey and ps_suppkey = l_suppkey join supplier on s_suppkey = ps_suppkey join nation on n_nationkey = c_nationkey join region on r_regionkey = n_regionkey where o_orderdate >= date '1994-01-01' and o_orderdate < date '1994-04-01' and l_returnflag = 'r' and s_nationkey = n_nationkey and r_regionkey = 1 group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment order by revenue desc limit 20;

select p_brand, p_type, sum(p_retailprice) as total_retail_price, avg(p_retailprice) as avg_retail_price, count(*) as count_part  from part  where p_size >= 10 and p_size <= 20 and p_container = 'sm case'  group by p_brand, p_type  order by p_brand, p_type  limit 1;
select c_name, o_orderdate, sum(o_totalprice) as sum_price  from customer, orders  where c_custkey = o_custkey  and c_name like '%张%'  group by c_name, o_orderdate  order by o_orderdate desc  limit 1;
select c_name, o_orderstatus, o_totalprice, l_extendedprice, l_discount, l_tax from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderstatus = 'f' and l_discount > 0.05 and l_tax < 0.05 order by c_name, o_orderstatus, o_totalprice desc, l_extendedprice desc limit 100;
select s_name, count(*) as supplier_count from supplier  where s_suppkey >= 100 and s_suppkey <= 200  and exists (select * from partsupp where ps_suppkey = s_suppkey and ps_availqty > 0)  group by s_name  order by s_name limit 1;
select sum(ps_supplycost * l_quantity) as cost from partsupp inner join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey inner join orders on lineitem.l_orderkey = orders.o_orderkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey where orders.o_orderdate >= date '1995-01-01' and orders.o_orderdate < date '1995-01-01' + interval '1' year and supplier.s_name = 'abc supplier' and supplier.s_address = '123 main st' and orders.o_orderstatus = 'shipped' and orders.o_totalprice > 1000 and partsupp.ps_availqty > 10 and partsupp.ps_supplycost < 50 limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue from ( select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume from supplier, lineitem, orders, customer, nation n1, nation n2 where s_suppkey = l_suppkey and o_orderkey = l_orderkey and c_custkey = o_custkey and s_nationkey = n1.n_nationkey and c_nationkey = n2.n_nationkey and ( (n1.n_name = 'italy' and n2.n_name = 'spain') or (n1.n_name = 'spain' and n2.n_name = 'italy') ) and l_shipdate between date '1997-01-01' and date '1998-12-31' ) as shipping group by supp_nation, cust_nation, l_year order by supp_nation, cust_nation, l_year limit 1;

select s_name, s_address, sum(ps_availqty) as total_avail_qty, sum(ps_supplycost) as total_supply_cost, count(*) as count_supp from supplier join partsupp on supplier.s_suppkey = partsupp.ps_suppkey join lineitem on partsupp.ps_partkey = lineitem.l_partkey and partsupp.ps_suppkey = lineitem.l_suppkey where supplier.s_name = 'abc supplier' and partsupp.ps_availqty > 100 and lineitem.l_shipdate <= date '1998-12-01' group by s_name, s_address order by total_avail_qty desc limit 1;
select c_name, c_mktsegment, o_orderdate, sum(o_totalprice) as sum_revenue from customer, orders where c_custkey = o_custkey and c_mktsegment = 'building' and o_orderdate >= '2019-01-01' and o_orderdate <= '2019-12-31' group by c_name, c_mktsegment, o_orderdate order by sum_revenue desc limit 10;
select c_name, o_orderkey, o_orderstatus, o_totalprice, o_orderdate, o_orderpriority, o_clerk, o_shippriority, l_linenumber, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus, l_shipdate, l_commitdate, l_receiptdate, l_shipinstruct, l_shipmode, l_comment  from customer, orders, lineitem, partsupp, supplier  where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_supplycost = (select min(ps_supplycost)  from partsupp, supplier  where l_partkey = ps_partkey  and l_suppkey = ps_suppkey)  and c_name like '%customer%'  and o_orderstatus = 'f'  and o_totalprice > 1000  and o_orderdate < '2020-01-01'  and o_orderpriority = 'high'  and o_clerk = 'sales'  and l_linenumber = 1  and l_discount < 0.1  and l_tax > 0.05  and l_returnflag = 'n'  and l_linestatus = 'shipped'  and l_shipdate >= '2020-01-01'  and l_commitdate <= '2020-12-31'  and l_receiptdate >= '2020-01-01'  and l_shipinstruct = 'air'  and l_shipmode = 'express'  and l_comment not like '%backorder%'  order by c_name, o_orderkey, l_linenumber  limit 100;
select p_brand, count(*) as part_count  from part  where p_size >= 10 and p_size <= 20  and p_container in ('wrap', 'box', 'bag')  and exists ( select * from partsupp where ps_partkey = p_partkey and ps_supplycost < 100  ) group by p_brand  order by part_count desc  limit 1;
select p_name, sum(l_extendedprice * (1 - l_discount)) as revenue from part, partsupp, lineitem, supplier, nation, region where p_partkey = ps_partkey and ps_partkey = l_partkey and ps_suppkey = l_suppkey and s_suppkey = ps_suppkey and s_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and l_shipdate >= date '1996-01-01' and l_shipdate < date '1996-01-01' + interval '1' year group by p_name order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join orders on lineitem.l_orderkey = orders.o_orderkey inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey inner join customer on orders.o_custkey = customer.c_custkey where l_shipdate >= date '1995-01-01' and l_shipdate < date '1995-01-01' + interval '1' year  and l_discount between .06 - 0.01 and .06 + 0.01  and l_quantity < 24  and supplier.s_name = 'supplier name'  and customer.c_name = 'customer name'  and orders.o_orderstatus = 'f'  and customer.c_mktsegment = 'segment'  and partsupp.ps_availqty > 10  limit 1;
select s.s_name as supp_name, c.c_name as cust_name, extract(year from l.l_shipdate) as ship_year, sum(l.l_extendedprice * (1 - l.l_discount)) as revenue  from supplier s, lineitem l, orders o, customer c, nation n1, nation n2  where s.s_suppkey = l.l_suppkey  and o.o_orderkey = l.l_orderkey  and c.c_custkey = o.o_custkey  and s.s_nationkey = n1.n_nationkey  and c.c_nationkey = n2.n_nationkey  and ((n1.n_name = 'canada' and n2.n_name = 'united states') or (n1.n_name = 'united states' and n2.n_name = 'canada'))  and l.l_shipdate between date '1997-01-01' and date '1997-12-31'  group by s.s_name, c.c_name, ship_year  order by s.s_name, c.c_name, ship_year  limit 1;

select c_name as customer_name, extract(year from o_orderdate) as order_year, sum(l_extendedprice * (1 - l_discount) - ps_supplycost * l_quantity) as total_profit from customer, orders, lineitem, partsupp, supplier where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey and c_name like '%smith%' group by c_name, order_year order by c_name, order_year desc limit 1;
select c_custkey, count(o_orderkey) as order_count, l_linenumber, l_quantity, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus, l_shipdate, l_commitdate, l_receiptdate, l_shipinstruct, l_shipmode, l_comment from customer, orders, lineitem where c_mktsegment = 'electronics'  and c_custkey = o_custkey  and l_orderkey = o_orderkey  and o_orderdate > date '1998-01-01'  and l_shipdate < date '1998-02-01'  group by c_custkey, l_linenumber, l_quantity, l_extendedprice, l_discount, l_tax, l_returnflag, l_linestatus, l_shipdate, l_commitdate, l_receiptdate, l_shipinstruct, l_shipmode, l_comment order by order_count desc, l_shipdate limit 10;
select c_custkey, count(*) as order_count from customer where c_mktsegment = 'building' and c_acctbal < 10000 and exists (     select *     from orders     where o_custkey = c_custkey     and o_orderdate >= date '1995-01-01'     and o_orderdate < date '1995-01-01' + interval '3' month     and exists (         select *         from lineitem         where l_orderkey = o_orderkey         and l_commitdate < l_receiptdate     ) ) group by c_custkey order by order_count desc limit 1;
select c_name, sum(l_extendedprice * (1 - l_discount)) as revenue from customer, orders, lineitem, partsupp, nation, region where c_custkey = o_custkey and l_orderkey = o_orderkey and l_partkey = ps_partkey and l_suppkey = ps_suppkey and c_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and o_orderdate >= date '1995-01-01' and o_orderdate < date '1995-01-01' + interval '1' year group by c_name order by revenue desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  where l_shipdate >= date '1995-01-01' and l_shipdate < date '1995-01-01' + interval '1' year  and l_discount between .05 - 0.01 and .05 + 0.01  and l_quantity < 20  and l_partkey in (select p_partkey from part where p_brand = 'brandx')  and l_suppkey in (select s_suppkey from supplier where s_nationkey = (select n_nationkey from nation where n_name = 'china'))  and l_orderkey in (select o_orderkey from orders where o_orderdate >= date '1995-01-01' and o_orderdate < date '1995-01-01' + interval '1' year and o_orderstatus = 'f')  limit 1;
select s.s_name as supp_name, c.c_name as cust_name, extract(year from l.l_shipdate) as l_year,      sum(l.l_extendedprice * (1 - l.l_discount)) as revenue  from supplier s, lineitem l, orders o, customer c, nation n1, nation n2  where s.s_suppkey = l.l_suppkey      and o.o_orderkey = l.l_orderkey      and c.c_custkey = o.o_custkey      and s.s_nationkey = n1.n_nationkey      and c.c_nationkey = n2.n_nationkey      and ( (n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france') )      and l.l_shipdate between date '1995-01-01' and date '1996-12-31'  group by supp_name, cust_name, l_year  order by supp_name, cust_name, l_year  limit 1;
select o_year, sum(case when nation = 'china' then volume else 0 end) / sum(volume) as mkt_share from (  select extract(year from o_orderdate) as o_year, l_extendedprice * (1 - l_discount) as volume, n2.n_name as nation  from part, supplier, lineitem, orders, customer, nation n1, nation n2, region  where p_partkey = l_partkey and s_suppkey = l_suppkey and l_orderkey = o_orderkey  and o_custkey = c_custkey and c_nationkey = n1.n_nationkey and n1.n_regionkey = r_regionkey  and r_name = 'asia' and s_nationkey = n2.n_nationkey  and o_orderdate between date '1997-01-01' and date '1998-12-31'  and p_type = 'large burnished copper' ) as all_nations  group by o_year order by o_year limit 1;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment  from customer, orders, lineitem, nation, supplier, partsupp  where c_custkey = o_custkey  and l_orderkey = o_orderkey  and o_orderdate >= date '1993-10-01'  and o_orderdate < date '1993-10-01' + interval '3' month  and l_returnflag = 'r'  and c_nationkey = n_nationkey  and l_suppkey = ps_suppkey  and l_partkey = ps_partkey  and s_suppkey = ps_suppkey  and l_shipdate >= date '1993-10-01'  and l_shipdate < date '1993-10-01' + interval '3' month  and l_shipmode = 'air'  and s_acctbal > 5000  group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment  order by revenue desc limit 20;
select c_custkey, c_name, c_mktsegment, sum(o_totalprice) as total_sales from customer, orders where c_custkey = o_custkey and c_mktsegment = 'automobile' and o_orderdate >= '2020-01-01' and o_orderdate <= '2020-12-31' and c_custkey in (     select o_custkey     from orders     where o_orderdate >= '2020-01-01'     and o_orderdate <= '2020-12-31'     group by o_custkey     having sum(o_totalprice) > (         select avg(total_sales)         from (             select c_custkey, sum(o_totalprice) as total_sales             from customer, orders             where c_custkey = o_custkey             and o_orderdate >= '2020-01-01'             and o_orderdate <= '2020-12-31'             group by c_custkey         ) as subquery     ) ) group by c_custkey, c_name, c_mktsegment order by total_sales desc limit 1;
select c_name, sum(case when l_shipmode = 'mail' or l_shipmode = 'ship' then 1 else 0 end) as ship_line_count, sum(case when l_shipmode <> 'mail' and l_shipmode <> 'ship' then 1 else 0 end) as other_line_count from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and l_commitdate < l_receiptdate and l_shipdate < l_commitdate and l_receiptdate >= date '1994-01-01' and l_receiptdate < date '1994-01-01' + interval '1' year group by c_name order by c_name limit 1;
select 100.00 * sum(case when c_mktsegment = 'automobile' and o_orderstatus = 'f' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as automobile_promo_revenue from lineitem, part, orders, customer where l_partkey = p_partkey and l_orderkey = o_orderkey and o_custkey = c_custkey and c_nationkey = 1 and o_orderdate >= date '1995-09-01' and o_orderdate < date '1995-09-01' + interval '1' month limit 1;
select o_custkey, sum(l_extendedprice * (1 - l_discount))  from lineitem, orders  where l_orderkey = o_orderkey  and l_shipdate >= date '1996-01-01'  and l_shipdate < date '1996-01-01' + interval '3' month  group by o_custkey;
select c_custkey, c_name, c_address, c_nationkey, c_phone, c_acctbal, c_mktsegment, count(distinct o_orderkey) as order_cnt  from customer, orders  where c_custkey = o_custkey  and c_mktsegment = 'automobile'  and c_nationkey not in (      select n_nationkey      from nation      where n_name = 'russia'  )  and o_orderdate between '1992-01-01' and '1992-04-01'  and o_totalprice > 10000  and o_orderstatus <> 'f'  and o_orderpriority <> '2-high'  and o_clerk = 'clerk#000020'  group by c_custkey, c_name, c_address, c_nationkey, c_phone, c_acctbal, c_mktsegment  order by order_cnt desc, c_custkey, c_name, c_address, c_nationkey, c_phone, c_acctbal, c_mktsegment  limit 1;

select p.p_partkey, sum(p.p_retailprice * ps.ps_availqty) as value  from part p, partsupp ps, supplier s, nation n  where p.p_partkey = ps.ps_partkey  and ps.ps_suppkey = s.s_suppkey  and s.s_nationkey = n.n_nationkey  and n.n_name = 'france'  and p.p_type = 'electronic'  and p.p_size = 10  and s.s_acctbal > 10000  and ps.ps_supplycost < 100  group by p.p_partkey  having sum(p.p_retailprice * ps.ps_availqty) > (      select sum(p.p_retailprice * ps.ps_availqty) * 0.0001000000      from part p, partsupp ps, supplier s, nation n      where p.p_partkey = ps.ps_partkey      and ps.ps_suppkey = s.s_suppkey      and s.s_nationkey = n.n_nationkey      and n.n_name = 'france'      and p.p_type = 'electronic'      and p.p_size = 10      and s.s_acctbal > 10000      and ps.ps_supplycost < 100  )  order by value desc  limit 1;
select p_type, sum(case when p_retailprice > 100 then 1 else 0 end) as expensive_part_count, sum(case when p_retailprice <= 100 then 1 else 0 end) as cheap_part_count  from part, partsupp, supplier  where part.p_partkey = partsupp.ps_partkey  and partsupp.ps_suppkey = supplier.s_suppkey  and supplier.s_name = 'abc supplier'  and part.p_type in ('type a', 'type b')  and partsupp.ps_availqty > 10  and supplier.s_acctbal > 10000  group by p_type  order by p_type  limit 1;
select p_name, s_name, ps_availqty, l_extendedprice from part p join partsupp ps on p.p_partkey = ps.ps_partkey join supplier s on ps.ps_suppkey = s.s_suppkey join lineitem l on ps.ps_partkey = l.l_partkey and ps.ps_suppkey = l.l_suppkey where p.p_type = 'typea' and s.s_name = 'suppliera' order by l_extendedprice desc limit 10;
select 100.00 * sum(case when p_type like 'electronic%' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as electronic_revenue from lineitem, part, partsupp, supplier where l_partkey = p_partkey 	and l_suppkey = ps_suppkey 	and p_partkey = ps_partkey 	and ps_availqty > 0 	and s_acctbal > 10000 	and l_shipdate >= date '1995-09-01' 	and l_shipdate < date '1995-09-01' + interval '1' month limit 1;
select p.p_partkey, p.p_name, p.p_mfgr, p.p_brand, p.p_type, p.p_size, p.p_container, p.p_retailprice, p.p_comment from part p inner join partsupp ps on p.p_partkey = ps.ps_partkey inner join supplier s on ps.ps_suppkey = s.s_suppkey inner join lineitem l on ps.ps_partkey = l.l_partkey and ps.ps_suppkey = l.l_suppkey inner join orders o on l.l_orderkey = o.o_orderkey inner join customer c on o.o_custkey = c.c_custkey where c.c_custkey = 1 and o.o_orderstatus = 'f' and p.p_brand = 'brand1' and s.s_name = 'supplier1' and l.l_shipdate >= '1996-01-01'  and l.l_shipdate < '1996-04-01';
select p_brand, p_type, p_size, count(distinct ps_suppkey) as supplier_cnt  from partsupp, part, supplier  where p_partkey = ps_partkey  and ps_suppkey = s_suppkey  and p_brand <> 'brand#45'  and p_type not like 'medium polished%'  and p_size in (49, 14, 23, 45, 19, 3, 36, 9)  and ps_suppkey not in (      select s_suppkey      from supplier      where s_comment like '%customer%complaints%'  )  group by p_brand, p_type, p_size  order by supplier_cnt desc, p_brand, p_type, p_size  limit 1;
select sum(ps_availqty) / 10.0 as avg_stock  from partsupp  join part on part.p_partkey = partsupp.ps_partkey  join supplier on supplier.s_suppkey = partsupp.ps_suppkey  where p_brand = 'brand#23'  and p_container = 'med box'  and ps_supplycost < (select 0.2 * avg(ps_supplycost)                       from partsupp                       where ps_partkey = part.p_partkey)  limit 1;
select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, partsupp, supplier, part  where (ps_partkey = l_partkey and ps_suppkey = l_suppkey and s_suppkey = ps_suppkey and p_partkey = ps_partkey  and p_brand = 'brand#12' and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg') and l_quantity >= 1 and l_quantity <= 1 + 10  and p_size between 1 and 5 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person')  or (ps_partkey = l_partkey and ps_suppkey = l_suppkey and s_suppkey = ps_suppkey and p_partkey = ps_partkey  and p_brand = 'brand#23' and p_container in ('med bag', 'med box', 'med pkg', 'med pack') and l_quantity >= 10 and l_quantity <= 10 + 10  and p_size between 1 and 10 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person')  or (ps_partkey = l_partkey and ps_suppkey = l_suppkey and s_suppkey = ps_suppkey and p_partkey = ps_partkey  and p_brand = 'brand#34' and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg') and l_quantity >= 20 and l_quantity <= 20 + 10  and p_size between 1 and 15 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person')  limit 1;

select p_name, count(*) as num from part, supplier, partsupp, lineitem, orders, customer where p_partkey = partsupp.ps_partkey and partsupp.ps_suppkey = supplier.s_suppkey and lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey and lineitem.l_orderkey = orders.o_orderkey and orders.o_custkey = customer.c_custkey and p_retailprice > 1000 and p_type = 'electronics' and s_name = 'abc supplier' and c_mktsegment = 'automobile' and l_shipdate > '2022-01-01' and l_commitdate < '2022-06-30' group by p_name order by num desc, p_name limit 100;
select s_name, count(*) as num_parts, sum(p_retailprice) as total_retail_price  from supplier  join partsupp on supplier.s_suppkey = partsupp.ps_suppkey join part on partsupp.ps_partkey = part.p_partkey where s_nationkey in (1, 2, 3, 4, 5, 6, 7, 8)  and p_type = 'type a'  and p_size > 50  and p_retailprice > (select avg(p_retailprice) from part where p_retailprice > 0.00 and p_type = 'type a' and p_size > 50)  and not exists (select * from lineitem where l_partkey = part.p_partkey) group by s_name order by num_parts desc limit 1;
select c_custkey, c_name, sum(o_totalprice) as sum_total_price, avg(o_totalprice) as avg_total_price, count(*) as count_order  from customer  join orders on customer.c_custkey = orders.o_custkey  where c_mktsegment = 'automobile' and o_orderdate <= date '2022-01-01'  group by c_custkey, c_name  order by sum_total_price desc  limit 1;
select c_custkey, c_name, c_address, c_phone, c_acctbal, n_name, r_name from customer, nation, region where c_nationkey = n_nationkey and n_regionkey = r_regionkey and r_name = 'europe' and c_custkey in (select o_custkey from orders where o_totalprice >= 1000) and c_custkey in (select l_orderkey from lineitem where l_quantity >= 10) and c_custkey in (select l_suppkey from lineitem where l_discount <= 0.05) and c_custkey in (select ps_suppkey from partsupp where ps_supplycost <= 50) order by c_acctbal desc, n_name, c_name limit 100;
select c_name, sum(o_totalprice) as total_sales from customer c join nation n on c.c_nationkey = n.n_nationkey join region r on n.n_regionkey = r.r_regionkey join orders o on c.c_custkey = o.o_custkey join lineitem l on o.o_orderkey = l.l_orderkey join partsupp ps on l.l_partkey = ps.ps_partkey and l.l_suppkey = ps.ps_suppkey join supplier s on ps.ps_suppkey = s.s_suppkey where r.r_name = 'asia' and c.c_mktsegment = 'automobile' and s.s_nationkey = 10 group by c_name order by total_sales desc limit 1;
select n_name, count(distinct s_suppkey) as supplier_count from customer c  join orders o on c.c_custkey = o.o_custkey join lineitem l on o.o_orderkey = l.l_orderkey join supplier s on l.l_suppkey = s.s_suppkey join nation n on c.c_nationkey = n.n_nationkey join region r on n.n_regionkey = r.r_regionkey where r.r_name = 'asia'  and o.o_orderdate >= date '1994-01-01'  and o.o_orderdate < date '1995-01-01' group by n_name order by supplier_count desc limit 1;
select sum(l_extendedprice * l_discount) as revenue  from lineitem  inner join orders on lineitem.l_orderkey = orders.o_orderkey  inner join partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey  inner join supplier on partsupp.ps_suppkey = supplier.s_suppkey  inner join customer on orders.o_custkey = customer.c_custkey  inner join nation on customer.c_nationkey = nation.n_nationkey  inner join region on nation.n_regionkey = region.r_regionkey  where lineitem.l_shipdate >= date '1994-01-01'  and lineitem.l_shipdate < date '1994-01-01' + interval '1' year  and lineitem.l_discount between .06 - 0.01 and .06 + 0.01  and lineitem.l_quantity < 24  and customer.c_mktsegment = 'segment1'  and supplier.s_name = 'supplier1'  and region.r_name = 'region1'  limit 1;
select supp_nation, cust_nation, l_year, sum(volume) as revenue  from (     select n1.n_name as supp_nation, n2.n_name as cust_nation, extract(year from l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume      from supplier, lineitem, orders, customer, nation n1, nation n2      where s_suppkey = l_suppkey      and o_orderkey = l_orderkey      and c_custkey = o_custkey      and s_nationkey = n1.n_nationkey      and c_nationkey = n2.n_nationkey      and ((n1.n_name = 'france' and n2.n_name = 'germany') or (n1.n_name = 'germany' and n2.n_name = 'france'))      and l_shipdate between date '1995-01-01' and date '1996-12-31'  ) as shipping  group by supp_nation, cust_nation, l_year  order by supp_nation, cust_nation, l_year  limit 1;
select o_year,         sum(case when nation = 'france' then volume else 0 end) / sum(volume) as mkt_share  from (select extract(year from o_orderdate) as o_year,               l_extendedprice * (1 - l_discount) as volume,               n2.n_name as nation        from part, supplier, lineitem, orders, customer, nation n1, nation n2, region        where p_partkey = l_partkey          and s_suppkey = l_suppkey          and l_orderkey = o_orderkey          and o_custkey = c_custkey          and c_nationkey = n1.n_nationkey          and n1.n_regionkey = r_regionkey          and r_name = 'europe'          and s_nationkey = n2.n_nationkey          and o_orderdate between date '1996-01-01' and date '1997-12-31'          and p_type = 'stainless steel' ) as all_nations  group by o_year  order by o_year  limit 1;
select c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment  from customer  join orders on c_custkey = o_custkey join lineitem on l_orderkey = o_orderkey join partsupp on ps_partkey = l_partkey and ps_suppkey = l_suppkey join supplier on s_suppkey = ps_suppkey join nation on n_nationkey = c_nationkey join region on r_regionkey = n_regionkey where o_orderdate >= date '1994-01-01' and o_orderdate < date '1994-04-01' and l_returnflag = 'r' and s_nationkey = n_nationkey and r_regionkey = 1 group by c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment order by revenue desc limit 20;

select c_custkey, sum(o_totalprice) as value  from customer, orders, lineitem, partsupp, supplier, nation  where c_custkey = o_custkey  and o_orderkey = l_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey  and s_nationkey = n_nationkey  and n_name = 'china'  group by c_custkey  having sum(o_totalprice) > (   select sum(o_totalprice) * 0.0001000000    from customer, orders, lineitem, partsupp, supplier, nation    where c_custkey = o_custkey    and o_orderkey = l_orderkey    and l_partkey = ps_partkey    and l_suppkey = ps_suppkey    and ps_suppkey = s_suppkey    and s_nationkey = n_nationkey    and n_name = 'china' )  order by value desc  limit 1;
select      l_shipmode,     count(case when o_orderpriority = '1-urgent' or o_orderpriority = '2-high' then 1 else null end) as high_line_count,     count(case when o_orderpriority <> '1-urgent' and o_orderpriority <> '2-high' then 1 else null end) as low_line_count from     orders inner join     lineitem on orders.o_orderkey = lineitem.l_orderkey inner join     partsupp on lineitem.l_partkey = partsupp.ps_partkey and lineitem.l_suppkey = partsupp.ps_suppkey inner join     supplier on partsupp.ps_suppkey = supplier.s_suppkey inner join     customer on orders.o_custkey = customer.c_custkey inner join     nation on customer.c_nationkey = nation.n_nationkey inner join     region on nation.n_regionkey = region.r_regionkey where     l_shipmode in ('mail', 'ship')     and l_commitdate < l_receiptdate     and l_shipdate < l_commitdate     and l_receiptdate >= '1994-01-01'     and l_receiptdate < '1995-01-01' group by     l_shipmode order by     l_shipmode limit 1;
select n_name, count(*) as custdist from nation join region on n_regionkey = r_regionkey join customer on c_nationkey = n_nationkey left join orders on c_custkey = o_custkey and o_comment not like '%special%requests%' where n_name <> 'china' group by n_name order by custdist desc limit 1;
select 100.00 * sum(case when c_mktsegment = 'automobile' and o_orderdate >= date '1995-07-01' and o_orderdate < date '1995-07-01' + interval '1' month then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as automobile_revenue  from lineitem  join orders on l_orderkey = o_orderkey  join customer on o_custkey = c_custkey  where l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month  and c_mktsegment = 'automobile'  limit 1;
select distinct c_custkey, c_name, c_address, c_phone, c_acctbal, c_mktsegment  from customer, nation, region, orders, partsupp, supplier, lineitem  where c_custkey = o_custkey  and c_nationkey = n_nationkey  and n_regionkey = r_regionkey  and l_orderkey = o_orderkey  and l_partkey = ps_partkey  and l_suppkey = ps_suppkey  and ps_suppkey = s_suppkey  and s_nationkey = n_nationkey  and l_shipdate >= date '1996-01-01'  and l_shipdate < date '1996-01-01' + interval '3' month  and c_mktsegment = 'automobile'  and r_name = 'asia' and l_returnflag = 'n' and l_linestatus = 'o' and l_discount < 0.05 and l_tax > 0.05 and l_shipmode in ('air', 'ship') and l_quantity > 100 and ps_supplycost < 100 order by c_custkey;
select c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity) from customer join orders on c_custkey = o_custkey join lineitem on o_orderkey = l_orderkey where o_orderkey in (     select l_orderkey     from lineitem     join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey     join supplier on ps_suppkey = s_suppkey     join nation on s_nationkey = n_nationkey     join region on n_regionkey = r_regionkey     where r_name = 'asia'     and c_custkey in (         select c_custkey         from customer         join nation on c_nationkey = n_nationkey         join region on n_regionkey = r_regionkey         where r_name = 'europe'     ) ) group by c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice order by o_totalprice desc, o_orderdate limit 100;
select sum(l_extendedprice* (1 - l_discount)) as revenue  from lineitem, part, partsupp, orders, supplier, customer, nation, region  where p_partkey = l_partkey  and ps_partkey = p_partkey  and ps_suppkey = l_suppkey  and l_orderkey = o_orderkey  and o_custkey = c_custkey  and c_nationkey = n_nationkey  and n_regionkey = r_regionkey  and p_brand = 'brand#12'  and p_container in ('sm case', 'sm box', 'sm pack', 'sm pkg')  and l_quantity >= 1  and l_quantity <= 11  and p_size between 1 and 5  and l_shipmode in ('air', 'air reg')  and l_shipinstruct = 'deliver in person'  and (     (p_brand = 'brand#23' and p_container in ('med bag', 'med box', 'med pkg', 'med pack') and l_quantity >= 10 and l_quantity <= 20 and p_size between 1 and 10 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person')      or      (p_brand = 'brand#34' and p_container in ('lg case', 'lg box', 'lg pack', 'lg pkg') and l_quantity >= 20 and l_quantity <= 30 and p_size between 1 and 15 and l_shipmode in ('air', 'air reg') and l_shipinstruct = 'deliver in person') )  limit 1;
select c_name, c_address from customer, nation, region where c_nationkey = n_nationkey and n_regionkey = r_regionkey and c_custkey in ( select o_custkey from orders where o_orderkey in ( select l_orderkey from lineitem where l_partkey in ( select ps_partkey from partsupp where ps_suppkey in ( select s_suppkey from supplier where s_nationkey = n_nationkey and s_address like '%street%' ) ) and l_shipdate >= date '1994-01-01' and l_shipdate < date '1994-01-01' + interval '1' year ) ) and r_name = 'asia' order by c_name limit 1;

select o_orderkey, sum(l_extendedprice * (1 - l_discount)) as revenue, o_orderdate, o_shippriority from customer, orders, lineitem where c_custkey = o_custkey and o_orderkey = l_orderkey and c_mktsegment = 'automobile' and o_orderdate < date '1994-01-01' and l_shipdate > date '1994-01-01' group by o_orderkey, o_orderdate, o_shippriority order by revenue desc, o_orderdate limit 10;
select c_custkey, count(o_orderkey) as order_count, sum(o_totalprice) as total_price  from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey  join supplier on ps_suppkey = s_suppkey  where c_mktsegment = 'household'  and l_shipdate < l_commitdate  and l_receiptdate >= date '1995-01-01'  and l_receiptdate < date '1995-01-01' + interval '1' year  group by c_custkey  order by total_price desc  limit 1;
select n_name, count(*) as order_count from nation join region on n_regionkey = r_regionkey join customer on c_nationkey = n_nationkey join orders on c_custkey = o_custkey join lineitem on o_orderkey = l_orderkey join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey join supplier on ps_suppkey = s_suppkey where r_name = 'asia' and c_mktsegment = 'automobile' and s_name = 'supplier x' group by n_name order by order_count desc limit 1;
select 100.00 * sum(case when c_mktsegment = 'building' then l_extendedprice * (1 - l_discount) else 0 end) / sum(l_extendedprice * (1 - l_discount)) as building_revenue  from lineitem  join orders on l_orderkey = o_orderkey join customer on o_custkey = c_custkey  join nation on c_nationkey = n_nationkey  join region on n_regionkey = r_regionkey  join partsupp on l_partkey = ps_partkey and l_suppkey = ps_suppkey  join supplier on ps_suppkey = s_suppkey  join part on p_partkey = ps_partkey  where l_shipdate >= date '1995-09-01' and l_shipdate < date '1995-09-01' + interval '1' month  group by c_mktsegment  order by sum(l_extendedprice * (1 - l_discount)) desc  limit 1;
select l_suppkey, sum(l_extendedprice * (1 - l_discount)) as total_revenue from lineitem where l_shipdate >= date '1996-01-01' and l_shipdate < date '1996-01-01' + interval '3' month group by l_suppkey;
select c_name, c_mktsegment, count(distinct o_orderkey) as order_cnt  from customer, orders  where c_custkey = o_custkey  and c_mktsegment <> 'automobile'  and o_orderdate >= '1996-01-01'  and o_orderdate < '1997-01-01'  and o_orderkey not in (      select l_orderkey from lineitem      where l_returnflag = 'r'      and l_shipmode = 'mail'  )  group by c_name, c_mktsegment  order by order_cnt desc, c_name, c_mktsegment  limit 1;
select c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, sum(l_quantity)  from customer  join orders on c_custkey = o_custkey  join lineitem on o_orderkey = l_orderkey  where o_orderkey in (     select l_orderkey      from lineitem      group by l_orderkey      having sum(l_quantity) > 300 )  and c_nationkey in (     select n_nationkey      from nation      join region on n_regionkey = r_regionkey      where r_name = 'asia' )  and l_suppkey in (     select ps_suppkey      from partsupp      join supplier on ps_suppkey = s_suppkey      where s_name = 'supplier x' )  group by c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice  order by o_totalprice desc, o_orderdate  limit 100;

SELECT c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice, SUM(l_quantity) FROM customer, orders, lineitem WHERE o_orderkey IN ( SELECT l_orderkey FROM lineitem GROUP BY l_orderkey HAVING SUM(l_quantity) > 300 ) AND c_custkey = o_custkey AND o_orderkey = l_orderkey GROUP BY c_name, c_custkey, o_orderkey, o_orderdate, o_totalprice ORDER BY o_totalprice DESC, o_orderdate LIMIT 100;
SELECT c_count, count(*) as custdist FROM (SELECT c_custkey, count(o_orderkey) FROM customer LEFT OUTER JOIN orders ON c_custkey = o_custkey AND o_comment NOT LIKE '%special%requests%' GROUP BY c_custkey) as c_orders(c_custkey, c_count) GROUP BY c_count ORDER BY custdist DESC, c_count DESC LIMIT 1;
SELECT n_name, SUM(l_extendedprice * (1 - l_discount)) AS revenue FROM customer JOIN orders ON c_custkey = o_custkey JOIN lineitem ON l_orderkey = o_orderkey JOIN supplier ON l_suppkey = s_suppkey JOIN nation ON c_nationkey = s_nationkey AND s_nationkey = n_nationkey JOIN region ON n_regionkey = r_regionkey WHERE r_name = 'ASIA' AND o_orderdate >= DATE '1994-01-01' AND o_orderdate < DATE '1995-01-01' GROUP BY n_name ORDER BY revenue DESC LIMIT 1;
SELECT l_suppkey, SUM(l_extendedprice * (1 - l_discount)) AS total_revenue FROM lineitem WHERE l_shipdate >= DATE '1996-01-01' AND l_shipdate < DATE '1996-01-01' + INTERVAL '3' MONTH GROUP BY l_suppkey;
SELECT c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment FROM customer, orders, lineitem, nation WHERE c_custkey = o_custkey AND l_orderkey = o_orderkey AND o_orderdate >= date '1993-10-01' AND o_orderdate < date '1993-10-01' + interval '3' month AND l_returnflag = 'R' AND c_nationkey = n_nationkey GROUP BY c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment ORDER BY revenue DESC LIMIT 20;
SELECT n_name, sum(l_extendedprice * (1 - l_discount)) as revenue FROM customer JOIN orders ON c_custkey = o_custkey JOIN lineitem ON l_orderkey = o_orderkey JOIN supplier ON l_suppkey = s_suppkey JOIN nation ON c_nationkey = s_nationkey AND s_nationkey = n_nationkey JOIN region ON n_regionkey = r_regionkey WHERE r_name = 'ASIA' AND o_orderdate >= date '1994-01-01' AND o_orderdate < date '1995-01-01' GROUP BY n_name ORDER BY revenue DESC LIMIT 1;
SELECT SUM(l_extendedprice * l_discount) AS revenue FROM lineitem WHERE l_shipdate >= DATE '1994-01-01' AND l_shipdate < DATE '1994-01-01' + INTERVAL '1' YEAR AND l_discount BETWEEN 0.06 - 0.01 AND 0.06 + 0.01 AND l_quantity < 24 LIMIT 1;
SELECT s.s_suppkey, s.s_name, s.s_address, s.s_phone, r.total_revenue FROM supplier s JOIN ( SELECT l.l_suppkey, SUM(l.l_extendedprice * (1 - l.l_discount)) AS total_revenue FROM lineitem l WHERE l.l_shipdate >= DATE '1996-01-01' AND l.l_shipdate < DATE '1996-01-01' + INTERVAL '3' MONTH GROUP BY l.l_suppkey ) r ON s.s_suppkey = r.l_suppkey ORDER BY s.s_suppkey LIMIT 1;
